(1, 'Quản lý - Bảo trì', '{"name_en":"Qu\\u1ea3n l\\u00fd - B\\u1ea3o tr\\u00ec","name_jp":"Qu\\u1ea3n l\\u00fd - B\\u1ea3o tr\\u00ec"}', 'quan-ly-bao-tri-1', '{"alias_en":"quan-ly-bao-tri-1","alias_jp":"quan-ly-bao-tri-1"}', 2, '<p><span style="background-color:rgb(255, 255, 255); color:rgb(72, 72, 72); font-family:arial,verdana; font-size:12px">Sản xuất c&aacute;c sản phẩm kim loại nguy&ecirc;n chất (như một phần kim loại, th&ugrave;ng h&ograve;m v&agrave; c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y dựng) thường l&agrave; với chức năng tĩnh, cố định, chứ kh&ocirc;ng phải theo ng&agrave;nh 26 - 30, l&agrave; to&agrave;n bộ hoạt động sản xuất phối kết hợp hoặc qu&aacute; tr&igrave;nh lắp r&aacute;p c&aacute;c sản phẩm kim loại như loại đ&oacute; (thỉnh thoảng với một số kim loại kh&aacute;c) th&agrave;nh c&aacute;c đơn vị phức tạp trừ khi ch&uacute;ng l&agrave; c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y dựng với việc di dời từng phần ho&agrave;n to&agrave;n bằng điện hoặc quang học.&nbsp;</span></p>\r\n\r\n<p><span style="font-size:12px">Bảo dưỡng, sữa chữa c&aacute;c thiết bị, m&aacute;y m&oacute;c li&ecirc;n quan đến ng&agrave;nh t&iacute;n hiệu, giao th&ocirc;ng đường sắt</span></p>\r\n', '{"intro_en":"<p>C&ocirc;ng ty Th&eacute;p H\\u1ea3o An Ph&aacute;t, Chuy&ecirc;n Gia c&ocirc;ng khu&ocirc;n m\\u1eabu, Ch\\u1ebf t\\u1ea1o khu&ocirc;ng m\\u1eabu.&nbsp;Nh\\u1eadp Kh\\u1ea9u v&agrave; Ph&acirc;n ph\\u1ed1i tr\\u1ef1c ti\\u1ebfp th&eacute;p l&agrave;m khu&ocirc;n. Cung c\\u1ea5p th&eacute;p \\u0111\\u1eb7c bi\\u1ec7t cho ng&agrave;nh gia c&ocirc;ng c\\u01a1 kh&iacute; ch\\u1ebf t\\u1ea1o. H\\u1ec7 th\\u1ed1ng ph&acirc;n ph\\u1ed1i c\\u1ee7a ch&uacute;ng t&ocirc;i \\u0111&atilde; c&oacute; m\\u1eb7t t\\u1ea1i H&agrave; N\\u1ed9i, TP. H\\u1ed3 Ch&iacute; Minh, \\u0110\\u1ed3ng Nai, \\u0110&agrave; N\\u1eb5ng...<\\/p>\\r\\n","intro_jp":"<p>C&ocirc;ng ty Th&eacute;p H\\u1ea3o An Ph&aacute;t, Chuy&ecirc;n Gia c&ocirc;ng khu&ocirc;n m\\u1eabu, Ch\\u1ebf t\\u1ea1o kh