(21, ' Công ty TNHH MTV Thông tin tín hiệu đường sắt Đà Nẵng đón nhận Huân chương độc lập hạng nhì và Huân chương lao động hạng ba', '{"name_en":"B\\u00e0i 1","name_jp":"B\\u00e0i 1"}', '-cong-ty-tnhh-mtv-thong-tin-tin-hieu-duong-sat-da-nang-don-nhan-huan-chuong-doc-lap-hang-nhi-va-huan-chuong-lao-dong-hang-ba-21', '{"alias_en":"bai-1-21","alias_jp":"bai-1-21"}', 7, '<p><strong>Chiều ng&agrave;y 13-3, C&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hiệu đường sắt Đ&agrave; Nẵng tổ chức Lễ đ&oacute;n nhận Hu&acirc;n chương độc lập hạng nh&igrave; v&agrave; Hu&acirc;n chương lao động hạng ba của Chủ tịch nước trao tặng cho tập thể v&agrave; c&aacute; nh&acirc;n thuộc C&ocirc;ng ty. Tham dự buổi lễ c&oacute; Ph&oacute; Chủ tịch UBND th&agrave;nh phố Nguyễn Ngọc Tuấn, Ph&oacute; Tổng cục trưởng Tổng cục đường sắt Việt Nam Trần Phước Tiến v&agrave; l&atilde;nh đạo, c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n C&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hiệu đường sắt Đ&agrave; Nẵng.</strong></p>\r\n', '{"intro_en":"<p>Tinh th\\u1ea7n \\u0111o&agrave;n k\\u1ebft lu&ocirc;n l&agrave; t&acirc;m ni\\u1ec7m h&agrave;ng \\u0111\\u1ea7u c\\u1ee7a Ban L&atilde;nh \\u0110\\u1ea1o c&ocirc;ng ty. HAP h&agrave;ng n\\u0103m t\\u1ed5 ch\\u1ee9c ti\\u1ec7c t\\u1ea5t ni&ecirc;n, Tri &acirc;n c\\u1ea3m \\u01a1n ghi nh\\u1eadn s\\u1ef1 \\u0111&oacute;ng g&oacute;p c\\u1ee7a c&aacute;n b\\u1ed9 v&agrave; t\\u1eadp th\\u1ec3 HAP.<\\/p>\\r\\n","intro_jp":"<p>Tinh th\\u1ea7n \\u0111o&agrave;n k\\u1ebft lu&ocirc;n l&agrave; t&acirc;m ni\\u1ec7m h&agrave;ng \\u0111\\u1ea7u c\\u1ee7a Ban L&atilde;nh \\u0110\\u1ea1o c&ocirc;ng ty. HAP h&agrave;ng n\\u0103m t\\u1ed5 ch\\u1ee9c ti\\u1ec7c t\\u1ea5t ni&ecirc;n, Tri &acirc;n c\\u1ea3m \\u01a1n ghi nh\\u1eadn s\\u1ef1 \\u0111&oacute;ng g&oacute;p c\\u1ee7a c&aacute;n b\\u1ed9 v&agrave; t\\u1eadp th\\u1ec3 HAP.<\\/p>\\r\\n"}', '<p style="text-align:justify">C&ocirc;ng ty Th&ocirc;ng tin t&iacute;n hiệu đường sắt Đ&agrave; Nẵng th&agrave;nh lập ng&agrave;y 2-5-1979 với nhiệm vụ đảm bảo th&ocirc;ng tin th&ocirc;ng su&ocirc;t t&iacute;n hiệu an to&agrave;n phục vụ chạy t&agrave;u tr&ecirc;n tuyến đường sắt thống nhất trải d&agrave;i hơn 600km đi qua 7 tỉnh, th&agrave;nh phố miền Trung. Buổi ban đầu, cơ sở vật chất kỹ thuật hầu như chưa c&oacute;, địa h&igrave;nh quản l&yacute; qua nhiều đ&egrave;o dốc hiểm trở, thiết bị đa số nằm ngo&agrave;i trời, đặc biệt l&agrave; khu vực c&oacute; thời tiết nắng n&oacute;ng lũ lụt nhiều, nhưng với sự phấn đấu kh&ocirc;ng mệt mỏi của đội ngũ 400 c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n, 35 năm qua, C&ocirc;ng ty đ&atilde; ho&agrave;n th&agrave;nh xuất sắc nhiệm vụ ch&iacute;nh trị được giao, cơ sở vật chất kỹ thuật được đầu tư trang bị hiện đại. Sản xuất tăng trường mạnh, đời sống vật chất v&agrave; tinh thần của c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n được cải thiện. C&ocirc;ng ty đ&atilde; thực hiện nhiều biện ph&aacute;p đem lại hiệu quả cao trong những năm qua như: hiệu suất khai th&aacute;c thiết bị đạt 99%, chất lượng duy tu đạt 98%, độ ổn định của đường ngang cảnh b&aacute;o tự động đạt 100%. An to&agrave;n chạy t&agrave;u được giữ vững, kh&ocirc;ng c&oacute; tai nạn chạy t&agrave;u do thiết bị th&ocirc;ng tin t&iacute;n hiệu g&acirc;y ra; an to&agrave;n lao động, ANTT, ph&ograve;ng chống ch&aacute;y nổ được đảm bảo. Kết quả SXKD năm 2012 đạt 61,5 tỷ đồng, tăng trưởng 16,22%.</p>\r\n\r\n<p style="text-align:justify">Ghi nhận những th&agrave;nh t&iacute;ch đạt được trong 5 năm qua, Chủ tịch nước đ&atilde; tặng thưởng tập thể c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n c&ocirc;ng ty Hu&acirc;n chương Độc lập hạng II v&agrave; &ocirc;ng Nguyễn Văn Ngồ - Chủ tịch ki&ecirc;m Gi&aacute;m đốc C&ocirc;ng ty Hu&acirc;n chương lao động hạng III.</p>\r\n\r\n<p style="text-align:center"><img alt="" src="http://www.danang.gov.vn/images/danang/image/Nam%202014/thang%203/duong%20sat.jpg" style="border:1px solid rgb(222, 222, 222); font-family:inherit; font-style:inherit; font-weight:inherit; height:300px; margin:5px; padding:3px; vertical-align:baseline; width:439px" /></p>\r\n\r\n<p style="text-align:justify">Thay mặt l&atilde;nh đạo th&agrave;nh phố, Ph&oacute; Chủ tịch UBND th&agrave;nh phố Nguyễn Ngọc Tuấn đ&atilde; biểu dương những th&agrave;nh quả đạt được của c&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hiệu đường sắt Đ&agrave; Nẵng v&agrave; đội ngũ l&atilde;nh đạo c&ocirc;ng ty, đồng thời mong muốn c&ocirc;ng ty tiếp tục ph&aacute;t huy nhiệm vụ đảm bảo th&ocirc;ng tin th&ocirc;ng suốt t&iacute;n hiệu an to&agrave;n phục vụ tuyến đường sắt Bắc Nam n&oacute;i chung v&agrave; 7 tỉnh miền Trung n&oacute;i ri&ecirc;ng.</p>\r\n\r\n<p style="text-align:right"><strong>C&Ocirc;NG T&Acirc;M</strong></p>\r\n', '{"content_en":"<p style=\\"text-align:justify\\">C&ocirc;ng ty Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110&agrave; N\\u1eb5ng th&agrave;nh l\\u1eadp ng&agrave;y 2-5-1979 v\\u1edbi nhi\\u1ec7m v\\u1ee5 \\u0111\\u1ea3m b\\u1ea3o th&ocirc;ng tin th&ocirc;ng su&ocirc;t t&iacute;n hi\\u1ec7u an to&agrave;n ph\\u1ee5c v\\u1ee5 ch\\u1ea1y t&agrave;u tr&ecirc;n tuy\\u1ebfn \\u0111\\u01b0\\u1eddng s\\u1eaft th\\u1ed1ng nh\\u1ea5t tr\\u1ea3i d&agrave;i h\\u01a1n 600km \\u0111i qua 7 t\\u1ec9nh, th&agrave;nh ph\\u1ed1 mi\\u1ec1n Trung. Bu\\u1ed5i ban \\u0111\\u1ea7u, c\\u01a1 s\\u1edf v\\u1eadt ch\\u1ea5t k\\u1ef9 thu\\u1eadt h\\u1ea7u nh\\u01b0 ch\\u01b0a c&oacute;, \\u0111\\u1ecba h&igrave;nh qu\\u1ea3n l&yacute; qua nhi\\u1ec1u \\u0111&egrave;o d\\u1ed1c hi\\u1ec3m tr\\u1edf, thi\\u1ebft b\\u1ecb \\u0111a s\\u1ed1 n\\u1eb1m ngo&agrave;i tr\\u1eddi, \\u0111\\u1eb7c bi\\u1ec7t l&agrave; khu v\\u1ef1c c&oacute; th\\u1eddi ti\\u1ebft n\\u1eafng n&oacute;ng l\\u0169 l\\u1ee5t nhi\\u1ec1u, nh\\u01b0ng v\\u1edbi s\\u1ef1 ph\\u1ea5n \\u0111\\u1ea5u kh&ocirc;ng m\\u1ec7t m\\u1ecfi c\\u1ee7a \\u0111\\u1ed9i ng\\u0169 400 c&aacute;n b\\u1ed9 c&ocirc;ng nh&acirc;n vi&ecirc;n, 35 n\\u0103m qua, C&ocirc;ng ty \\u0111&atilde; ho&agrave;n th&agrave;nh xu\\u1ea5t s\\u1eafc nhi\\u1ec7m v\\u1ee5 ch&iacute;nh tr\\u1ecb \\u0111\\u01b0\\u1ee3c giao, c\\u01a1 s\\u1edf v\\u1eadt ch\\u1ea5t k\\u1ef9 thu\\u1eadt \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 trang b\\u1ecb hi\\u1ec7n \\u0111\\u1ea1i. S\\u1ea3n xu\\u1ea5t t\\u0103ng tr\\u01b0\\u1eddng m\\u1ea1nh, \\u0111\\u1eddi s\\u1ed1ng v\\u1eadt ch\\u1ea5t v&agrave; tinh th\\u1ea7n c\\u1ee7a c&aacute;n b\\u1ed9 c&ocirc;ng nh&acirc;n vi&ecirc;n \\u0111\\u01b0\\u1ee3c c\\u1ea3i thi\\u1ec7n. C&ocirc;ng ty \\u0111&atilde; th\\u1ef1c hi\\u1ec7n nhi\\u1ec1u bi\\u1ec7n ph&aacute;p \\u0111em l\\u1ea1i hi\\u1ec7u qu\\u1ea3 cao trong nh\\u1eefng n\\u0103m qua nh\\u01b0: hi\\u1ec7u su\\u1ea5t khai th&aacute;c thi\\u1ebft b\\u1ecb \\u0111\\u1ea1t 99%, ch\\u1ea5t l\\u01b0\\u1ee3ng duy tu \\u0111\\u1ea1t 98%, \\u0111\\u1ed9 \\u1ed5n \\u0111\\u1ecbnh c\\u1ee7a \\u0111\\u01b0\\u1eddng ngang c\\u1ea3nh b&aacute;o t\\u1ef1 \\u0111\\u1ed9ng \\u0111\\u1ea1t 100%. An to&agrave;n ch\\u1ea1y t&agrave;u \\u0111\\u01b0\\u1ee3c gi\\u1eef v\\u1eefng, kh&ocirc;ng c&oacute; tai n\\u1ea1n ch\\u1ea1y t&agrave;u do thi\\u1ebft b\\u1ecb th&ocirc;ng tin t&iacute;n hi\\u1ec7u g&acirc;y ra; an to&agrave;n lao \\u0111\\u1ed9ng, ANTT, ph&ograve;ng ch\\u1ed1ng ch&aacute;y n\\u1ed5 \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea3m b\\u1ea3o. K\\u1ebft qu\\u1ea3 SXKD n\\u0103m 2012 \\u0111\\u1ea1t 61,5 t\\u1ef7 \\u0111\\u1ed3ng, t\\u0103ng tr\\u01b0\\u1edfng 16,22%.<\\/p>\\r\\n\\r\\n<p style=\\"text-align:justify\\">Ghi nh\\u1eadn nh\\u1eefng th&agrave;nh t&iacute;ch \\u0111\\u1ea1t \\u0111\\u01b0\\u1ee3c trong 5 n\\u0103m qua, Ch\\u1ee7 t\\u1ecbch n\\u01b0\\u1edbc \\u0111&atilde; t\\u1eb7ng th\\u01b0\\u1edfng t\\u1eadp th\\u1ec3 c&aacute;n b\\u1ed9 c&ocirc;ng nh&acirc;n vi&ecirc;n c&ocirc;ng ty Hu&acirc;n ch\\u01b0\\u01a1ng \\u0110\\u1ed9c l\\u1eadp h\\u1ea1ng II v&agrave; &ocirc;ng Nguy\\u1ec5n V\\u0103n Ng\\u1ed3 - Ch\\u1ee7 t\\u1ecbch ki&ecirc;m Gi&aacute;m \\u0111\\u1ed1c C&ocirc;ng ty Hu&acirc;n ch\\u01b0\\u01a1ng lao \\u0111\\u1ed9ng h\\u1ea1ng III.<\\/p>\\r\\n\\r\\n<p style=\\"text-align:center\\"><img alt=\\"\\" src=\\"http:\\/\\/www.danang.gov.vn\\/images\\/danang\\/image\\/Nam%202014\\/thang%203\\/duong%20sat.jpg\\" style=\\"border:1px solid rgb(222, 222, 222); font-family:inherit; font-style:inherit; font-weight:inherit; height:300px; margin:5px; padding:3px; vertical-align:baseline; width:439px\\" \\/><\\/p>\\r\\n\\r\\n<p style=\\"text-align:justify\\">Thay m\\u1eb7t l&atilde;nh \\u0111\\u1ea1o th&agrave;nh ph\\u1ed1, Ph&oacute; Ch\\u1ee7 t\\u1ecbch UBND th&agrave;nh ph\\u1ed1 Nguy\\u1ec5n Ng\\u1ecdc Tu\\u1ea5n \\u0111&atilde; bi\\u1ec3u d\\u01b0\\u01a1ng nh\\u1eefng th&agrave;nh qu\\u1ea3 \\u0111\\u1ea1t \\u0111\\u01b0\\u1ee3c c\\u1ee7a c&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110&agrave; N\\u1eb5ng v&agrave; \\u0111\\u1ed9i ng\\u0169 l&atilde;nh \\u0111\\u1ea1o c&ocirc;ng ty, \\u0111\\u1ed3ng th\\u1eddi mong mu\\u1ed1n c&ocirc;ng ty ti\\u1ebfp t\\u1ee5c ph&aacute;t huy nhi\\u1ec7m v\\u1ee5 \\u0111\\u1ea3m b\\u1ea3o th&ocirc;ng tin th&ocirc;ng su\\u1ed1t t&iacute;n hi\\u1ec7u an to&agrave;n ph\\u1ee5c v\\u1ee5 tuy\\u1ebfn \\u0111\\u01b0\\u1eddng s\\u1eaft B\\u1eafc Nam n&oacute;i chung v&agrave; 7 t\\u1ec9nh mi\\u1ec1n Trung n&oacute;i ri&ecirc;ng.<\\/p>\\r\\n\\r\\n<p style=\\"text-align:right\\"><strong>C&Ocirc;NG T&Acirc;M<\\/strong><\\/p>\\r\\n","content_jp":"<p style=\\"text-align:justify\\">C&ocirc;ng ty Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110&agrave; N\\u1eb5ng th&agrave;nh l\\u1eadp ng&agrave;y 2-5-1979 v\\u1edbi nhi\\u1ec7m v\\u1ee5 \\u0111\\u1ea3m b\\u1ea3o th&ocirc;ng tin th&ocirc;ng su&ocirc;t t&iacute;n hi\\u1ec7u an to&agrave;n ph\\u1ee5c v\\u1ee5 ch\\u1ea1y t&agrave;u tr&ecirc;n tuy\\u1ebfn \\u0111\\u01b0\\u1eddng s\\u1eaft th\\u1ed1ng nh\\u1ea5t tr\\u1ea3i d&agrave;i h\\u01a1n 600km \\u0111i qua 7 t\\u1ec9nh, th&agrave;nh ph\\u1ed1 mi\\u1ec1n Trung. Bu\\u1ed5i ban \\u0111\\u1ea7u, c\\u01a1 s\\u1edf v\\u1eadt ch\\u1ea5t k\\u1ef9 thu\\u1eadt h\\u1ea7u nh\\u01b0 ch\\u01b0a c&oacute;, \\u0111\\u1ecba h&igrave;nh qu\\u1ea3n l&yacute; qua nhi\\u1ec1u \\u0111&egrave;o d\\u1ed1c hi\\u1ec3m tr\\u1edf, thi\\u1ebft b\\u1ecb \\u0111a s\\u1ed1 n\\u1eb1m ngo&agrave;i tr\\u1eddi, \\u0111\\u1eb7c bi\\u1ec7t l&agrave; khu v\\u1ef1c c&oacute; th\\u1eddi ti\\u1ebft n\\u1eafng n&oacute;ng l\\u0169 l\\u1ee5t nhi\\u1ec1u, nh\\u01b0ng v\\u1edbi s\\u1ef1 ph\\u1ea5n \\u0111\\u1ea5u kh&ocirc;ng m\\u1ec7t m\\u1ecfi c\\u1ee7a \\u0111\\u1ed9i ng\\u0169 400 c&aacute;n b\\u1ed9 c&ocirc;ng nh&acirc;n vi&ecirc;n, 35 n\\u0103m qua, C&ocirc;ng ty \\u0111&atilde; ho&agrave;n th&agrave;nh xu\\u1ea5t s\\u1eafc nhi\\u1ec7m v\\u1ee5 ch&iacute;nh tr\\u1ecb \\u0111\\u01b0\\u1ee3c giao, c\\u01a1 s\\u1edf v\\u1eadt ch\\u1ea5t k\\u1ef9 thu\\u1eadt \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 trang b\\u1ecb hi\\u1ec7n \\u0111\\u1ea1i. S\\u1ea3n xu\\u1ea5t t\\u0103ng tr\\u01b0\\u1eddng m\\u1ea1nh, \\u0111\\u1eddi s\\u1ed1ng v\\u1eadt ch\\u1ea5t v&agrave; tinh th\\u1ea7n c\\u1ee7a c&aacute;n b\\u1ed9 c&ocirc;ng nh&acirc;n vi&ecirc;n \\u0111\\u01b0\\u1ee3c c\\u1ea3i thi\\u1ec7n. C&ocirc;ng ty \\u0111&atilde; th\\u1ef1c hi\\u1ec7n nhi\\u1ec1u bi\\u1ec7n ph&aacute;p \\u0111em l\\u1ea1i hi\\u1ec7u qu\\u1ea3 cao trong nh\\u1eefng n\\u0103m qua nh\\u01b0: hi\\u1ec7u su\\u1ea5t khai th&aacute;c thi\\u1ebft b\\u1ecb \\u0111\\u1ea1t 99%, ch\\u1ea5t l\\u01b0\\u1ee3ng duy tu \\u0111\\u1ea1t 98%, \\u0111\\u1ed9 \\u1ed5n \\u0111\\u1ecbnh c\\u1ee7a \\u0111\\u01b0\\u1eddng ngang c\\u1ea3nh b&aacute;o t\\u1ef1 \\u0111\\u1ed9ng \\u0111\\u1ea1t 100%. An to&agrave;n ch\\u1ea1y t&agrave;u \\u0111\\u01b0\\u1ee3c gi\\u1eef v\\u1eefng, kh&ocirc;ng c&oacute; tai n\\u1ea1n ch\\u1ea1y t&agrave;u do thi\\u1ebft b\\u1ecb th&ocirc;ng tin t&iacute;n hi\\u1ec7u g&acirc;y ra; an to&agrave;n lao \\u0111\\u1ed9ng, ANTT, ph&ograve;ng ch\\u1ed1ng ch&aacute;y n\\u1ed5 \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea3m b\\u1ea3o. K\\u1ebft qu\\u1ea3 SXKD n\\u0103m 2012 \\u0111\\u1ea1t 61,5 t\\u1ef7 \\u0111\\u1ed3ng, t\\u0103ng tr\\u01b0\\u1edfng 16,22%.<\\/p>\\r\\n\\r\\n<p style=\\"text-align:justify\\">Ghi nh\\u1eadn nh\\u1eefng th&agrave;nh t&iacute;ch \\u0111\\u1ea1t \\u0111\\u01b0\\u1ee3c trong 5 n\\u0103m qua, Ch\\u1ee7 t\\u1ecbch n\\u01b0\\u1edbc \\u0111&atilde; t\\u1eb7ng th\\u01b0\\u1edfng t\\u1eadp th\\u1ec3 c&aacute;n b\\u1ed9 c&ocirc;ng nh&acirc;n vi&ecirc;n c&ocirc;ng ty Hu&acirc;n ch\\u01b0\\u01a1ng \\u0110\\u1ed9c l\\u1eadp h\\u1ea1ng II v&agrave; &ocirc;ng Nguy\\u1ec5n V\\u0103n Ng\\u1ed3 - Ch\\u1ee7 t\\u1ecbch ki&ecirc;m Gi&aacute;m \\u0111\\u1ed1c C&ocirc;ng ty Hu&acirc;n ch\\u01b0\\u01a1ng lao \\u0111\\u1ed9ng h\\u1ea1ng III.<\\/p>\\r\\n\\r\\n<p style=\\"text-align:center\\"><img alt=\\"\\" src=\\"http:\\/\\/www.danang.gov.vn\\/images\\/danang\\/image\\/Nam%202014\\/thang%203\\/duong%20sat.jpg\\" style=\\"border:1px solid rgb(222, 222, 222); font-family:inherit; font-style:inherit; font-weight:inherit; height:300px; margin:5px; padding:3px; vertical-align:baseline; width:439px\\" \\/><\\/p>\\r\\n\\r\\n<p style=\\"text-align:justify\\">Thay m\\u1eb7t l&atilde;nh \\u0111\\u1ea1o th&agrave;nh ph\\u1ed1, Ph&oacute; Ch\\u1ee7 t\\u1ecbch UBND th&agrave;nh ph\\u1ed1 Nguy\\u1ec5n Ng\\u1ecdc Tu\\u1ea5n \\u0111&atilde; bi\\u1ec3u d\\u01b0\\u01a1ng nh\\u1eefng th&agrave;nh qu\\u1ea3 \\u0111\\u1ea1t \\u0111\\u01b0\\u1ee3c c\\u1ee7a c&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110&agrave; N\\u1eb5ng v&agrave; \\u0111\\u1ed9i ng\\u0169 l&atilde;nh \\u0111\\u1ea1o c&ocirc;ng ty, \\u0111\\u1ed3ng th\\u1eddi mong mu\\u1ed1n c&ocirc;ng ty ti\\u1ebfp t\\u1ee5c ph&aacute;t huy nhi\\u1ec7m v\\u1ee5 \\u0111\\u1ea3m b\\u1ea3o th&ocirc;ng tin th&ocirc;ng su\\u1ed1t t&iacute;n hi\\u1ec7u an to&agrave;n ph\\u1ee5c v\\u1ee5 tuy\\u1ebfn \\u0111\\u01b0\\u1eddng s\\u1eaft B\\u1eafc Nam n&oacute;i chung v&agrave; 7 t\\u1ec9nh mi\\u1ec1n Trung n&oacute;i ri&ecirc;ng.<\\/p>\\r\\n\\r\\n<p style=\\"text-align:right\\"><strong>C&Ocirc;NG T&Acirc;M<\\/strong><\\/p>\\r\\n"}', 'Công ty TNHH MTV Thông tin tín hiệu đường sắt Đà Nẵng,  Lễ đón nhận Huân chương độc lập hạng nhì và Huân chương lao động hạng ba', '{"keyword_en":"Ti\\u1ec7c t\\u1ea5t ni\\u00ean, H\\u1ea3o An Ph\\u00e1t","keyword_jp":"Ti\\u1ec7c t\\u1ea5t ni\\u00ean, H\\u1ea3o An Ph\\u00e1t"}', '/public/media/files/duong_sat.jpg', '0000-00-00 00:00:00', '', 0, '', 0);
