(30, 'Thông tin tuyển dụng 2016', '{"name_en":"Th\\u00f4ng tin tuy\\u1ec3n d\\u1ee5ng 2016","name_jp":"Th\\u00f4ng tin tuy\\u1ec3n d\\u1ee5ng 2016"}', 'thong-tin-tuyen-dung-2016-30', '{"alias_en":"thong-tin-tuyen-dung-2016-30","alias_jp":"thong-tin-tuyen-dung-2016-30"}', 9, '<div>Chưa c&oacute; th&ocirc;ng tin tuyển dụng mới</div>\r\n\r\n<div>\r\n<div class="col-xs-8 offset20 push-left-20 summay-company" style="font-family: Arial; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; color: rgb(54, 54, 54); width: 620px; float: left; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: initial;">\r\n<div>\r\n<div class="clearfix" style="font-family: Arial; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; color: rgb(54, 54, 54); clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: initial;">&nbsp;</div>\r\n</div>\r\n</div>\r\n\r\n<div class="clearfix" style="font-family: Arial; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; color: rgb(54, 54, 54); clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: initial;">&nbsp;</div>\r\n</div>\r\n', '{"intro_en":"<p><span style=\\"color:rgb(0, 0, 0); font-family:arial; font-size:12px\\">Xu\\u1ea5t kh\\u1ea9u th&eacute;p c\\u1ee7a Trung Qu\\u1ed1c t\\u0103ng v&agrave; \\u0111\\u1ea1t m\\u1ee9c cao nh\\u1ea5t trong th&aacute;ng 5 nh\