ddng k\\u1ef3 h\\u1ea1n nh\\u1eadn th\\u1ee9c \\u0111\\u01b0\\u1ee3c t&igrave;nh tr\\u1ea1ng d\\u01b0 cung v&agrave; c\\u1ea7u gi\\u1ea3m t\\u1eeb m\\u1ed9t s\\u1ed1 ng&agrave;nh c&ocirc;ng nghi\\u1ec7p bao g\\u1ed3m ch\\u1ebf t\\u1ea1o m&aacute;y, \\u0111\\u1ed3 gia d\\u1ee5ng v&agrave; c&ocirc;ng nghi\\u1ec7p &ocirc; t&ocirc;. Tuy nhi&ecirc;n, theo l\\u1eddi m\\u1ed9t nh&agrave; ph&acirc;n t&iacute;ch \\u1edf Th\\u01b0\\u1ee3ng H\\u1ea3i, ch\\u1ec9 s\\u1ed1 gi&aacute; qu\\u1eb7ng s\\u1eaft c\\u1ee7a Platt c&oacute; th\\u1ec3 h\\u1ed3i ph\\u1ee5c l&ecirc;n m\\u1ee9c 100 USD\\/t\\u1ea5n c&ugrave;ng v\\u1edbi vi\\u1ec7c m\\u1ee9c t\\u1ed3n kho th\\u1ea5p tr&ecirc;n th\\u1ecb tr\\u01b0\\u1eddng v&agrave; t\\u1ea1i c&aacute;c nh&agrave; m&aacute;y c\\u0169ng nh\\u01b0 c&aacute;c ch&iacute;nh s&aacute;ch t&iacute;ch c\\u1ef1c c\\u1ee7a ch&iacute;nh ph\\u1ee7 c&oacute; th\\u1ec3 h\\u1ed7 tr\\u1ee3 gi&aacute; th&eacute;p.<\\/span><br \\/>\\r\\n<br \\/>\\r\\n<span style=\\"color:rgb(0, 0, 0); font-family:arial; font-size:12px\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; T\\u1ed3n kho HRC t\\u1ea1i 33 th&agrave;nh ph\\u1ed1 l\\u1edbn c\\u1ee7a Trung Qu\\u1ed1c \\u0111\\u1ea1t m\\u1ee9c 3,26 tri\\u1ec7u t\\u1ea5n v&agrave;o ng&agrave;y 6\\/6, gi\\u1ea3m 47.400 t\\u1ea5n so v\\u1edbi tu\\u1ea7n tr\\u01b0\\u1edbc \\u0111&oacute;, theo s\\u1ed1 li\\u1ec7u c\\u1ee7a nh&agrave; cung c\\u1ea5p th&ocirc;ng tin trong n\\u1ed9i \\u0111\\u1ecba c\\u1ee7a Mysteel.<\\/span><br \\/>\\r\\n<span style=\\"color:rgb(0, 0, 0); font-family:arial; font-size:12px\\">M\\u1ed9t nh&agrave; ph&acirc;n ph\\u1ed1i t\\u1ea1i L\\u1ea1c T&ugrave;ng n&oacute;i &ldquo;gi&aacute; HRC t\\u1ea1i ch\\u1ee3 L\\u1ea1c T&ugrave;ng c&oacute; th\\u1ec3 s\\u1ebd \\u1ed5n \\u0111\\u1ecbnh khi m&agrave; c&aacute;c nh&agrave; kinh doanh t\\u1eeb tr\\u01b0\\u1edbc \\u0111&atilde; kh&ocirc;ng mu\\u1ed1n b&aacute;n h&agrave;ng gi&aacute; r\\u1ebb do vi\\u1ec7c thi\\u1ebfu h\\u1ee5t ngu\\u1ed3n cung&rdquo;.<\\/span><\\/p>\\r\\n