(34, 'Đường sắt Cát Linh - Hà Đông: Chưa hoạt động đã có hiện tượng gỉ sét', '{"name_en":"\\u0110\\u01b0\\u1eddng s\\u1eaft C\\u00e1t Linh - H\\u00e0 \\u0110\\u00f4ng: Ch\\u01b0a ho\\u1ea1t \\u0111\\u1ed9ng \\u0111\\u00e3 c\\u00f3 hi\\u1ec7n t\\u01b0\\u1ee3ng g\\u1ec9 s\\u00e9t","name_jp":"\\u0110\\u01b0\\u1eddng s\\u1eaft C\\u00e1t Linh - H\\u00e0 \\u0110\\u', 'duong-sat-cat-linh-ha-dong-chua-hoat-dong-da-co-hien-tuong-gi-set-34', '{"alias_en":"duong-sat-cat-linh-ha-dong-chua-hoat-dong-da-co-hien-tuong-gi-set-34","alias_jp":"duong-sat-cat-linh-ha-dong-chua-hoat-dong-da-co-hien-tuong-gi-set-34"}', 8, '<p><strong>Kết quả kiểm tra của Hội đồng nghiệm thu cho thấy, d&ugrave; tuyến đường chưa hoạt động nhưng một số vị tr&iacute; đang c&oacute; hiện tượng th&eacute;p bị gỉ s&eacute;t.</strong></p>\r\n', '{"intro_en":"<p><strong>K\\u1ebft qu\\u1ea3 ki\\u1ec3m tra c\\u1ee7a H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu cho th\\u1ea5y, d&ugrave; tuy\\u1ebfn \\u0111\\u01b0\\u1eddng ch\\u01b0a ho\\u1ea1t \\u0111\\u1ed9ng nh\\u01b0ng m\\u1ed9t s\\u1ed1 v\\u1ecb tr&iacute; \\u0111ang c&oacute; hi\\u1ec7n t\\u01b0\\u1ee3ng th&eacute;p b\\u1ecb g\\u1ec9 s&eacute;t.<\\/strong><\\/p>\\r\\n","intro_jp":"<p><strong>K\\u1ebft qu\\u1ea3 ki\\u1ec3m tra c\\u1ee7a H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu cho th\\u1ea5y, d&ugrave; tuy\\u1ebfn \\u0111\\u01b0\\u1eddng ch\\u01b0a ho\\u1ea1t \\u0111\\u1ed9ng nh\\u01b0ng m\\u1ed9t s\\u1ed1 v\\u1ecb tr&iacute; \\u0111ang c&oacute; hi\\u1ec7n t\\u01b0\\u1ee3ng th&eacute;p b\\u1ecb g\\u1ec9 s&eacute;t.<\\/strong><\\/p>\\r\\n"}', '<p>Theo nguồn tin b&aacute;o Người Đưa Tin c&oacute; được, Hội đồng nghiệm thu Nh&agrave; nước c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y dựng vừa c&oacute; kết quả kiểm tra hiện trường c&ocirc;ng tr&igrave;nh đường sắt tr&ecirc;n cao C&aacute;t Linh-H&agrave; Đ&ocirc;ng.</p>\r\n\r\n<p>Kết quả kiểm tra của Hội đồng nghiệm thu cho thấy, c&ocirc;ng tr&igrave;nh vẫn c&ograve;n nhiều tồn tại, trong đ&oacute;, một số hạng mục đang c&oacute; hiện tượng xuống cấp mặc d&ugrave; chưa được đưa v&agrave;o sử dụng như tại nh&agrave; ga C&aacute;t Linh, khu vực để cốt th&eacute;p chưa gia c&ocirc;ng, tại một số vị tr&iacute; chưa được che phủ đ&atilde; c&oacute; hiện tượng gỉ s&eacute;t.</p>\r\n\r\n<p>C&ugrave;ng với những vấn đề đ&oacute;, chất lượng v&aacute;n khu&ocirc;n tại một số vị tr&iacute; m&eacute;p cột, m&eacute;p dầm chưa được tốt dẫn đến t&igrave;nh trạng b&ecirc; t&ocirc;ng bị rỗ do mất nước. Một số nh&agrave; ga kh&aacute;c tr&ecirc;n tuyến do thời gian thi c&ocirc;ng k&eacute;o d&agrave;i n&ecirc;n nhiều cốt th&eacute;p chờ bị gỉ v&igrave; biện ph&aacute;p bảo vệ chưa tốt...</p>\r\n\r\n<p><a class="photo" href="http://2.i.baomoi.xdn.vn/16/06/07/202/19568155/1_134601.jpg" style="box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;"><img alt="Duong sat Cat Linh - Ha Dong: Chua hoat dong da co hien tuong gi set - Anh 1" src="http://2.i.baomoi.xdn.vn/w460x/16/06/07/202/19568155/1_134601.jpg" style="border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle" title="Đường sắt Cát Linh - Hà Đông: Chưa hoạt động đã có hiện tượng gỉ sét - Ảnh 1" /></a></p>\r\n\r\n<p><em>Đường sắt tr&ecirc;n cao C&aacute;t Linh - H&agrave; Đ&ocirc;ng</em></p>\r\n\r\n<p>Chia sẻ với b&aacute;o ch&iacute; về kết quả kiểm tra dự &aacute;n đường sắt C&aacute;t Linh &ndash; H&agrave; Đ&ocirc;ng, &ocirc;ng Phan Duy Thương - Ph&oacute; cục trưởng Cục Gi&aacute;m định Nh&agrave; nước về chất lượng c&ocirc;ng tr&igrave;nh x&acirc;y dựng cho biết, qua kiểm tra, ga C&aacute;t Linh, nh&agrave; thầu c&ograve;n bố tr&iacute; c&ocirc;ng nh&acirc;n sinh hoạt tạm tr&uacute; dưới tầng hầm v&agrave; đi lại dưới khu vực chưa c&oacute; m&aacute;i cứng che chắn; phế thải tại ga Thanh Xu&acirc;n 3 chưa được thanh thải; thiếu biển cảnh b&aacute;o, r&agrave;o ngăn, biện ph&aacute;p đảm bảo an to&agrave;n điện v&agrave; lối đi lại cho người lao động tại khu vực Depot.</p>\r\n\r\n<p>Tại c&ocirc;ng trường c&aacute;c nh&agrave; ga tr&ecirc;n tuyến c&ograve;n bố tr&iacute; thiếu c&aacute;c thiết bị, dụng cụ ph&ograve;ng chống ch&aacute;y nổ trong qu&aacute; tr&igrave;nh thi c&ocirc;ng x&acirc;y dựng theo quy định. Hồ sơ huấn luyện an to&agrave;n vệ sinh lao động lần đầu của một số đơn vị nh&agrave; thầu được lập chưa tu&acirc;n thủ; chưa đầy đủ hồ sơ theo d&otilde;i nh&acirc;n lực, thiết bị c&oacute; y&ecirc;u cầu nghi&ecirc;m ngặt về an to&agrave;n lao động theo quy định.</p>\r\n\r\n<p>Đ&aacute;nh gi&aacute; về c&ocirc;ng t&aacute;c thi c&ocirc;ng, Hội đồng nghiệm thu Nh&agrave; nước cho biết, từ thời điểm khởi c&ocirc;ng cho đến nay, c&aacute;c nh&agrave; thầu đ&atilde; thi c&ocirc;ng ho&agrave;n th&agrave;nh 419/419 trụ cầu thuộc c&aacute;c khu gian v&agrave; 122/122 trụ cầu tại c&aacute;c nh&agrave; ga, 12 nh&agrave; ga đang được thi c&ocirc;ng trong đ&oacute; 5 nh&agrave; ga đang thi c&ocirc;ng c&aacute;c hạng mục kết cấu khung th&eacute;p, ho&agrave;n th&agrave;nh đ&uacute;c 806 phiến dầm hộp giản đơn v&agrave; tổ chức thi c&ocirc;ng lắp dựng 758 phiến.</p>\r\n\r\n<p>Ngo&agrave;i ra, c&ocirc;ng t&aacute;c xử l&yacute; nền đất yếu tại khu vực Depot đ&atilde; cơ bản ho&agrave;n th&agrave;nh, hiện tại c&aacute;c nh&agrave; thầu đang tập trung triển khai thi c&ocirc;ng nh&agrave; điều h&agrave;nh, xưởng vận dụng, trung t&acirc;m duy tu...</p>\r\n\r\n<p>C&ocirc;ng t&aacute;c mua sắm, cung cấp thiết bị v&agrave; đảo tạo nh&acirc;n lực quản l&yacute; vận h&agrave;nh đang được thực hiện.</p>\r\n\r\n<p>C&aacute;c hạng mục c&ocirc;ng tr&igrave;nh đang được thi c&ocirc;ng như c&aacute;c trụ cầu, kết cấu b&ecirc; t&ocirc;ng, kết cấu khung dầm th&eacute;p của c&aacute;c nh&agrave; ga tr&ecirc;n tuyến, hệ nh&agrave; điều h&agrave;nh trung t&acirc;m cơ bản đảm bảo chất lượng theo y&ecirc;u cầu thiết kế v&agrave; c&aacute;c quy định kỹ thuật.</p>\r\n\r\n<p><strong>PV</strong></p>\r\n', '{"content_en":"<p>Theo ngu\\u1ed3n tin b&aacute;o Ng\\u01b0\\u1eddi \\u0110\\u01b0a Tin c&oacute; \\u0111\\u01b0\\u1ee3c, H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu Nh&agrave; n\\u01b0\\u1edbc c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y d\\u1ef1ng v\\u1eeba c&oacute; k\\u1ebft qu\\u1ea3 ki\\u1ec3m tra hi\\u1ec7n tr\\u01b0\\u1eddng c&ocirc;ng tr&igrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft tr&ecirc;n cao C&aacute;t Linh-H&agrave; \\u0110&ocirc;ng.<\\/p>\\r\\n\\r\\n<p>K\\u1ebft qu\\u1ea3 ki\\u1ec3m tra c\\u1ee7a H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu cho th\\u1ea5y, c&ocirc;ng tr&igrave;nh v\\u1eabn c&ograve;n nhi\\u1ec1u t\\u1ed3n t\\u1ea1i, trong \\u0111&oacute;, m\\u1ed9t s\\u1ed1 h\\u1ea1ng m\\u1ee5c \\u0111ang c&oacute; hi\\u1ec7n t\\u01b0\\u1ee3ng xu\\u1ed1ng c\\u1ea5p m\\u1eb7c d&ugrave; ch\\u01b0a \\u0111\\u01b0\\u1ee3c \\u0111\\u01b0a v&agrave;o s\\u1eed d\\u1ee5ng nh\\u01b0 t\\u1ea1i nh&agrave; ga C&aacute;t Linh, khu v\\u1ef1c \\u0111\\u1ec3 c\\u1ed1t th&eacute;p ch\\u01b0a gia c&ocirc;ng, t\\u1ea1i m\\u1ed9t s\\u1ed1 v\\u1ecb tr&iacute; ch\\u01b0a \\u0111\\u01b0\\u1ee3c che ph\\u1ee7 \\u0111&atilde; c&oacute; hi\\u1ec7n t\\u01b0\\u1ee3ng g\\u1ec9 s&eacute;t.<\\/p>\\r\\n\\r\\n<p>C&ugrave;ng v\\u1edbi nh\\u1eefng v\\u1ea5n \\u0111\\u1ec1 \\u0111&oacute;, ch\\u1ea5t l\\u01b0\\u1ee3ng v&aacute;n khu&ocirc;n t\\u1ea1i m\\u1ed9t s\\u1ed1 v\\u1ecb tr&iacute; m&eacute;p c\\u1ed9t, m&eacute;p d\\u1ea7m ch\\u01b0a \\u0111\\u01b0\\u1ee3c t\\u1ed1t d\\u1eabn \\u0111\\u1ebfn t&igrave;nh tr\\u1ea1ng b&ecirc; t&ocirc;ng b\\u1ecb r\\u1ed7 do m\\u1ea5t n\\u01b0\\u1edbc. M\\u1ed9t s\\u1ed1 nh&agrave; ga kh&aacute;c tr&ecirc;n tuy\\u1ebfn do th\\u1eddi gian thi c&ocirc;ng k&eacute;o d&agrave;i n&ecirc;n nhi\\u1ec1u c\\u1ed1t th&eacute;p ch\\u1edd b\\u1ecb g\\u1ec9 v&igrave; bi\\u1ec7n ph&aacute;p b\\u1ea3o v\\u1ec7 ch\\u01b0a t\\u1ed1t...<\\/p>\\r\\n\\r\\n<p><a class=\\"photo\\" href=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/16\\/06\\/07\\/202\\/19568155\\/1_134601.jpg\\" style=\\"box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;\\"><img alt=\\"Duong sat Cat Linh - Ha Dong: Chua hoat dong da co hien tuong gi set - Anh 1\\" src=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/w460x\\/16\\/06\\/07\\/202\\/19568155\\/1_134601.jpg\\" style=\\"border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle\\" title=\\"\\u0110\\u01b0\\u1eddng s\\u1eaft C\\u00e1t Linh - H\\u00e0 \\u0110\\u00f4ng: Ch\\u01b0a ho\\u1ea1t \\u0111\\u1ed9ng \\u0111\\u00e3 c\\u00f3 hi\\u1ec7n t\\u01b0\\u1ee3ng g\\u1ec9 s\\u00e9t - \\u1ea2nh 1\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<p><em>\\u0110\\u01b0\\u1eddng s\\u1eaft tr&ecirc;n cao C&aacute;t Linh - H&agrave; \\u0110&ocirc;ng<\\/em><\\/p>\\r\\n\\r\\n<p>Chia s\\u1ebb v\\u1edbi b&aacute;o ch&iacute; v\\u1ec1 k\\u1ebft qu\\u1ea3 ki\\u1ec3m tra d\\u1ef1 &aacute;n \\u0111\\u01b0\\u1eddng s\\u1eaft C&aacute;t Linh &ndash; H&agrave; \\u0110&ocirc;ng, &ocirc;ng Phan Duy Th\\u01b0\\u01a1ng - Ph&oacute; c\\u1ee5c tr\\u01b0\\u1edfng C\\u1ee5c Gi&aacute;m \\u0111\\u1ecbnh Nh&agrave; n\\u01b0\\u1edbc v\\u1ec1 ch\\u1ea5t l\\u01b0\\u1ee3ng c&ocirc;ng tr&igrave;nh x&acirc;y d\\u1ef1ng cho bi\\u1ebft, qua ki\\u1ec3m tra, ga C&aacute;t Linh, nh&agrave; th\\u1ea7u c&ograve;n b\\u1ed1 tr&iacute; c&ocirc;ng nh&acirc;n sinh ho\\u1ea1t t\\u1ea1m tr&uacute; d\\u01b0\\u1edbi t\\u1ea7ng h\\u1ea7m v&agrave; \\u0111i l\\u1ea1i d\\u01b0\\u1edbi khu v\\u1ef1c ch\\u01b0a c&oacute; m&aacute;i c\\u1ee9ng che ch\\u1eafn; ph\\u1ebf th\\u1ea3i t\\u1ea1i ga Thanh Xu&acirc;n 3 ch\\u01b0a \\u0111\\u01b0\\u1ee3c thanh th\\u1ea3i; thi\\u1ebfu bi\\u1ec3n c\\u1ea3nh b&aacute;o, r&agrave;o ng\\u0103n, bi\\u1ec7n ph&aacute;p \\u0111\\u1ea3m b\\u1ea3o an to&agrave;n \\u0111i\\u1ec7n v&agrave; l\\u1ed1i \\u0111i l\\u1ea1i cho ng\\u01b0\\u1eddi lao \\u0111\\u1ed9ng t\\u1ea1i khu v\\u1ef1c Depot.<\\/p>\\r\\n\\r\\n<p>T\\u1ea1i c&ocirc;ng tr\\u01b0\\u1eddng c&aacute;c nh&agrave; ga tr&ecirc;n tuy\\u1ebfn c&ograve;n b\\u1ed1 tr&iacute; thi\\u1ebfu c&aacute;c thi\\u1ebft b\\u1ecb, d\\u1ee5ng c\\u1ee5 ph&ograve;ng ch\\u1ed1ng ch&aacute;y n\\u1ed5 trong qu&aacute; tr&igrave;nh thi c&ocirc;ng x&acirc;y d\\u1ef1ng theo quy \\u0111\\u1ecbnh. H\\u1ed3 s\\u01a1 hu\\u1ea5n luy\\u1ec7n an to&agrave;n v\\u1ec7 sinh lao \\u0111\\u1ed9ng l\\u1ea7n \\u0111\\u1ea7u c\\u1ee7a m\\u1ed9t s\\u1ed1 \\u0111\\u01a1n v\\u1ecb nh&agrave; th\\u1ea7u \\u0111\\u01b0\\u1ee3c l\\u1eadp ch\\u01b0a tu&acirc;n th\\u1ee7; ch\\u01b0a \\u0111\\u1ea7y \\u0111\\u1ee7 h\\u1ed3 s\\u01a1 theo d&otilde;i nh&acirc;n l\\u1ef1c, thi\\u1ebft b\\u1ecb c&oacute; y&ecirc;u c\\u1ea7u nghi&ecirc;m ng\\u1eb7t v\\u1ec1 an to&agrave;n lao \\u0111\\u1ed9ng theo quy \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>\\u0110&aacute;nh gi&aacute; v\\u1ec1 c&ocirc;ng t&aacute;c thi c&ocirc;ng, H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu Nh&agrave; n\\u01b0\\u1edbc cho bi\\u1ebft, t\\u1eeb th\\u1eddi \\u0111i\\u1ec3m kh\\u1edfi c&ocirc;ng cho \\u0111\\u1ebfn nay, c&aacute;c nh&agrave; th\\u1ea7u \\u0111&atilde; thi c&ocirc;ng ho&agrave;n th&agrave;nh 419\\/419 tr\\u1ee5 c\\u1ea7u thu\\u1ed9c c&aacute;c khu gian v&agrave; 122\\/122 tr\\u1ee5 c\\u1ea7u t\\u1ea1i c&aacute;c nh&agrave; ga, 12 nh&agrave; ga \\u0111ang \\u0111\\u01b0\\u1ee3c thi c&ocirc;ng trong \\u0111&oacute; 5 nh&agrave; ga \\u0111ang thi c&ocirc;ng c&aacute;c h\\u1ea1ng m\\u1ee5c k\\u1ebft c\\u1ea5u khung th&eacute;p, ho&agrave;n th&agrave;nh \\u0111&uacute;c 806 phi\\u1ebfn d\\u1ea7m h\\u1ed9p gi\\u1ea3n \\u0111\\u01a1n v&agrave; t\\u1ed5 ch\\u1ee9c thi c&ocirc;ng l\\u1eafp d\\u1ef1ng 758 phi\\u1ebfn.<\\/p>\\r\\n\\r\\n<p>Ngo&agrave;i ra, c&ocirc;ng t&aacute;c x\\u1eed l&yacute; n\\u1ec1n \\u0111\\u1ea5t y\\u1ebfu t\\u1ea1i khu v\\u1ef1c Depot \\u0111&atilde; c\\u01a1 b\\u1ea3n ho&agrave;n th&agrave;nh, hi\\u1ec7n t\\u1ea1i c&aacute;c nh&agrave; th\\u1ea7u \\u0111ang t\\u1eadp trung tri\\u1ec3n khai thi c&ocirc;ng nh&agrave; \\u0111i\\u1ec1u h&agrave;nh, x\\u01b0\\u1edfng v\\u1eadn d\\u1ee5ng, trung t&acirc;m duy tu...<\\/p>\\r\\n\\r\\n<p>C&ocirc;ng t&aacute;c mua s\\u1eafm, cung c\\u1ea5p thi\\u1ebft b\\u1ecb v&agrave; \\u0111\\u1ea3o t\\u1ea1o nh&acirc;n l\\u1ef1c qu\\u1ea3n l&yacute; v\\u1eadn h&agrave;nh \\u0111ang \\u0111\\u01b0\\u1ee3c th\\u1ef1c hi\\u1ec7n.<\\/p>\\r\\n\\r\\n<p>C&aacute;c h\\u1ea1ng m\\u1ee5c c&ocirc;ng tr&igrave;nh \\u0111ang \\u0111\\u01b0\\u1ee3c thi c&ocirc;ng nh\\u01b0 c&aacute;c tr\\u1ee5 c\\u1ea7u, k\\u1ebft c\\u1ea5u b&ecirc; t&ocirc;ng, k\\u1ebft c\\u1ea5u khung d\\u1ea7m th&eacute;p c\\u1ee7a c&aacute;c nh&agrave; ga tr&ecirc;n tuy\\u1ebfn, h\\u1ec7 nh&agrave; \\u0111i\\u1ec1u h&agrave;nh trung t&acirc;m c\\u01a1 b\\u1ea3n \\u0111\\u1ea3m b\\u1ea3o ch\\u1ea5t l\\u01b0\\u1ee3ng theo y&ecirc;u c\\u1ea7u thi\\u1ebft k\\u1ebf v&agrave; c&aacute;c quy \\u0111\\u1ecbnh k\\u1ef9 thu\\u1eadt.<\\/p>\\r\\n\\r\\n<p><strong>PV<\\/strong><\\/p>\\r\\n","content_jp":"<p>Theo ngu\\u1ed3n tin b&aacute;o Ng\\u01b0\\u1eddi \\u0110\\u01b0a Tin c&oacute; \\u0111\\u01b0\\u1ee3c, H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu Nh&agrave; n\\u01b0\\u1edbc c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y d\\u1ef1ng v\\u1eeba c&oacute; k\\u1ebft qu\\u1ea3 ki\\u1ec3m tra hi\\u1ec7n tr\\u01b0\\u1eddng c&ocirc;ng tr&igrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft tr&ecirc;n cao C&aacute;t Linh-H&agrave; \\u0110&ocirc;ng.<\\/p>\\r\\n\\r\\n<p>K\\u1ebft qu\\u1ea3 ki\\u1ec3m tra c\\u1ee7a H\\u1ed9i \\u0111\\u1ed3ng nghi\\u1ec7m thu cho th\\u1ea5y, c&ocirc;ng tr&igrave;nh v\\u1eabn c&ograve;n nhi\\u1ec1u t\\u1ed3n t\\u1ea1i, trong \\u0111&oacute;, m\\u1ed9t s\\u1ed1 h\\u1ea1ng m\\u1ee5c \\u0111ang c&oacute; hi\\u1ec7n t\\u01b0\\u1ee3ng xu\\u1ed1ng c\\u1ea5p m\\u1eb7c d&ugrave; ch\\u01b0a \\u0111\\u01b0\\u1ee3c \\u0111\\u01b0a v&agrave;o s\\u1eed d\\u1ee5ng nh\\u01b0 t\\u1ea1i nh&agrave; ga C&aacute;t Linh, khu v\\u1ef1c \\u0111\\u1ec3 c\\u1ed1t th&eacute;p ch\\u01b0a gia c&ocirc;ng, t\\u1ea1i m\\u1ed9t s\\u1ed1 v\\u1