(35, 'Hoàn thiện dự thảo Nghị định về quản lý, sử dụng và kinh doanh tài sản kết cấu hạ tầng đường sắt', '{"name_en":"Ho\\u00e0n thi\\u1ec7n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh v\\u1ec1 qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft","name_jp":"Ho\\u00e0n thi\\u1ec7', 'hoan-thien-du-thao-nghi-dinh-ve-quan-ly-su-dung-va-kinh-doanh-tai-san-ket-cau-ha-tang-duong-sat-35', '{"alias_en":"hoan-thien-du-thao-nghi-dinh-ve-quan-ly-su-dung-va-kinh-doanh-tai-san-ket-cau-ha-tang-duong-sat-35","alias_jp":"hoan-thien-du-thao-nghi-dinh-ve-quan-ly-su-dung-va-kinh-doanh-tai-san-ket-cau-ha-tang-duong-sat-35"}', 8, '<p><strong>Ng&agrave;y 8/6/2016, tại H&agrave; Nội, Bộ T&agrave;i ch&iacute;nh tổ chức Hội thảo &ldquo;Tham vấn dự thảo Nghị định quy định việc quản l&yacute;, sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt&rdquo;. Tham dự Hội thảo c&oacute; Thứ trưởng Bộ T&agrave;i ch&iacute;nh Nguyễn Hữu Ch&iacute;, Thứ trưởng Bộ giao th&ocirc;ng vận tải Nguyễn Ngọc Đ&ocirc;ng, Gi&aacute;m đốc quốc gia Ng&acirc;n h&agrave;ng ADB tại Việt Nam Eric Sidgwick, l&atilde;nh đạo Cục Quản l&yacute; c&ocirc;ng sản, đại diện c&aacute;c Bộ, ng&agrave;nh, UBND c&aacute;c tỉnh, th&agrave;nh phố, Tổng c&ocirc;ng ty Đường sắt Việt Nam.</strong></p>\r\n', '{"intro_en":"<p><strong>Ng&agrave;y 8\\/6\\/2016, t\\u1ea1i H&agrave; N\\u1ed9i, B\\u1ed9 T&agrave;i ch&iacute;nh t\\u1ed5 ch\\u1ee9c H\\u1ed9i th\\u1ea3o &ldquo;Tham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft&rdquo;. Tham d\\u1ef1 H\\u1ed9i th\\u1ea3o c&oacute; Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute;, Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 giao th&ocirc;ng v\\u1eadn t\\u1ea3i Nguy\\u1ec5n Ng\\u1ecdc \\u0110&ocirc;ng, Gi&aacute;m \\u0111\\u1ed1c qu\\u1ed1c gia Ng&acirc;n h&agrave;ng ADB t\\u1ea1i Vi\\u1ec7t Nam Eric Sidgwick, l&atilde;nh \\u0111\\u1ea1o C\\u1ee5c Qu\\u1ea3n l&yacute; c&ocirc;ng s\\u1ea3n, \\u0111\\u1ea1i di\\u1ec7n c&aacute;c B\\u1ed9, ng&agrave;nh, UBND c&aacute;c t\\u1ec9nh, th&agrave;nh ph\\u1ed1, T\\u1ed5ng c&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam.<\\/strong><\\/p>\\r\\n","intro_jp":"<p><strong>Ng&agrave;y 8\\/6\\/2016, t\\u1ea1i H&agrave; N\\u1ed9i, B\\u1ed9 T&agrave;i ch&iacute;nh t\\u1ed5 ch\\u1ee9c H\\u1ed9i th\\u1ea3o &ldquo;Tham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft&rdquo;. Tham d\\u1ef1 H\\u1ed9i th\\u1ea3o c&oacute; Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute;, Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 giao th&ocirc;ng v\\u1eadn t\\u1ea3i Nguy\\u1ec5n Ng\\u1ecdc \\u0110&ocirc;ng, Gi&aacute;m \\u0111\\u1ed1c qu\\u1ed1c gia Ng&acirc;n h&agrave;ng ADB t\\u1ea1i Vi\\u1ec7t Nam Eric Sidgwick, l&atilde;nh \\u0111\\u1ea1o C\\u1ee5c Qu\\u1ea3n l&yacute; c&ocirc;ng s\\u1ea3n, \\u0111\\u1ea1i di\\u1ec7n c&aacute;c B\\u1ed9, ng&agrave;nh, UBND c&aacute;c t\\u1ec9nh, th&agrave;nh ph\\u1ed1, T\\u1ed5ng c&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam.<\\/strong><\\/p>\\r\\n"}', '<p><a class="photo" href="http://2.i.baomoi.xdn.vn/16/06/08/215/19575532/1_621435.jpg" style="box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;"><img alt="Hoan thien du thao Nghi dinh ve quan ly, su dung va kinh doanh tai san ket cau ha tang duong sat - Anh 1" src="http://2.i.baomoi.xdn.vn/w460x/16/06/08/215/19575532/1_621435.jpg" style="border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle" title="Hoàn thiện dự thảo Nghị định về quản lý, sử dụng và kinh doanh tài sản kết cấu hạ tầng đường sắt - Ảnh 1" /></a></p>\r\n\r\n<p>Thứ trưởng Bộ T&agrave;i ch&iacute;nh Nguyễn Hữu Ch&iacute; ph&aacute;t biểu tại Hội thảo.</p>\r\n\r\n<p>Ph&aacute;t biểu tại Hội thảo, Thứ trưởng Nguyễn Hữu Ch&iacute; cho biết, trong những năm qua, Nh&agrave; nước đ&atilde; huy động nhiều nguồn lực để x&acirc;y dựng kết cấu hạ tầng với quy m&ocirc; rất lớn, g&oacute;p phần quan trọng v&agrave;o ph&aacute;t triển kinh tế x&atilde; hội, x&oacute;a đ&oacute;i giảm ngh&egrave;o tr&ecirc;n c&aacute;c v&ugrave;ng, miền của đất nước. Tuy nhi&ecirc;n, hệ thống cơ sở hạ tầng của Việt Nam trong đ&oacute; c&oacute; kết cấu hạ tầng giao th&ocirc;ng vẫn c&ograve;n yếu k&eacute;m, lạc hậu, chưa đồng bộ, khả năng kết nối giữa c&aacute;c loại h&igrave;nh c&ograve;n hạn chế. Đối với hệ thống hạ tầng đường sắt Việt Nam được x&acirc;y dựng v&agrave; đưa v&agrave;o khai th&aacute;c đến nay đ&atilde; hơn 100 năm, với tổng chiều d&agrave;i khoảng hơn 3.000km, 286 ga, 1818 cầu lớn nhỏ, 39 hầm, 5.735 điểm giao cắt giữa đường bộ với đường sắt v&agrave; c&aacute;c c&ocirc;ng tr&igrave;nh phụ trợ rất lớn; quỹ đất thuộc t&agrave;i sản kết cấu hạ tầng đường sắt tr&ecirc;n 6.000 ha.</p>\r\n\r\n<p>Mặc d&ugrave; l&agrave; phương thức vận tải c&oacute; rất nhiều lợi thế (chỉ đứng sau vận tải thủy) do c&oacute; gi&aacute; th&agrave;nh thấp, vận chuyển được h&agrave;ng h&oacute;a c&oacute; khối lượng lớn, an to&agrave;n&hellip; tuy nhi&ecirc;n năng lực vận tải hiện nay đạt rất thấp (chỉ đạt khoảng 4,5% tổng lượng vận tải h&agrave;nh kh&aacute;ch v&agrave; khoảng 1,8% tổng lượng vận tải h&agrave;ng h&oacute;a) v&agrave; trong thời gian qua kh&ocirc;ng được đầu tư ph&aacute;t triển mở rộng với c&aacute;c l&yacute; do như: hệ thống ph&aacute;p luật hiện h&agrave;nh chủ yếu mang t&iacute;nh chất quản l&yacute; chuy&ecirc;n ng&agrave;nh; chưa ph&acirc;n định r&otilde; quyền, nghĩa vụ của đại diện chủ sở hữu t&agrave;i sản kết cấu hạ tầng (cơ quan quản l&yacute; nh&agrave; nước) với đối tượng được giao quản l&yacute;, sử dụng (Tổng c&ocirc;ng ty Đường sắt Việt Nam); dẫn đến cơ chế hoạt động hiện nay gần như kh&eacute;p k&iacute;n trong nội bộ Tổng c&ocirc;ng ty, vai tr&ograve; của Nh&agrave; nước trong việc quản l&yacute;, kiểm tra, gi&aacute;m s&aacute;t việc sử dụng t&agrave;i sản c&ograve;n mờ nhạt; c&aacute;c quy định về quản l&yacute;, sử dụng v&agrave; khai th&aacute;c t&agrave;i sản hạ tầng đường sắt c&ograve;n thiếu, ph&acirc;n t&aacute;n, chưa c&oacute; quy định cụ thể về cơ chế t&agrave;i ch&iacute;nh tạo &ldquo;cơ chế mở&rdquo; thu h&uacute;t việc đầu tư, khai th&aacute;c hạ tầng đường sắt.</p>\r\n\r\n<p>Trước thực trạng tr&ecirc;n, c&aacute;c nghi&ecirc;n cứu về giải ph&aacute;p ph&aacute;t triển hạ tầng đường sắt ở Việt Nam đ&atilde; chỉ r&otilde; cần phải thực hiện đồng thời c&ugrave;ng l&uacute;c 2 nhiệm vụ mang t&iacute;nh chiến lược, đ&oacute; l&agrave;: khẩn trương đầu tư x&acirc;y dựng mới, n&acirc;ng cấp, hiện đại h&oacute;a c&aacute;c tuyến giao th&ocirc;ng đường sắt; đổi mới cơ chế quản l&yacute;, sử dụng, bảo tr&igrave; v&agrave; khai th&aacute;c hạ tầng đường sắt hiện c&oacute; nhằm duy tr&igrave; năng lực phục vụ hiện tại v&agrave; k&eacute;o d&agrave;i tuổi thọ của c&aacute;c c&ocirc;ng tr&igrave;nh.</p>\r\n\r\n<p>Dự thảo Nghị định quy định việc quản l&yacute;, sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt được x&acirc;y dựng với mục ti&ecirc;u nhằm t&aacute;ch bạch r&otilde; giữa quản l&yacute; nh&agrave; nước của cơ quan nh&agrave; nước với quản l&yacute; kinh doanh của doanh nghiệp đ&atilde; được quy định tại Luật Đường sắt năm 2005 (khắc phục c&aacute;c nhược điểm khi giao cho 1 đơn vị l&agrave; Tổng c&ocirc;ng ty Đường sắt Việt Nam quản l&yacute;, sử dụng v&agrave; kinh doanh kh&eacute;p k&iacute;n nhưng kh&ocirc;ng thực hiện nghĩa vụ về thu&ecirc; đất với Nh&agrave; nước&hellip;) chưa ph&ugrave; hợp với c&aacute;c quy định của ph&aacute;p luật về doanh nghiệp v&agrave; ph&aacute;p luật đất đai&hellip; Điểm mới của dự thảo l&agrave; t&aacute;ch bạch quan hệ về t&agrave;i sản giữa đại diện chủ sở hữu l&agrave; nh&agrave; nước khi giao t&agrave;i sản gắn liền với giao vốn cho doanh nghiệp, theo quy định của ph&aacute;p luật doanh nghiệp; giao t&agrave;i sản của nh&agrave; nước kh&ocirc;ng gắn với giao vốn, đại diện chủ sở hữu phần vốn v&agrave; t&agrave;i sản của Nh&agrave; nước c&oacute; quyền định đoạt, quản l&yacute; điều h&agrave;nh t&agrave;i sản, được quyền giao cho doanh nghiệp sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt.</p>\r\n\r\n<p>Theo &ocirc;ng David Bray - chuy&ecirc;n gia tư vấn quốc tế, hướng đi tương lai đối với Tổng c&ocirc;ng ty đường sắt Việt Nam (VNRC) đ&oacute; l&agrave; c&aacute;c c&ocirc;ng ty vận h&agrave;nh đo&agrave;n t&agrave;u cần đ&oacute;ng vai tr&ograve; trung t&acirc;m trong ng&agrave;nh đường sắt, chứ kh&ocirc;ng phải l&agrave; c&ocirc;ng ty hạ tầng; c&ocirc;ng ty cổ phần vận tải đường sắt H&agrave; Nội v&agrave; S&agrave;i G&ograve;n kh&ocirc;ng n&ecirc;n l&agrave;m c&ocirc;ng ty con của VNRC v&agrave; phải sở hữu tất cả c&aacute;c t&agrave;i sản m&agrave; họ cần để cung cấp dịch vụ t&agrave;u hỏa; cần x&acirc;y dựng c&aacute;c c&ocirc;ng ty cạnh tranh tr&ecirc;n to&agrave;n quốc hoặc trong khu vực để hỗ trợ cho ng&agrave;nh đường sắt; số lượng c&aacute;c c&ocirc;ng ty con cần giảm mạnh, lu&ocirc;n sử dụng đấu thầu cạnh tranh trừ trường hợp sửa chữa cần thiết.</p>\r\n\r\n<p>Đối với việc quản l&yacute; t&agrave;i sản của VNRC, cần triển khai một hệ thống quản l&yacute; t&agrave;i sản ch&iacute;nh thức để giảm thiểu chi ph&iacute; duy tr&igrave; c&aacute;c t&agrave;i sản hiện tại, đ&aacute;p ứng nhu cầu của kh&aacute;ch h&agrave;ng v&agrave; tạo cơ sở để lập kế hoạch đầu tư trong tương lai, thực tế c&oacute; thể mất 10 năm để ho&agrave;n th&agrave;nh nhiệm vụ n&agrave;y, &ocirc;ng David Bray nhận định.</p>\r\n\r\n<p>Đ&aacute;nh gi&aacute; về chức năng v&agrave; nhiệm vụ của Bộ GTVT v&agrave; VNRC, &ocirc;ng Phạm Đ&igrave;nh Cường, nguy&ecirc;n Cục trưởng Cục Quản l&yacute; c&ocirc;ng sản cho rằng, việc t&aacute;ch bạch giữa quản l&yacute; nh&agrave; nước v&agrave; quản l&yacute; kinh doanh cần thực hiện theo lộ tr&igrave;nh. Theo đ&oacute;, Bộ GTVT l&agrave; cơ quan quản l&yacute; nh&agrave; nước về đường sắt v&agrave; l&agrave; đại diện chủ sở hữu về t&agrave;i sản kết cấu hạ tầng đường sắt; với nguy&ecirc;n tắc n&agrave;y, c&aacute;c quyền của đại diện chủ sở hữu bao gồm cả việc giao t&agrave;i sản, b&aacute;n, cho thu&ecirc;, thanh l&yacute; t&agrave;i sản, do đại diện chủ sở hữu quyết định hoặc c&oacute; thể ủy quyền cho doanh nghiệp, địa phương thực hiện một số nhiệm vụ. Ngo&agrave;i ra, cần đảm bảo nguy&ecirc;n tắc trong việc ph&acirc;n định nhiệm vụ, quyền hạn giữa cơ quan quản l&yacute; nh&agrave; nước với VNRC l&agrave; sự r&otilde; r&agrave;ng, minh bạch trong quản l&yacute; chi ph&iacute;.</p>\r\n\r\n<p>&Ocirc;ng Phạm Đ&igrave;nh Cường cho rằng, để giảm chi ph&iacute; cho doanh nghiệp kinh doanh kết cấu hạ tầng đường sắt trong giai đoạn bước đầu khi chuyển h&igrave;nh thức sử dụng đất, Ch&iacute;nh phủ c&oacute; thể quy định việc miễn, giảm tiền thu&ecirc; đất theo thẩm quyền trong một thời gian nhất định.</p>\r\n\r\n<p>Hội thảo cũng đ&atilde; nhận được nhiều &yacute; kiến tham gia của c&aacute;c đại biểu, chuy&ecirc;n gia đ&oacute;ng g&oacute;p v&agrave;o nội dung dự thảo Nghị định. Tr&ecirc;n cơ sở đ&oacute;, Bộ T&agrave;i ch&iacute;nh sẽ nghi&ecirc;n cứu, tiếp thu tr&igrave;nh cấp c&oacute; thẩm quyền xem x&eacute;t, quyết định ho&agrave;n thiện nội dung Nghị định.</p>\r\n\r\n<p>Theo mof.gov.vn</p>\r\n', '{"content_en":"<p><a class=\\"photo\\" href=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/16\\/06\\/08\\/215\\/19575532\\/1_621435.jpg\\" style=\\"box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;\\"><img alt=\\"Hoan thien du thao Nghi dinh ve quan ly, su dung va kinh doanh tai san ket cau ha tang duong sat - Anh 1\\" src=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/w460x\\/16\\/06\\/08\\/215\\/19575532\\/1_621435.jpg\\" style=\\"border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle\\" title=\\"Ho\\u00e0n thi\\u1ec7n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh v\\u1ec1 qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft - \\u1ea2nh 1\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<p>Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute; ph&aacute;t bi\\u1ec3u t\\u1ea1i H\\u1ed9i th\\u1ea3o.<\\/p>\\r\\n\\r\\n<p>Ph&aacute;t bi\\u1ec3u t\\u1ea1i H\\u1ed9i th\\u1ea3o, Th\\u1ee9 tr\\u01b0\\u1edfng Nguy\\u1ec5n H\\u1eefu Ch&iacute; cho bi\\u1ebft, trong nh\\u1eefng n\\u0103m qua, Nh&agrave; n\\u01b0\\u1edbc \\u0111&atilde; huy \\u0111\\u1ed9ng nhi\\u1ec1u ngu\\u1ed3n l\\u1ef1c \\u0111\\u1ec3 x&acirc;y d\\u1ef1ng k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng v\\u1edbi quy m&ocirc; r\\u1ea5t l\\u1edbn, g&oacute;p ph\\u1ea7n quan tr\\u1ecdng v&agrave;o ph&aacute;t tri\\u1ec3n kinh t\\u1ebf x&atilde; h\\u1ed9i, x&oacute;a \\u0111&oacute;i gi\\u1ea3m ngh&egrave;o tr&ecirc;n c&aacute;c v&ugrave;ng, mi\\u1ec1n c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc. Tuy nhi&ecirc;n, h\\u1ec7 th\\u1ed1ng c\\u01a1 s\\u1edf h\\u1ea1 t\\u1ea7ng c\\u1ee7a Vi\\u1ec7t Nam trong \\u0111&oacute; c&oacute; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng giao th&ocirc;ng v\\u1eabn c&ograve;n y\\u1ebfu k&eacute;m, l\\u1ea1c h\\u1eadu, ch\\u01b0a \\u0111\\u1ed3ng b\\u1ed9, kh\\u1ea3 n\\u0103ng k\\u1ebft n\\u1ed1i gi\\u1eefa c&aacute;c lo\\u1ea1i h&igrave;nh c&ograve;n h\\u1ea1n ch\\u1ebf. \\u0110\\u1ed1i v\\u1edbi h\\u1ec7 th\\u1ed1ng h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng v&agrave; \\u0111\\u01b0a v&agrave;o khai th&aacute;c \\u0111\\u1ebfn nay \\u0111&atilde; h\\u01a1n 100 n\\u0103m, v\\u1edbi t\\u1ed5ng chi\\u1ec1u d&agrave;i kho\\u1ea3ng h\\u01a1n 3.000km, 286 ga, 1818 c\\u1ea7u l\\u1edbn nh\\u1ecf, 39 h\\u1ea7m, 5.735 \\u0111i\\u1ec3m giao c\\u1eaft gi\\u1eefa \\u0111\\u01b0\\u1eddng b\\u1ed9 v\\u1edbi \\u0111\\u01b0\\u1eddng s\\u1eaft v&agrave; c&aacute;c c&ocirc;ng tr&igrave;nh ph\\u1ee5 tr\\u1ee3 r\\u1ea5t l\\u1edbn; qu\\u1ef9 \\u0111\\u1ea5t thu\\u1ed9c t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft tr&ecirc;n 6.000 ha.<\\/p>\\r\\n\\r\\n<p>M\\u1eb7c d&ugrave; l&agrave; ph\\u01b0\\u01a1ng th\\u1ee9c v\\u1eadn t\\u1ea3i c&oacute; r\\u1ea5t nhi\\u1ec1u l\\u1ee3i th\\u1ebf (ch\\u1ec9 \\u0111\\u1ee9ng sau v\\u1eadn t\\u1ea3i th\\u1ee7y) do c&oacute; gi&aacute; th&agrave;nh th\\u1ea5p, v\\u1eadn chuy\\u1ec3n \\u0111\\u01b0\\u1ee3c h&agrave;ng h&oacute;a c&oacute; kh\\u1ed1i l\\u01b0\\u1ee3ng l\\u1edbn, an to&agrave;n&hellip; tuy nhi&ecirc;n n\\u0103ng l\\u1ef1c v\\u1eadn t\\u1ea3i hi\\u1ec7n nay \\u0111\\u1ea1t r\\u1ea5t th\\u1ea5p (ch\\u1ec9 \\u0111\\u1ea1t kho\\u1ea3ng 4,5% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;nh kh&aacute;ch v&agrave; kho\\u1ea3ng 1,8% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;ng h&oacute;a) v&agrave; trong th\\u1eddi gian qua kh&ocirc;ng \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 ph&aacute;t tri\\u1ec3n m\\u1edf r\\u1ed9ng v\\u1edbi c&aacute;c l&yacute; do nh\\u01b0: h\\u1ec7 th\\u1ed1ng ph&aacute;p lu\\u1eadt hi\\u1ec7n h&agrave;nh ch\\u1ee7 y\\u1ebfu mang t&iacute;nh ch\\u1ea5t qu\\u1ea3n l&yacute; chuy&ecirc;n ng&agrave;nh; ch\\u01b0a ph&acirc;n \\u0111\\u1ecbnh r&otilde; quy\\u1ec1n, ngh\\u0129a v\\u1ee5 c\\u1ee7a \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng (c\\u01a1 quan qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc) v\\u1edbi \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c giao qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng (T\\u1ed5ng c&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam); d\\u1eabn \\u0111\\u1ebfn c\\u01a1 ch\\u1ebf ho\\u1ea1t \\u0111\\u1ed9ng hi\\u1ec7n nay g\\u1ea7n nh\\u01b0 kh&eacute;p k&iacute;n trong n\\u1ed9i b\\u1ed9 T\\u1ed5ng c&ocirc;ng ty, vai tr&ograve; c\\u1ee7a Nh&agrave; n\\u01b0\\u1edbc trong vi\\u1ec7c qu\\u1ea3n l&yacute;, ki\\u1ec3m tra, gi&aacute;m s&aacute;t vi\\u1ec7c s\\u1eed d\\u1ee5ng t&agrave;i s\\u1ea3n c&ograve;n m\\u1edd nh\\u1ea1t; c&aacute;c quy \\u0111\\u1ecbnh v\\u1ec1 qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; khai th&aacute;c t&agrave;i s\\u1ea3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft c&ograve;n thi\\u1ebfu, ph&acirc;n t&aacute;n, ch\\u01b0a c&oacute; quy \\u0111\\u1ecbnh c\\u1ee5 th\\u1ec3 v\\u1ec1 c\\u01a1 ch\\u1ebf t&agrave;i ch&iacute;nh t\\u1ea1o &ldquo;c\\u01a1 ch\\u1ebf m\\u1edf&rdquo; thu h&uacute;t vi\\u1ec7c \\u0111\\u1ea7u t\\u01b0, khai th&aacute;c h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Tr\\u01b0\\u1edbc th\\u1ef1c tr\\u1ea1ng tr&ecirc;n, c&aacute;c nghi&ecirc;n c\\u1ee9u v\\u1ec1 gi\\u1ea3i ph&aacute;p ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u1edf Vi\\u1ec7t Nam \\u0111&atilde; ch\\u1ec9 r&otilde; c\\u1ea7n ph\\u1ea3i th\\u1ef1c hi\\u1ec7n \\u0111\\u1ed3ng th\\u1eddi c&ugrave;ng l&uacute;c 2 nhi\\u1ec7m v\\u1ee5 mang t&iacute;nh chi\\u1ebfn l\\u01b0\\u1ee3c, \\u0111&oacute; l&agrave;: kh\\u1ea9n tr\\u01b0\\u01a1ng \\u0111\\u1ea7u t\\u01b0 x&acirc;y d\\u1ef1ng m\\u1edbi, n&acirc;ng c\\u1ea5p, hi\\u1ec7n \\u0111\\u1ea1i h&oacute;a c&aacute;c tuy\\u1ebfn giao th&ocirc;ng \\u0111\\u01b0\\u1eddng s\\u1eaft; \\u0111\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, b\\u1ea3o tr&igrave; v&agrave; khai th&aacute;c h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft hi\\u1ec7n c&oacute; nh\\u1eb1m duy tr&igrave; n\\u0103ng l\\u1ef1c ph\\u1ee5c v\\u1ee5 hi\\u1ec7n t\\u1ea1i v&agrave; k&eacute;o d&agrave;i tu\\u1ed5i th\\u1ecd c\\u1ee7a c&aacute;c c&ocirc;ng tr&igrave;nh.<\\/p>\\r\\n\\r\\n<p>D\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng v\\u1edbi m\\u1ee5c ti&ecirc;u nh\\u1eb1m t&aacute;ch b\\u1ea1ch r&otilde; gi\\u1eefa qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc c\\u1ee7a c\\u01a1 quan nh&agrave; n\\u01b0\\u1edbc v\\u1edbi qu\\u1ea3n l&yacute; kinh doanh c\\u1ee7a doanh nghi\\u1ec7p \\u0111&atilde; \\u0111\\u01b0\\u1ee3c quy \\u0111\\u1ecbnh t\\u1ea1i Lu\\u1eadt \\u0110\\u01b0\\u1eddng s\\u1eaft n\\u0103m 2005 (kh\\u1eafc ph\\u1ee5c c&aacute;c nh\\u01b0\\u1ee3c \\u0111i\\u1ec3m khi giao cho 1 \\u0111\\u01a1n v\\u1ecb l&agrave; T\\u1ed5ng c&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh kh&eacute;p k&iacute;n nh\\u01b0ng kh&ocirc;ng th\\u1ef1c hi\\u1ec7n ngh\\u0129a v\\u1ee5 v\\u1ec1 thu&ecirc; \\u0111\\u1ea5t v\\u1edbi Nh&agrave; n\\u01b0\\u1edbc&hellip;) ch\\u01b0a ph&ugrave; h\\u1ee3p v\\u1edbi c&aacute;c quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt v\\u1ec1 doanh nghi\\u1ec7p v&agrave; ph&aacute;p lu\\u1eadt \\u0111\\u1ea5t \\u0111ai&hellip; \\u0110i\\u1ec3m m\\u1edbi c\\u1ee7a d\\u1ef1 th\\u1ea3o l&agrave; t&aacute;ch b\\u1ea1ch quan h\\u1ec7 v\\u1ec1 t&agrave;i s\\u1ea3n gi\\u1eefa \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu l&agrave; nh&agrave; n\\u01b0\\u1edbc khi giao t&agrave;i s\\u1ea3n g\\u1eafn li\\u1ec1n v\\u1edbi giao v\\u1ed1n cho doanh nghi\\u1ec7p, theo quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt doanh nghi\\u1ec7p; giao t&agrave;i s\\u1ea3n c\\u1ee7a nh&agrave; n\\u01b0\\u1edbc kh&ocirc;ng g\\u1eafn v\\u1edbi giao v\\u1ed1n, \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu ph\\u1ea7n v\\u1ed1n v&agrave; t&agrave;i s\\u1ea3n c\\u1ee7a Nh&agrave; n\\u01b0\\u1edbc c&oacute; quy\\u1ec1n \\u0111\\u1ecbnh \\u0111o\\u1ea1t, qu\\u1ea3n l&yacute; \\u0111i\\u1ec1u h&agrave;nh t&agrave;i s\\u1ea3n, \\u0111\\u01b0\\u1ee3c quy\\u1ec1n giao cho doanh nghi\\u1ec7p s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Theo &ocirc;ng David Bray - chuy&ecirc;n gia t\\u01b0 v\\u1ea5n qu\\u1ed1c t\\u1ebf, h\\u01b0\\u1edbng \\u0111i t\\u01b0\\u01a1ng lai \\u0111\\u1ed1i v\\u1edbi T\\u1ed5ng c&ocirc;ng ty \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam (VNRC) \\u0111&oacute; l&agrave; c&aacute;c c&ocirc;ng ty v\\u1eadn h&agrave;nh \\u0111o&agrave;n t&agrave;u c\\u1ea7n \\u0111&oacute;ng vai tr&ograve; trung t&acirc;m trong ng&agrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft, ch\\u1ee9 kh&ocirc;ng ph\\u1ea3i l&agrave; c&ocirc;ng ty h\\u1ea1 t\\u1ea7ng; c&ocirc;ng ty c\\u1ed5 ph\\u1ea7n v\\u1eadn t\\u1ea3i \\u0111\\u01b0\\u1eddng s\\u1eaft H&agrave; N\\u1ed9i v&agrave; S&agrave;i G&ograve;n kh&ocirc;ng n&ecirc;n l&agrave;m c&ocirc;ng ty con c\\u1ee7a VNRC v&agrave; ph\\u1ea3i s\\u1edf h\\u1eefu t\\u1ea5t c\\u1ea3 c&aacute;c t&agrave;i s\\u1ea3n m&agrave; h\\u1ecd c\\u1ea7n \\u0111\\u1ec3 cung c\\u1ea5p d\\u1ecbch v\\u1ee5 t&agrave;u h\\u1ecfa; c\\u1ea7n x&acirc;y d\\u1ef1ng c&aacute;c c&ocirc;ng ty c\\u1ea1nh tranh tr&ecirc;n to&agrave;n qu\\u1ed1c ho\\u1eb7c trong khu v\\u1ef1c \\u0111\\u1ec3 h\\u1ed7 tr\\u1ee3 cho ng&agrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft; s\\u1ed1 l\\u01b0\\u1ee3ng c&aacute;c c&ocirc;ng ty con c\\u1ea7n gi\\u1ea3m m\\u1ea1nh, lu&ocirc;n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5u th\\u1ea7u c\\u1ea1nh tranh tr\\u1eeb tr\\u01b0\\u1eddng h\\u1ee3p s\\u1eeda ch\\u1eefa c\\u1ea7n thi\\u1ebft.<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ed1i v\\u1edbi vi\\u1ec7c qu\\u1ea3n l&yacute; t&agrave;i s\\u1ea3n c\\u1ee7a VNRC, c\\u1ea7n tri\\u1ec3n khai m\\u1ed9t h\\u1ec7 th\\u1ed1ng qu\\u1ea3n l&yacute; t&agrave;i s\\u1ea3n ch&iacute;nh th\\u1ee9c \\u0111\\u1ec3 gi\\u1ea3m thi\\u1ec3u chi ph&iacute; duy tr&igrave; c&aacute;c t&agrave;i s\\u1ea3n hi\\u1ec7n t\\u1ea1i, \\u0111&aacute;p \\u1ee9ng nhu c\\u1ea7u c\\u1ee7a kh&aacute;ch h&agrave;ng v&agrave; t\\u1ea1o c\\u01a1 s\\u1edf \\u0111\\u1ec3 l\\u1eadp k\\u1ebf ho\\u1ea1ch \\u0111\\u1ea7u t\\u01b0 trong t\\u01b0\\u01a1ng lai, th\\u1ef1c t\\u1ebf c&oacute; th\\u1ec3 m\\u1ea5t 10 n\\u0103m \\u0111\\u1ec3 ho&agrave;n th&agrave;nh nhi\\u1ec7m v\\u1ee5 n&agrave;y, &ocirc;ng David Bray nh\\u1eadn \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>\\u0110&aacute;nh gi&aacute; v\\u1ec1 ch\\u1ee9c n\\u0103ng v&agrave; nhi\\u1ec7m v\\u1ee5 c\\u1ee7a B\\u1ed9 GTVT v&agrave; VNRC, &ocirc;ng Ph\\u1ea1m \\u0110&igrave;nh C\\u01b0\\u1eddng, nguy&ecirc;n C\\u1ee5c tr\\u01b0\\u1edfng C\\u1ee5c Qu\\u1ea3n l&yacute; c&ocirc;ng s\\u1ea3n cho r\\u1eb1ng, vi\\u1ec7c t&aacute;ch b\\u1ea1ch gi\\u1eefa qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc v&agrave; qu\\u1ea3n l&yacute; kinh doanh c\\u1ea7n th\\u1ef1c hi\\u1ec7n theo l\\u1ed9 tr&igrave;nh. Theo \\u0111&oacute;, B\\u1ed9 GTVT l&agrave; c\\u01a1 quan qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc v\\u1ec1 \\u0111\\u01b0\\u1eddng s\\u1eaft v&agrave; l&agrave; \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu v\\u1ec1 t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft; v\\u1edbi nguy&ecirc;n t\\u1eafc n&agrave;y, c&aacute;c quy\\u1ec1n c\\u1ee7a \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu bao g\\u1ed3m c\\u1ea3 vi\\u1ec7c giao t&agrave;i s\\u1ea3n, b&aacute;n, cho thu&ecirc;, thanh l&yacute; t&agrave;i s\\u1ea3n, do \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu quy\\u1ebft \\u0111\\u1ecbnh ho\\u1eb7c c&oacute; th\\u1ec3 \\u1ee7y quy\\u1ec1n cho doanh nghi\\u1ec7p, \\u0111\\u1ecba ph\\u01b0\\u01a1ng th\\u1ef1c hi\\u1ec7n m\\u1ed9t s\\u1ed1 nhi\\u1ec7m v\\u1ee5. Ngo&agrave;i ra, c\\u1ea7n \\u0111\\u1ea3m b\\u1ea3o nguy&ecirc;n t\\u1eafc trong vi\\u1ec7c ph&acirc;n \\u0111\\u1ecbnh nhi\\u1ec7m v\\u1ee5, quy\\u1ec1n h\\u1ea1n gi\\u1eefa c\\u01a1 quan qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc v\\u1edbi VNRC l&agrave; s\\u1ef1 r&otilde; r&agrave;ng, minh b\\u1ea1ch trong qu\\u1ea3n l&yacute; chi ph&iacute;.<\\/p>\\r\\n\\r\\n<p>&Ocirc;ng Ph\\u1ea1m \\u0110&igrave;nh C\\u01b0\\u1eddng cho r\\u1eb1ng, \\u0111\\u1ec3 gi\\u1ea3m chi ph&iacute; cho doanh nghi\\u1ec7p kinh doanh k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft trong giai \\u0111o\\u1ea1n b\\u01b0\\u1edbc \\u0111\\u1ea7u khi chuy\\u1ec3n h&igrave;nh th\\u1ee9c s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t, Ch&iacute;nh ph\\u1ee7 c&oacute; th\\u1ec3 quy \\u0111\\u1ecbnh vi\\u1ec7c mi\\u1ec5n, gi\\u1ea3m ti\\u1ec1n thu&ecirc; \\u0111\\u1ea5t theo th\\u1ea9m quy\\u1ec1n trong m\\u1ed9t th\\u1eddi gian nh\\u1ea5t \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>H\\u1ed9i th\\u1ea3o c\\u0169ng \\u0111&atilde; nh\\u1eadn \\u0111\\u01b0\\u1ee3c nhi\\u1ec1u &yacute; ki\\u1ebfn tham gia c\\u1ee7a c&aacute;c \\u0111\\u1ea1i bi\\u1ec3u, chuy&ecirc;n gia \\u0111&oacute;ng g&oacute;p v&agrave;o n\\u1ed9i dung d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh. Tr&ecirc;n c\\u01a1 s\\u1edf \\u0111&oacute;, B\\u1ed9 T&agrave;i ch&iacute;nh s\\u1ebd nghi&ecirc;n c\\u1ee9u, ti\\u1ebfp thu tr&igrave;nh c\\u1ea5p c&oacute; th\\u1ea9m quy\\u1ec1n xem x&eacute;t, quy\\u1ebft \\u0111\\u1ecbnh ho&agrave;n thi\\u1ec7n n\\u1ed9i dung Ngh\\u1ecb \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>Theo mof.gov.vn<\\/p>\\r\\n","content_jp":"<p><a class=\\"photo\\" href=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/16\\/06\\/08\\/215\\/19575532\\/1_621435.jpg\\" style=\\"box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;\\"><img alt=\\"Hoan thien du thao Nghi dinh ve quan ly, su dung va kinh doanh tai san ket cau ha tang duong sat - Anh 1\\" src=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/w460x\\/16\\/06\\/08\\/215\\/19575532\\/1_621435.jpg\\" style=\\"border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle\\" title=\\"Ho\\u00e0n thi\\u1ec7n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh v\\u1ec1 qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft - \\u1ea2nh 1\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<p>Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute; ph&aacute;t bi\\u1ec3u t\\u1ea1i H\\u1ed9i th\\u1ea3o.<\\/p>\\r\\n\\r\\n<p>Ph&aacute;t bi\\u1ec3u t\\u1ea1i H\\u1ed9i th\\u1ea3o, Th\\u1ee9 tr\\u01b0\\u1edfng Nguy\\u1ec5n H\\u1eefu Ch&iacute; cho bi\\u1ebft, trong nh\\u1eefng n\\u0103m qua, Nh&agrave; n\\u01b0\\u1edbc \\u0111&atilde; huy \\u0111\\u1ed9ng nhi\\u1ec1u ngu\\u1ed3n l\\u1ef1c \\u0111\\u1ec3 x&acirc;y d\\u1ef1ng k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng v\\u1edbi quy m&ocirc; r\\u1ea5t l\\u1edbn, g&oacute;p ph\\u1ea7n quan tr\\u1ecdng v&agrave;o ph&aacute;t tri\\u1ec3n kinh t\\u1ebf x&atilde; h\\u1ed9i, x&oacute;a \\u0111&oacute;i gi\\u1ea3m ngh&egrave;o tr&ecirc;n c&aacute;c v&ugrave;ng, mi\\u1ec1n c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc. Tuy nhi&ecirc;n, h\\u1ec7 th\\u1ed1ng c\\u01a1 s\\u1edf h\\u1ea1 t\\u1ea7ng c\\u1ee7a Vi\\u1ec7t Nam trong \\u0111&oacute; c&oacute; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng giao th&ocirc;ng v\\u1eabn c&ograve;n y\\u1ebfu k&eacute;m, l\\u1ea1c h\\u1eadu, ch\\u01b0a \\u0111\\u1ed3ng b\\u1ed9, kh\\u1ea3 n\\u0103ng k\\u1ebft n\\u1ed1i gi\\u1eefa c&aacute;c lo\\u1ea1i h&igrave;nh c&ograve;n h\\u1ea1n ch\\u1ebf. \\u0110\\u1ed1i v\\u1edbi h\\u1ec7 th\\u1ed1ng h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng v&agrave; \\u0111\\u01b0a v&agrave;o khai th&aacute;c \\u0111\\u1ebfn nay \\u0111&atilde; h\\u01a1n 100 n\\u0103m, v\\u1edbi t\\u1ed5ng chi\\u1ec1u d&agrave;i kho\\u1ea3ng h\\u01a1n 3.000km, 286 ga, 1818 c\\u1ea7u l\\u1edbn nh\\u1ecf, 39 h\\u1ea7m, 5.735 \\u0111i\\u1ec3m giao c\\u1eaft gi\\u1eefa \\u0111\\u01b0\\u1eddng b\\u1ed9 v\\u1edbi \\u0111\\u01b0\\u1eddng s\\u1eaft v&agrave; c&aacute;c c&ocirc;ng tr&igrave;nh ph\\u1ee5 tr\\u1ee3 r\\u1ea5t l\\u1edbn; qu\\u1ef9 \\u0111\\u1ea5t thu\\u1ed9c t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft tr&ecirc;n 6.000 ha.<\\/p>\\r\\n\\r\\n<p>M\\u1eb7c d&ugrave; l&agrave; ph\\u01b0\\u01a1ng th\\u1ee9c v\\u1eadn t\\u1ea3i c&oacute; r\\u1ea5t nhi\\u1ec1u l\\u1ee3i th\\u1ebf (ch\\u1ec9 \\u0111\\u1ee9ng sau v\\u1eadn t\\u1ea3i th\\u1ee7y) do c&oacute; gi&aacute; th&agrave;nh th\\u1ea5p, v\\u1eadn chuy\\u1ec3n \\u0111\\u01b0\\u1ee3c h&agrave;ng h&oacute;a c&oacute; kh\\u1ed1i l\\u01b0\\u1ee3ng l\\u1edbn, an to&agrave;n&hellip; tuy nhi&ecirc;n n\\u0103ng l\\u1ef1c v\\u1eadn t\\u1ea3i hi\\u1ec7n nay \\u0111\\u1ea1t r\\u1ea5t th\\u1ea5p (ch\\u1ec9 \\u0111\\u1ea1t kho\\u1ea3ng 4,5% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;nh kh&aacute;ch v&agrave; kho\\u1ea3ng 1,8% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;ng h&oacute;a) v&agrave; trong th\\u1eddi gian qua kh&ocirc;ng \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 ph&aacute;t tri\\u1ec3n m\\u1edf r\\u1ed9ng v\\u1edbi c&aacute;c l&yacute; do nh\\u01b0: h\\u1ec7 th\\u1ed1ng ph&aacute;p lu\\u1eadt hi\\u1ec7n h&agrave;nh ch\\u1ee7 y\\u1ebfu mang t&iacute;nh ch\\u1ea5t qu\\u1ea3n l&yacute; chuy&ecirc;n ng&agrave;nh; ch\\u01b0a ph&acirc;n \\u0111\\u1ecbnh r&otilde; quy\\u1ec1n, ngh\\u0129a v\\u1ee5 c\\u1ee7a \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng (c\\u01a1 quan qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc) v\\u1edbi \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c giao qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng (T\\u1ed5ng c&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam); d\\u1eabn \\u0111\\u1ebfn c\\u01a1 ch\\u1ebf ho\\u1ea1t \\u0111\\u1ed9ng hi\\u1ec7n nay g\\u1ea7n nh\\u01b0 kh&eacute;p k&iacute;n trong n\\u1ed9i b\\u1ed9 T\\u1ed5ng c&ocirc;ng ty, vai tr&ograve; c\\u1ee7a Nh&agrave; n\\u01b0\\u1edbc trong vi\\u1ec7c qu\\u1ea3n l&yacute;, ki\\u1ec3m tra, gi&aacute;m s&aacute;t vi\\u1ec7c s\\u1eed d\\u1ee5ng t&agrave;i s\\u1ea3n c&ograve;n m\\u1edd nh\\u1ea1t; c&aacute;c quy \\u0111\\u1ecbnh v\\u1ec1 qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; khai th&aacute;c t&agrave;i s\\u1ea3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft c&ograve;n thi\\u1ebfu, ph&acirc;n t&aacute;n, ch\\u01b0a c&oacute; quy \\u0111\\u1ecbnh c\\u1ee5 th\\u1ec3 v\\u1ec1 c\\u01a1 ch\\u1ebf t&agrave;i ch&iacute;nh t\\u1ea1o &ldquo;c\\u01a1 ch\\u1ebf m\\u1edf&rdquo; thu h&uacute;t vi\\u1ec7c \\u0111\\u1ea7u t\\u01b0, khai th&aacute;c h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Tr\\u01b0\\u1edbc th\\u1ef1c tr\\u1ea1ng tr&ecirc;n, c&aacute;c nghi&ecirc;n c\\u1ee9u v\\u1ec1 gi\\u1ea3i ph&aacute;p ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u1edf Vi\\u1ec7t Nam \\u0111&atilde; ch\\u1ec9 r&otilde; c\\u1ea7n ph\\u1ea3i th\\u1ef1c hi\\u1ec7n \\u0111\\u1ed3ng th\\u1eddi c&ugrave;ng l&uacute;c 2 nhi\\u1ec7m v\\u1ee5 mang t&iacute;nh chi\\u1ebfn l\\u01b0\\u1ee3c, \\u0111&oacute; l&agrave;: kh\\u1ea9n tr\\u01b0\\u01a1ng \\u0111\\u1ea7u t\\u01b0 x&acirc;y d\\u1ef1ng m\\u1edbi, n&acirc;ng c\\u1ea5p, hi\\u1ec7n \\u0111\\u1ea1i h&oacute;a c&aacute;c tuy\\u1ebfn giao th&ocirc;ng \\u0111\\u01b0\\u1eddng s\\u1eaft; \\u0111\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, b\\u1ea3o tr&igrave; v&agrave; khai th&aacute;c h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft hi\\u1ec7n c&oacute; nh\\u1eb1m duy tr&igrave; n\\u0103ng l\\u1ef1c ph\\u1ee5c v\\u1ee5 hi\\u1ec7n t\\u1ea1i v&agrave; k&eacute;o d&agrave;i tu\\u1ed5i th\\u1ecd c\\u1ee7a c&aacute;c c&ocirc;ng tr&igrave;nh.<\\/p>\\r\\n\\r\\n<p>D\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng v\\u1edbi m\\u1ee5c ti&ecirc;u nh\\u1eb1m t&aacute;ch b\\u1ea1ch r&otilde; gi\\u1eefa qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc c\\u1ee7a c\\u01a1 quan nh&agrave; n\\u01b0\\u1edbc v\\u1edbi qu\\u1ea3n l&yacute; kinh doanh c\\u1ee7a doanh nghi\\u1ec7p \\u0111&atilde; \\u0111\\u01b0\\u1ee3c quy \\u0111\\u1ecbnh t\\u1ea1i Lu\\u1eadt \\u0110\\u01b0\\u1eddng s\\u1eaft n\\u0103m 2005 (kh\\u1eafc ph\\u1ee5c c&aacute;c nh\\u01b0\\u1ee3c \\u0111i\\u1ec3m khi giao cho 1 \\u0111\\u01a1n v\\u1ecb l&agrave; T\\u1ed5ng c&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh kh&eacute;p k&iacute;n nh\\u01b0ng kh&ocirc;ng th\\u1ef1c hi\\u1ec7n ngh\\u0129a v\\u1ee5 v\\u1ec1 thu&ecirc; \\u0111\\u1ea5t v\\u1edbi Nh&agrave; n\\u01b0\\u1edbc&hellip;) ch\\u01b0a ph&ugrave; h\\u1ee3p v\\u1edbi c&aacute;c quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt v\\u1ec1 doanh nghi\\u1ec7p v&agrave; ph&aacute;p lu\\u1eadt \\u0111\\u1ea5t \\u0111ai&hellip; \\u0110i\\u1ec3m m\\u1edbi c\\u1ee7a d\\u1ef1 th\\u1ea3o l&agrave; t&aacute;ch b\\u1ea1ch quan h\\u1ec7 v\\u1ec1 t&agrave;i s\\u1ea3n gi\\u1eefa \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu l&agrave; nh&agrave; n\\u01b0\\u1edbc khi giao t&agrave;i s\\u1ea3n g\\u1eafn li\\u1ec1n v\\u1edbi giao v\\u1ed1n cho doanh nghi\\u1ec7p, theo quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt doanh nghi\\u1ec7p; giao t&agrave;i s\\u1ea3n c\\u1ee7a nh&agrave; n\\u01b0\\u1edbc kh&ocirc;ng g\\u1eafn v\\u1edbi giao v\\u1ed1n, \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu ph\\u1ea7n v\\u1ed1n v&agrave; t&agrave;i s\\u1ea3n c\\u1ee7a Nh&agrave; n\\u01b0\\u1edbc c&oacute; quy\\u1ec1n \\u0111\\u1ecbnh \\u0111o\\u1ea1t, qu\\u1ea3n l&yacute; \\u0111i\\u1ec1u h&agrave;nh t&agrave;i s\\u1ea3n, \\u0111\\u01b0\\u1ee3c quy\\u1ec1n giao cho doanh nghi\\u1ec7p s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Theo &ocirc;ng David Bray - chuy&ecirc;n gia t\\u01b0 v\\u1ea5n qu\\u1ed1c t\\u1ebf, h\\u01b0\\u1edbng \\u0111i t\\u01b0\\u01a1ng lai \\u0111\\u1ed1i v\\u1edbi T\\u1ed5ng c&ocirc;ng ty \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam (VNRC) \\u0111&oacute; l&agrave; c&aacute;c c&ocirc;ng ty v\\u1eadn h&agrave;nh \\u0111o&agrave;n t&agrave;u c\\u1ea7n \\u0111&oacute;ng vai tr&ograve; trung t&acirc;m trong ng&agrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft, ch\\u1ee9 kh&ocirc;ng ph\\u1ea3i l&agrave; c&ocirc;ng ty h\\u1ea1 t\\u1ea7ng; c&ocirc;ng ty c\\u1ed5 ph\\u1ea7n v\\u1eadn t\\u1ea3i \\u0111\\u01b0\\u1eddng s\\u1eaft H&agrave; N\\u1ed9i v&agrave; S&agrave;i G&ograve;n kh&ocirc;ng n&ecirc;n l&agrave;m c&ocirc;ng ty con c\\u1ee7a VNRC v&agrave; ph\\u1ea3i s\\u1edf h\\u1eefu t\\u1ea5t c\\u1ea3 c&aacute;c t&agrave;i s\\u1ea3n m&agrave; h\\u1ecd c\\u1ea7n \\u0111\\u1ec3 cung c\\u1ea5p d\\u1ecbch v\\u1ee5 t&agrave;u h\\u1ecfa; c\\u1ea7n x&acirc;y d\\u1ef1ng c&aacute;c c&ocirc;ng ty c\\u1ea1nh tranh tr&ecirc;n to&agrave;n qu\\u1ed1c ho\\u1eb7c trong khu v\\u1ef1c \\u0111\\u1ec3 h\\u1ed7 tr\\u1ee3 cho ng&agrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft; s\\u1ed1 l\\u01b0\\u1ee3ng c&aacute;c c&ocirc;ng ty con c\\u1ea7n gi\\u1ea3m m\\u1ea1nh, lu&ocirc;n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5u th\\u1ea7u c\\u1ea1nh tranh tr\\u1eeb tr\\u01b0\\u1eddng h\\u1ee3p s\\u1eeda ch\\u1eefa c\\u1ea7n thi\\u1ebft.<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ed1i v\\u1edbi vi\\u1ec7c qu\\u1ea3n l&yacute; t&agrave;i s\\u1ea3n c\\u1ee7a VNRC, c\\u1ea7n tri\\u1ec3n khai m\\u1ed9t h\\u1ec7 th\\u1ed1ng qu\\u1ea3n l&yacute; t&agrave;i s\\u1ea3n ch&iacute;nh th\\u1ee9c \\u0111\\u1ec3 gi\\u1ea3m thi\\u1ec3u chi ph&iacute; duy tr&igrave; c&aacute;c t&agrave;i s\\u1ea3n hi\\u1ec7n t\\u1ea1i, \\u0111&aacute;p \\u1ee9ng nhu c\\u1ea7u c\\u1ee7a kh&aacute;ch h&agrave;ng v&agrave; t\\u1ea1o c\\u01a1 s\\u1edf \\u0111\\u1ec3 l\\u1eadp k\\u1ebf ho\\u1ea1ch \\u0111\\u1ea7u t\\u01b0 trong t\\u01b0\\u01a1ng lai, th\\u1ef1c t\\u1ebf c&oacute; th\\u1ec3 m\\u1ea5t 10 n\\u0103m \\u0111\\u1ec3 ho&agrave;n th&agrave;nh nhi\\u1ec7m v\\u1ee5 n&agrave;y, &ocirc;ng David Bray nh\\u1eadn \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>\\u0110&aacute;nh gi&aacute; v\\u1ec1 ch\\u1ee9c n\\u0103ng v&agrave; nhi\\u1ec7m v\\u1ee5 c\\u1ee7a B\\u1ed9 GTVT v&agrave; VNRC, &ocirc;ng Ph\\u1ea1m \\u0110&igrave;nh C\\u01b0\\u1eddng, nguy&ecirc;n C\\u1ee5c tr\\u01b0\\u1edfng C\\u1ee5c Qu\\u1ea3n l&yacute; c&ocirc;ng s\\u1ea3n cho r\\u1eb1ng, vi\\u1ec7c t&aacute;ch b\\u1ea1ch gi\\u1eefa qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc v&agrave; qu\\u1ea3n l&yacute; kinh doanh c\\u1ea7n th\\u1ef1c hi\\u1ec7n theo l\\u1ed9 tr&igrave;nh. Theo \\u0111&oacute;, B\\u1ed9 GTVT l&agrave; c\\u01a1 quan qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc v\\u1ec1 \\u0111\\u01b0\\u1eddng s\\u1eaft v&agrave; l&agrave; \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu v\\u1ec1 t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft; v\\u1edbi nguy&ecirc;n t\\u1eafc n&agrave;y, c&aacute;c quy\\u1ec1n c\\u1ee7a \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu bao g\\u1ed3m c\\u1ea3 vi\\u1ec7c giao t&agrave;i s\\u1ea3n, b&aacute;n, cho thu&ecirc;, thanh l&yacute; t&agrave;i s\\u1ea3n, do \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu quy\\u1ebft \\u0111\\u1ecbnh ho\\u1eb7c c&oacute; th\\u1ec3 \\u1ee7y quy\\u1ec1n cho doanh nghi\\u1ec7p, \\u0111\\u1ecba ph\\u01b0\\u01a1ng th\\u1ef1c hi\\u1ec7n m\\u1ed9t s\\u1ed1 nhi\\u1ec7m v\\u1ee5. Ngo&agrave;i ra, c\\u1ea7n \\u0111\\u1ea3m b\\u1ea3o nguy&ecirc;n t\\u1eafc trong vi\\u1ec7c ph&acirc;n \\u0111\\u1ecbnh nhi\\u1ec7m v\\u1ee5, quy\\u1ec1n h\\u1ea1n gi\\u1eefa c\\u01a1 quan qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc v\\u1edbi VNRC l&agrave; s\\u1ef1 r&otilde; r&agrave;ng, minh b\\u1ea1ch trong qu\\u1ea3n l&yacute; chi ph&iacute;.<\\/p>\\r\\n\\r\\n<p>&Ocirc;ng Ph\\u1ea1m \\u0110&igrave;nh C\\u01b0\\u1eddng cho r\\u1eb1ng, \\u0111\\u1ec3 gi\\u1ea3m chi ph&iacute; cho doanh nghi\\u1ec7p kinh doanh k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft trong giai \\u0111o\\u1ea1n b\\u01b0\\u1edbc \\u0111\\u1ea7u khi chuy\\u1ec3n h&igrave;nh th\\u1ee9c s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t, Ch&iacute;nh ph\\u1ee7 c&oacute; th\\u1ec3 quy \\u0111\\u1ecbnh vi\\u1ec7c mi\\u1ec5n, gi\\u1ea3m ti\\u1ec1n thu&ecirc; \\u0111\\u1ea5t theo th\\u1ea9m quy\\u1ec1n trong m\\u1ed9t th\\u1eddi gian nh\\u1ea5t \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>H\\u1ed9i th\\u1ea3o c\\u0169ng \\u0111&atilde; nh\\u1eadn \\u0111\\u01b0\\u1ee3c nhi\\u1ec1u &yacute; ki\\u1ebfn tham gia c\\u1ee7a c&aacute;c \\u0111\\u1ea1i bi\\u1ec3u, chuy&ecirc;n gia \\u0111&oacute;ng g&oacute;p v&agrave;o n\\u1ed9i dung d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh. Tr&ecirc;n c\\u01a1 s\\u1edf \\u0111&oacute;, B\\u1ed9 T&agrave;i ch&iacute;nh s\\u1ebd nghi&ecirc;n c\\u1ee9u, ti\\u1ebfp thu tr&igrave;nh c\\u1ea5p c&oacute; th\\u1ea9m quy\\u1ec1n xem x&eacute;t, quy\\u1ebft \\u0111\\u1ecbnh ho&agrave;n thi\\u1ec7n n\\u1ed9i dung Ngh\\u1ecb \\u0111\\u1ecbnh.<\\/p>\\r\\n\\r\\n<p>Theo mof.gov.vn<\\/p>\\r\\n"}', 'Hội thảo “Tham vấn dự thảo Nghị định quy định việc quản lý, sử dụng và kinh doanh tài sản kết cấu hạ tầng đường sắt”, Phạm Đình Cường,i Tổng công ty đường sắt Việt Nam (VNRC),VNRC', '{"keyword_en":"H\\u1ed9i th\\u1ea3o \\u201cTham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft\\u201d, Ph\\u1ea1m \\u0110\\u00ecnh C\\u01b0\\u1eddng,i T\\u1ed5ng c\\u00f4ng ty \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam (VNRC),VNRC","keyword_jp":"H\\u1ed9i th\\u1ea3o \\u201cTham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft\\u201d, Ph\\u1ea1m \\u0110\\u00ecnh C\\u01b0\\u1eddng,i T\\u1ed5ng c\\u00f4ng ty \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam (VNRC),VNRC"}', '/public/media/files/1_621435.jpg', '0000-00-00 00:00:00', '', 0, '', NULL);
INSERT INTO `articles` (`id`, `name`, `name_lang`, `alias`, `alias_lang`, `category_id`, `intro`, `intro_lang`, `content`, `content_lang`, `keyword`, `keyword_lang`, `thumbnail`, `created`, `source`, `published`, `params`, `status`) VALUES
(36, 'Nhiều đối tượng được giảm giá vé tàu đến 90%', '{"name_en":"Nhi\\u1ec1u \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c gi\\u1ea3m gi\\u00e1 v\\u00e9 t\\u00e0u \\u0111\\u1ebfn 90%","name_jp":"Nhi\\u1ec1u \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c gi\\u1ea3m gi\\u00e1 v\\u00e9 t\\u00e0u \\u0111\\u1ebfn 90%"}', 'nhieu-doi-tuong-duoc-giam-gia-ve-tau-den-90-36', '{"alias_en":"nhieu-doi-tuong-duoc-giam-gia-ve-tau-den-90-36","alias_jp":"nhieu-doi-tuong-duoc-giam-gia-ve-tau-den-90-36"}', 8, '<p><strong>Tổng C&ocirc;ng ty Đường sắt Việt Nam vừa c&oacute; th&ocirc;ng b&aacute;o kể từ th&aacute;ng 6-2016, nhiều đối tượng mua v&eacute; t&agrave;u sẽ được hưởng ch&iacute;nh s&aacute;ch giảm gi&aacute; l&ecirc;n tới 90%.</strong></p>\r\n', '{"intro_en":"<p><strong>T\\u1ed5ng C&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam v\\u1eeba c&oacute; th&ocirc;ng b&aacute;o k\\u1ec3 t\\u1eeb th&aacute;ng 6-2016, nhi\\u1ec1u \\u0111\\u1ed1i t\\u01b0\\u1ee3ng mua v&eacute; t&agrave;u s\\u1ebd \\u0111\\u01b0\\u1ee3c h\\u01b0\\u1edfng ch&iacute;nh s&aacute;ch gi\\u1ea3m gi&aacute; l&ecirc;n t\\u1edbi 90%.<\\/strong><\\/p>\\r\\n","intro_jp":"<p><strong>T\\u1ed5ng C&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam v\\u1eeba c&oacute; th&ocirc;ng b&aacute;o k\\u1ec3 t\\u1eeb th&aacute;ng 6-2016, nhi\\u1ec1u \\u0111\\u1ed1i t\\u01b0\\u1ee3ng mua v&eacute; t&agrave;u s\\u1ebd \\u0111\\u01b0\\u1ee3c h\\u01b0\\u1edfng ch&iacute;nh s&aacute;ch gi\\u1ea3m gi&aacute; l&ecirc;n t\\u1edbi 90%.<\\/strong><\\/p>\\r\\n"}', '<p>Theo đ&oacute;, giảm 90% gi&aacute; v&eacute; cho người hoạt động c&aacute;ch mạng trước ng&agrave;y 1-1-1945; người hoạt động c&aacute;ch mạng từ 1-1-1945 đến trước Tổng khởi nghĩa 19-8-1945; b&agrave; mẹ Việt Nam anh h&ugrave;ng.</p>\r\n\r\n<p>Giảm 30% gi&aacute; v&eacute; cho c&aacute;c đối tượng l&agrave; thương binh, người hưởng ch&iacute;nh s&aacute;ch như thương binh; nạn nh&acirc;n chất độc m&agrave;u da cam; người khuyết tật đặc biệt nặng v&agrave; người khuyết tật nặng.</p>\r\n\r\n<p>Miễn v&eacute; &aacute;p dụng cho trẻ em dưới s&aacute;u tuổi đi c&ugrave;ng người lớn. Trẻ em được miễn v&eacute; phải sử dụng chung chỗ của người lớn đi c&ugrave;ng. Mỗi người lớn được k&egrave;m kh&ocirc;ng qu&aacute; hai đối tượng miễn v&eacute; đi c&ugrave;ng.</p>\r\n\r\n<p><a class="photo" href="http://2.i.baomoi.xdn.vn/16/06/08/50/19574842/1_74430.jpg" style="box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;"><img alt="Nhieu doi tuong duoc giam gia ve tau den 90% - Anh 1" src="http://2.i.baomoi.xdn.vn/w460x/16/06/08/50/19574842/1_74430.jpg" style="border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle" title="Nhiều đối tượng được giảm giá vé tàu đến 90% - Ảnh 1" /></a></p>\r\n\r\n<p><em>Bảng giảm gi&aacute; v&eacute; t&agrave;u</em></p>\r\n\r\n<p>Cũng theo Tổng C&ocirc;ng ty Đường sắt Việt Nam, giảm 15% gi&aacute; v&eacute; cho người cao tuổi l&agrave; c&ocirc;ng d&acirc;n Việt Nam từ đủ 60 tuổi trở l&ecirc;n. Giảm 50% gi&aacute; v&eacute; loại chỗ ghế ngồi hoặc giảm 25% gi&aacute; v&eacute; loại chỗ giường nằm cho trẻ em từ s&aacute;u đến 10 tuổi.</p>\r\n\r\n<p>Đặc biệt, giảm 10% gi&aacute; v&eacute; cho học sinh, sinh vi&ecirc;n, học vi&ecirc;n c&aacute;c trường dạy nghề, trung học chuy&ecirc;n nghiệp, cao đẳng, đại học, học viện (kh&ocirc;ng bao gồm c&aacute;c sinh vi&ecirc;n, học vi&ecirc;n học sau đại học), c&aacute;c đối tượng n&agrave;y được gọi tắt l&agrave; học sinh, sinh vi&ecirc;n.</p>\r\n\r\n<p>Điều kiện khi mua v&eacute; giảm gi&aacute; v&agrave; đi t&agrave;u đối với người cao tuổi phải xuất tr&igrave;nh chứng minh nh&acirc;n d&acirc;n, hoặc giấy tờ t&ugrave;y th&acirc;n (c&oacute; ảnh) được ph&aacute;p luật c&ocirc;ng nhận. Đối với học sinh, sinh vi&ecirc;n phải xuất tr&igrave;nh chứng minh nh&acirc;n d&acirc;n hoặc giấy tờ t&ugrave;y th&acirc;n (c&oacute; ảnh) được ph&aacute;p luật c&ocirc;ng nhận v&agrave; thẻ sinh vi&ecirc;n, học vi&ecirc;n,&hellip; do c&aacute;c trường dạy nghề, trung học chuy&ecirc;n nghiệp, cao đẳng, đại học, học viện cấp c&ograve;n hiệu lực.</p>\r\n\r\n<p>VIẾT LONG</p>\r\n', '{"content_en":"<p>Theo \\u0111&oacute;, gi\\u1ea3m 90% gi&aacute; v&eacute; cho ng\\u01b0\\u1eddi ho\\u1ea1t \\u0111\\u1ed9ng c&aacute;ch m\\u1ea1ng tr\\u01b0\\u1edbc ng&agrave;y 1-1-1945; ng\\u01b0\\u1eddi ho\\u1ea1t \\u0111\\u1ed9ng c&aacute;ch m\\u1ea1ng t\\u1eeb 1-1-1945 \\u0111\\u1ebfn tr\\u01b0\\u1edbc T\\u1ed5ng kh\\u1edfi ngh\\u0129a 19-8-1945; b&agrave; m\\u1eb9 Vi\\u1ec7t Nam anh h&ugrave;ng.<\\/p>\\r\\n\\r\\n<p>Gi\\u1ea3m 30% gi&aacute; v&eacute; cho c&aacute;c \\u0111\\u1ed1i t\\u01b0\\u1ee3ng l&agrave; th\\u01b0\\u01a1ng binh, ng\\u01b0\\u1eddi h\\u01b0\\u1edfng ch&iacute;nh s&aacute;ch nh\\u01b0 th\\u01b0\\u01a1ng binh; n\\u1ea1n nh&acirc;n ch\\u1ea5t \\u0111\\u1ed9c m&agrave;u da cam; ng\\u01b0\\u1eddi khuy\\u1ebft t\\u1eadt \\u0111\\u1eb7c bi\\u1ec7t n\\u1eb7ng v&agrave; ng\\u01b0\\u1eddi khuy\\u1ebft t\\u1eadt n\\u1eb7ng.<\\/p>\\r\\n\\r\\n<p>Mi\\u1ec5n v&eacute; &aacute;p d\\u1ee5ng cho tr\\u1ebb em d\\u01b0\\u1edbi s&aacute;u tu\\u1ed5i \\u0111i c&ugrave;ng ng\\u01b0\\u1eddi l\\u1edbn. Tr\\u1ebb em \\u0111\\u01b0\\u1ee3c mi\\u1ec5n v&eacute; ph\\u1ea3i s\\u1eed d\\u1ee5ng chung ch\\u1ed7 c\\u1ee7a ng\\u01b0\\u1eddi l\\u1edbn \\u0111i c&ugrave;ng. M\\u1ed7i ng\\u01b0\\u1eddi l\\u1edbn \\u0111\\u01b0\\u1ee3c k&egrave;m kh&ocirc;ng qu&aacute; hai \\u0111\\u1ed1i t\\u01b0\\u1ee3ng mi\\u1ec5n v&eacute; \\u0111i c&ugrave;ng.<\\/p>\\r\\n\\r\\n<p><a class=\\"photo\\" href=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/16\\/06\\/08\\/50\\/19574842\\/1_74430.jpg\\" style=\\"box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;\\"><img alt=\\"Nhieu doi tuong duoc giam gia ve tau den 90% - Anh 1\\" src=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/w460x\\/16\\/06\\/08\\/50\\/19574842\\/1_74430.jpg\\" style=\\"border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle\\" title=\\"Nhi\\u1ec1u \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c gi\\u1ea3m gi\\u00e1 v\\u00e9 t\\u00e0u \\u0111\\u1ebfn 90% - \\u1ea2nh 1\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<p><em>B\\u1ea3ng gi\\u1ea3m gi&aacute; v&eacute; t&agrave;u<\\/em><\\/p>\\r\\n\\r\\n<p>C\\u0169ng theo T\\u1ed5ng C&ocirc;ng ty \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam, gi\\u1ea3m 15% gi&aacute; v&eacute; cho ng\\u01b0\\u1eddi cao tu\\u1ed5i l&agrave; c&ocirc;ng d&acirc;n Vi\\u1ec7t Nam t\\u1eeb \\u0111\\u1ee7 60 tu\\u1ed5i tr\\u1edf l&ecirc;n. Gi\\u1ea3m 50% gi&aacute; v&eacute; lo\\u1ea1i ch\\u1ed7 gh\\u1ebf ng\\u1ed3i ho\\u1eb7c gi\\u1ea3m 25% gi&aacute; v&eacute; lo\\u1ea1i ch\\u1ed7 gi\\u01b0\\u1eddng n\\u1eb1m cho tr\\u1ebb em t\\u1eeb s&aacute;u \\u0111\\u1ebfn 10 tu\\u1ed5i.<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1eb7c bi\\u1ec7t, gi\\u1ea3m 10% gi&aacute; v&eacute; cho h\\u1ecdc sinh, sinh vi&ecirc;n, h\\u1ecdc vi&ecirc;n c&aacute;c tr\\u01b0\\u1eddng d\\u1ea1y ngh\\u1ec1, trung h\\u1ecdc chuy&ecirc;n nghi\\u1ec7p, cao \\u0111\\u1eb3ng, \\u0111\\u1ea1i h\\u1ecdc, h\\u1ecdc vi\\u1ec7n (kh&ocirc;ng bao g\\u1ed3m c&aacute;c sinh vi&ecirc;n, h\\u1ecdc vi&ecirc;n h\\u1ecdc sau \\u0111\\u1ea1i h\\u1ecdc), c&aacute;c \\u0111\\u1ed1i t\\u01b0\\u1ee3ng n&agrave;y \\u0111\\u01b0\\u1ee3c g\\u1ecdi t\\u1eaft l&agrave; h\\u1ecdc sinh, sinh vi&ecirc;n.<\\/p>\\r\\n\\r\\n<p>\\u0110i\\u1ec1u ki\\u1ec7n khi mua v&eacute; gi\\u1ea3m gi&aacute; v&agrave; \\u0111i t&agrave;u \\u0111\\u1ed1i v\\u1edbi ng\\u01b0\\u1eddi cao tu\\u1ed5i ph\\u1ea3i xu\\u1ea5t tr&igrave;nh ch\\u1ee9ng minh nh&acirc;n d&acirc;n, ho\\u1eb7c gi\\u1ea5y t\\u1edd t&ugrave;y th&acirc;n (c&oacute; \\u1ea3nh) \\u0111\\u01b0\\u1ee3c ph&aacute;p lu\\u1eadt c&ocirc;ng nh\\u1eadn. \\u0110\\u1ed1i v\\u1edbi h\\u1ecdc sinh, sinh vi&ecirc;n ph\\u1ea3i xu\\u1ea5t tr&igrave;nh ch\\u1ee9ng minh 