gi\\u1ea5y t\\u1edd t&ugrave;y th&acirc;n (c&oacute; \\u1ea3nh) \\u0111\\u01b0\\u1ee3c ph&aacute;p lu\\u1eadt c&ocirc;ng nh\\u1eadn. \\u0110\\u1ed1i v\\u1edbi h\\u1ecdc sinh, sinh vi&ecirc;n ph\\u1ea3i xu\\u1ea5t tr&igrave;nh ch\\u1ee9ng minh nh&acirc;n d&acirc;n ho\\u1eb7c gi\\u1ea5y t\\u1edd t&ugrave;y th&acirc;n (c&oacute; \\u1ea3nh) \\u0111\\u01b0\\u1ee3c ph&aacute;p lu\\u1eadt c&ocirc;ng nh\\u1eadn v&agrave; th\\u1ebb sinh vi&ecirc;n, h\\u1ecdc vi&ecirc;n,&hellip; do c&aacute;c tr\\u01b0\\u1eddng d\\u1ea1y ngh\\u1ec1, trung h\\u1ecdc chuy&ecirc;n nghi\\u1ec7p, cao \\u0111\\u1eb3ng, \\u0111\\u1ea1i h\\u1ecdc, h\\u1ecdc vi\\u1ec7n c\\u1ea5p c&ograve;n hi\\u1ec7u l\\u1ef1c.<\\/p>\\r\\n\\r\\n<p>VI\\u1ebeT LONG<\\/p>\\r\\n"}', 'Giảm giá tàu,giảm 10% giá vé cho học sinh, sinh viên, học viên,Bảng giảm giá vé tàu', '{"keyword_en":"Gi\\u1ea3m gi\\u00e1 t\\u00e0u,gi\\u1ea3m 10% gi\\u00e1 v\\u00e9 cho h\\u1ecdc sinh, sinh vi\\u00ean, h\\u1ecdc vi\\u00ean,B\\u1ea3ng gi\\u1ea3m gi\\u00e1 v\\u00e9 t\\u00e0u","keyword_jp":"Gi\\u1ea3m gi\\u00e1 t\\u00e0u,gi\\u1ea3m 10% gi\\u00e1 v\\u00e9 cho h\\u1ecdc sinh, sinh vi\\u00ean, h\\u1ecdc vi\\u00ean,B\\u1ea3ng gi\\u1ea3m gi\\u00e1 v\\u00e9 t\\u00e0u"}', '/public/media/files/1_74430.jpg', '0000-00-00 00:00:00', '', 0, '', NULL);
