(37, 'Đổi mới cơ chế, hướng tới xã hội hóa hạ tầng đường sắt', '{"name_en":"\\u0110\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf, h\\u01b0\\u1edbng t\\u1edbi x\\u00e3 h\\u1ed9i h\\u00f3a h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft","name_jp":"\\u0110\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf, h\\u01b0\\u1edbng t\\u1edbi x\\u00e3 h\\u1ed9i h\\u00f3a', 'doi-moi-co-che-huong-toi-xa-hoi-hoa-ha-tang-duong-sat-37', '{"alias_en":"doi-moi-co-che-huong-toi-xa-hoi-hoa-ha-tang-duong-sat-37","alias_jp":"doi-moi-co-che-huong-toi-xa-hoi-hoa-ha-tang-duong-sat-37"}', 8, '<p><strong>Ng&agrave;y 8/6, Cục Quản l&yacute; C&ocirc;ng sản (Bộ T&agrave;i ch&iacute;nh) tổ chức Hội thảo &ldquo;Tham vấn dự thảo Nghị định quy định việc quản l&yacute;, sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt&rdquo;, tại H&agrave; Nội. Chủ tr&igrave; hội thảo c&oacute; Thứ trưởng Bộ T&agrave;i ch&iacute;nh Nguyễn Hữu Ch&iacute;, Thứ trưởng Bộ Giao th&ocirc;ng Vận tải c&ugrave;ng c&aacute;c nh&agrave; quản l&yacute;, c&aacute;c chuy&ecirc;n gia trong lĩnh vực n&agrave;y.</strong></p>\r\n', '{"intro_en":"<p><strong>Ng&agrave;y 8\\/6, C\\u1ee5c Qu\\u1ea3n l&yacute; C&ocirc;ng s\\u1ea3n (B\\u1ed9 T&agrave;i ch&iacute;nh) t\\u1ed5 ch\\u1ee9c H\\u1ed9i th\\u1ea3o &ldquo;Tham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft&rdquo;, t\\u1ea1i H&agrave; N\\u1ed9i. Ch\\u1ee7 tr&igrave; h\\u1ed9i th\\u1ea3o c&oacute; Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute;, Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 Giao th&ocirc;ng V\\u1eadn t\\u1ea3i c&ugrave;ng c&aacute;c nh&agrave; qu\\u1ea3n l&yacute;, c&aacute;c chuy&ecirc;n gia trong l\\u0129nh v\\u1ef1c n&agrave;y.<\\/strong><\\/p>\\r\\n","intro_jp":"<p><strong>Ng&agrave;y 8\\/6, C\\u1ee5c Qu\\u1ea3n l&yacute; C&ocirc;ng s\\u1ea3n (B\\u1ed9 T&agrave;i ch&iacute;nh) t\\u1ed5 ch\\u1ee9c H\\u1ed9i th\\u1ea3o &ldquo;Tham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft&rdquo;, t\\u1ea1i H&agrave; N\\u1ed9i. Ch\\u1ee7 tr&igrave; h\\u1ed9i th\\u1ea3o c&oacute; Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute;, Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 Giao th&ocirc;ng V\\u1eadn t\\u1ea3i c&ugrave;ng c&aacute;c nh&agrave; qu\\u1ea3n l&yacute;, c&aacute;c chuy&ecirc;n gia trong l\\u0129nh v\\u1ef1c n&agrave;y.<\\/strong><\\/p>\\r\\n"}', '<p><a class="photo" href="http://2.i.baomoi.xdn.vn/16/06/08/215/19577212/1_122166.jpg" style="box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;"><img alt="Doi moi co che, huong toi xa hoi hoa ha tang duong sat - Anh 1" src="http://2.i.baomoi.xdn.vn/w460x/16/06/08/215/19577212/1_122166.jpg" style="border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle" title="Đổi mới cơ chế, hướng tới xã hội hóa hạ tầng đường sắt - Ảnh 1" /></a></p>\r\n\r\n<p>Ước t&iacute;nh giai đoạn 2016-2020, Việt Nam cần tới 10 tỷ USD để đầu tư v&agrave;o hệ thống đường sắt, đ&acirc;y thực sự l&agrave; th&aacute;ch thức lớn trong việc huy động nguồn lực v&agrave;o c&ocirc;ng cuộc duy tu, bảo tr&igrave; v&agrave; ph&aacute;t triển.</p>\r\n\r\n<p>Ph&aacute;t biểu tại hội thảo, Thứ trưởng Bộ T&agrave;i ch&iacute;nh Nguyễn Hữu Ch&iacute; cho rằng, trong những năm qua, Nh&agrave; nước đ&atilde; huy động nhiều nguồn lực để x&acirc;y dựng kết cấu hạ tầng với quy m&ocirc; rất lớn, g&oacute;p phần quan trọng v&agrave;o ph&aacute;t triển kinh tế x&atilde; hội, x&oacute;a đ&oacute;i giảm ngh&egrave;o tr&ecirc;n c&aacute;c v&ugrave;ng, miền của đất nước. Tuy nhi&ecirc;n, hệ thống cơ sở hạ tầng của Việt Nam trong đ&oacute; c&oacute; kết cấu hạ tầng giao th&ocirc;ng vẫn c&ograve;n yếu k&eacute;m, lạc hậu, chưa đồng bộ, khả năng kết nối giữa c&aacute;c loại h&igrave;nh c&ograve;n hạn chế.</p>\r\n\r\n<p>Mặc d&ugrave; l&agrave; phương thức vận tải c&oacute; nhiều lợi thế do gi&aacute; th&agrave;nh thấp, vận chuyển h&agrave;ng h&oacute;a khối lượng lớn, an to&agrave;n nhưng hệ thống hạ tầng đường sắt Việt Nam kh&ocirc;ng những kh&ocirc;ng được đầu tư ph&aacute;t triển, m&agrave; c&ograve;n bị thu hẹp, thậm ch&iacute; c&oacute; những tuyến đường đ&atilde; được x&acirc;y dựng tr&ecirc;n 100 năm.</p>\r\n\r\n<p>Nguy&ecirc;n nh&acirc;n dẫn tới t&igrave;nh trạng tr&ecirc;n c&oacute; rất nhiều, trong đ&oacute; phải kể tới c&aacute;c cơ chế, ch&iacute;nh s&aacute;ch trong quản l&yacute;. Những năm qua, hệ thống ph&aacute;p luật li&ecirc;n quan đến quản l&yacute;, sử dụng, khai th&aacute;c t&agrave;i sản kết cấu hạ tầng đường sắt đ&atilde; tạo điều kiện cho sự ph&aacute;t triển, song vẫn mang t&iacute;nh chất quản l&yacute; chuy&ecirc;n ng&agrave;nh, chưa ph&acirc;n định r&otilde; quyền, nghĩa vụ của đại diện chủ sở hữu t&agrave;i sản kết cấu hạ tầng với đối tượng được giao sử dụng; trong khi chưa c&oacute; quy định cụ thể về cơ chế t&agrave;i ch&iacute;nh tạo &ldquo;cơ chế mở&rdquo; thu h&uacute;t đầu tư, khai th&aacute;c. Thực tế tại Tổng c&ocirc;ng ty đường sắt Việt Nam cho thấy, do vừa l&agrave; chủ thể được Nh&agrave; nước giao quản l&yacute; t&agrave;i sản kết kết cấu hạ tầng, vừa l&agrave; đơn vị sử dụng, khai th&aacute;c, bảo tr&igrave; n&ecirc;n đ&atilde; c&oacute; nhiều hạn chế trong c&ocirc;ng t&aacute;c quản l&yacute;, sử dụng, gi&aacute;m s&aacute;t việc sử dụng vốn, t&agrave;i sản nh&agrave; nước, dẫn tới chưa hiệu quả.</p>\r\n\r\n<p>Chỉ t&iacute;nh trong giai đoạn 2011-2014, h&agrave;ng năm ng&acirc;n s&aacute;ch nh&agrave; nước phải cấp kinh ph&iacute; thực hiện c&ocirc;ng t&aacute;c duy tu, sửa chữa t&agrave;i sản kết cấu hạ tầng từ 1.400 - 1.900 tỷ đồng, như vậy, ngo&agrave;i nguồn thu được từ khai th&aacute;c kết cấu hạ tầng đường sắt (khoảng 350 tỷ đồng), ng&acirc;n s&aacute;ch nh&agrave; nước cấp th&ecirc;m b&igrave;nh qu&acirc;n từ 1.100 tỷ đồng đến tr&ecirc;n 1.600 tỷ đồng. Thế nhưng, năng lực vận tải lại đạt rất thấp, chỉ bằng 4,5% tổng lượng vận tải h&agrave;nh kh&aacute;ch v&agrave; khoảng 1,8% tổng lượng vận tải h&agrave;ng h&oacute;a.</p>\r\n\r\n<p>Trong khi đ&oacute;, cơ chế thu h&uacute;t nguồn lực từ khu vực ngo&agrave;i nh&agrave; nước để chia sẻ g&aacute;nh nặng với Nh&agrave; nước chưa r&otilde; r&agrave;ng. Hiện tại, nhu cầu vốn phục vụ bảo tr&igrave; hạ tầng đường sắt t&iacute;nh đến năm 2020 khoảng 10 tỷ USD; nhu cầu vốn để đầu tư x&acirc;y dựng ph&aacute;t triển hạ tầng đường sắt mới theo Chiến lược ph&aacute;t triển đến năm 2030 đ&atilde; được ph&ecirc; duyệt cần khoảng 100 tỷ USD. Đ&acirc;y l&agrave; nhiệm vụ hết sức nặng nề, cần thiết phải c&oacute; giải ph&aacute;p đủ mạnh, nhằm thu h&uacute;t được nguồn lực đủ lớn để đạt được mục ti&ecirc;u ph&aacute;t triển hạ tầng đường sắt m&agrave; Nh&agrave; nước đ&atilde; đặt ra.</p>\r\n\r\n<p>Mặt kh&aacute;c, việc t&iacute;nh ph&iacute; sử dụng hạ tầng đường sắt dựa tr&ecirc;n doanh thu vận tải của doanh nghiệp kinh doanh đường sắt (8% doanh thu) v&agrave; gi&aacute; cho thu&ecirc; (tr&iacute;ch 20% doanh thu sau khi trừ c&aacute;c chi ph&iacute; li&ecirc;n quan) n&ecirc;n chưa hợp l&yacute; theo cơ chế thị trường, l&agrave;m triệt ti&ecirc;u năng lực cạnh tranh của doanh nghiệp vận tải v&agrave; c&aacute;c đơn vị thu&ecirc; kết cấu hạ tầng; đồng thời, dẫn đến thất thu kinh ph&iacute; để t&aacute;i đầu tư hạ tầng đường sắt.</p>\r\n\r\n<p>Việc ph&acirc;n loại t&agrave;i sản kết cấu hạ tầng đường sắt giữa c&aacute;c văn bản quy phạm ph&aacute;p luật c&ograve;n chưa c&oacute; sự thống nhất; kh&aacute;i niệm t&ecirc;n gọi, ph&acirc;n loại t&agrave;i sản hạ tầng đường sắt chỉ mới đảm bảo t&iacute;nh thống k&ecirc; đầy đủ về hiện vật t&agrave;i sản. Sự t&aacute;ch bạch giữa việc sử dụng, kinh doanh t&agrave;i sản thuộc sở hữu nh&agrave; nước với t&agrave;i sản thuộc sở hữu của doanh nghiệp thiếu r&otilde; r&agrave;ng, minh bạch; việc chi ti&ecirc;u, hạch to&aacute;n đối với từng hoạt động chưa được ph&acirc;n t&aacute;ch cụ thể, tr&aacute;ch nhiệm quản l&yacute; chưa r&otilde; r&agrave;ng dẫn đến k&eacute;m hiệu quả, thất tho&aacute;t.</p>\r\n\r\n<p>Trước thực trạng tr&ecirc;n, c&aacute;c nghi&ecirc;n cứu về giải ph&aacute;p ph&aacute;t triển hạ tầng đường sắt ở Việt Nam đ&atilde; chỉ r&otilde; cần phải thực hiện đồng thời c&ugrave;ng l&uacute;c 2 nhiệm vụ mang t&iacute;nh chiến lược, đ&oacute; l&agrave;: khẩn trương đầu tư x&acirc;y dựng mới, n&acirc;ng cấp, hiện đại h&oacute;a c&aacute;c tuyến giao th&ocirc;ng đường sắt; đổi mới cơ chế quản l&yacute;, sử dụng, bảo tr&igrave; v&agrave; khai th&aacute;c hạ tầng đường sắt hiện c&oacute; nhằm duy tr&igrave; năng lực phục vụ hiện tại v&agrave; k&eacute;o d&agrave;i tuổi thọ của c&aacute;c c&ocirc;ng tr&igrave;nh.</p>\r\n\r\n<p>Cục Quản l&yacute; c&ocirc;ng sản (Bộ T&agrave;i ch&iacute;nh) cho biết, Dự thảo Nghị định quy định việc quản l&yacute;, sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt được x&acirc;y dựng nhằm mục ti&ecirc;u khắc phục những tồn tại n&ecirc;u tr&ecirc;n, hướng tới t&aacute;ch bạch r&otilde; giữa quản l&yacute; nh&agrave; nước của cơ quan nh&agrave; nước với quản l&yacute; kinh doanh của doanh nghiệp đ&atilde; được quy định tại Luật Đường sắt năm 2005; l&agrave;m r&otilde; những vấn đề chưa ph&ugrave; hợp với c&aacute;c quy định của ph&aacute;p luật về doanh nghiệp v&agrave; ph&aacute;p luật đất đai&hellip;</p>\r\n\r\n<p>Điểm mới của dự thảo l&agrave; t&aacute;ch bạch quan hệ về t&agrave;i sản giữa đại diện chủ sở hữu l&agrave; nh&agrave; nước khi giao t&agrave;i sản gắn liền với giao vốn cho doanh nghiệp, theo quy định của ph&aacute;p luật doanh nghiệp; giao t&agrave;i sản của nh&agrave; nước kh&ocirc;ng gắn với giao vốn, đại diện chủ sở hữu phần vốn v&agrave; t&agrave;i sản của Nh&agrave; nước c&oacute; quyền định đoạt, quản l&yacute; điều h&agrave;nh t&agrave;i sản, được quyền giao cho doanh nghiệp sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt.</p>\r\n\r\n<p>Chi sẻ quan điểm tại Hội thảo, Gi&aacute;m đốc quốc gia Ng&acirc;n h&agrave;ng ph&aacute;t triển ch&acirc;u &Aacute; tại Việt Nam - &ocirc;ng Eric Sidgwick cũng cho rằng, mạng lưới đường sắt Việt Nam đ&oacute;ng vai tr&ograve; quan trọng trong sự ph&aacute;t triển kinh tế x&atilde; hội của đất nước. Mặc d&ugrave; c&oacute; nhiều tiềm năng để ph&aacute;t triển nhưng lĩnh vực n&agrave;y đang gặp nhiều hạn chế do cơ chế, ch&iacute;nh s&aacute;ch, năng lực vận tải, hạ tầng chưa hợp l&yacute; v&agrave; đ&aacute;p ứng y&ecirc;u cầu của sự ph&aacute;t triển.</p>\r\n\r\n<p>&quot;Ước t&iacute;nh giai đoạn 2016-2020, Việt Nam cần tới 10 tỷ USD để đầu tư v&agrave;o hệ thống đường sắt, đ&acirc;y thực sự l&agrave; th&aacute;ch thức lớn trong việc huy động nguồn lực v&agrave;o c&ocirc;ng cuộc duy tu, bảo tr&igrave; v&agrave; ph&aacute;t triển, nếu Nh&agrave; nước kh&ocirc;ng c&oacute; đủ năng lực cấp vốn cho hoạt động n&agrave;y. Thời gian tới, Việt Nam cần phải tập trung v&agrave;o ph&aacute;t triển để khai th&aacute;c tiềm năng, thế mạnh của ng&agrave;nh Đường sắt, trong đ&oacute; c&aacute;c cơ chế quản l&yacute; cần được thay đổi để thu h&uacute;t nguồn lực từ tư nh&acirc;n&rdquo;, &ocirc;ng Eric Sidgwick n&ecirc;u quan điểm.</p>\r\n\r\n<p>Đồng &yacute; với xu hướng l&agrave; cần phải hướng tới x&atilde; hội h&oacute;a trong việc kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt nhưng Thứ trưởng Bộ Giao th&ocirc;ng Vận tải &ndash; Nguyễn Ngọc Đ&ocirc;ng vẫn bảo lưu quan điểm: Đối với những tuyến đường khai th&aacute;c kh&ocirc;ng hiệu quả nhưng vẫn phải duy tr&igrave; th&igrave; Nh&agrave; nước cần phải hỗ trợ tối đa nguồn lực, kể cả hỗ trợ 100% việc duy tu; đối với những tuyến c&oacute; thể kinh doanh tốt th&igrave; Nh&agrave; nước sẽ kh&ocirc;ng hỗ trợ 100% m&agrave; đơn vị kinh doanh cần phải kinh doanh tối đa hạ tầng để b&ugrave; đắp c&aacute;c chi ph&iacute; đầu tư. &ldquo;Đối với kết cấu hạ tầng đường sắt, c&aacute;i g&igrave; Nh&agrave; nước đầu tư th&igrave; Nh&agrave; nước sẽ quản l&yacute; như ga, đường ray&hellip; c&ograve;n lại sẽ tiến h&agrave;nh thu h&uacute;t đầu tư từ tư nh&acirc;n&rdquo;, &ocirc;ng Đ&ocirc;ng đề cập th&ecirc;m.</p>\r\n\r\n<p>G&oacute;p &yacute; tại Hội thảo, phần đa &yacute; kiến tham gia đều thống nhất sự cần thiết ban h&agrave;nh Nghị định quy định việc quản l&yacute;, sử dụng v&agrave; kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt; tăng cường việc quản l&yacute;, sử dụng v&agrave; khai th&aacute;c tốt hơn đối với t&agrave;i sản l&agrave; kết cấu hạ tầng đường sắt; thống nhất về phạm vi v&agrave; đối tượng; thống nhất về c&aacute;ch thức quản l&yacute;, sử dụng v&agrave; một số phương thức kinh doanh t&agrave;i sản kết cấu hạ tầng đường sắt.</p>\r\n\r\n<p>PV.</p>\r\n', '{"content_en":"<p><a class=\\"photo\\" href=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/16\\/06\\/08\\/215\\/19577212\\/1_122166.jpg\\" style=\\"box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;\\"><img alt=\\"Doi moi co che, huong toi xa hoi hoa ha tang duong sat - Anh 1\\" src=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/w460x\\/16\\/06\\/08\\/215\\/19577212\\/1_122166.jpg\\" style=\\"border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle\\" title=\\"\\u0110\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf, h\\u01b0\\u1edbng t\\u1edbi x\\u00e3 h\\u1ed9i h\\u00f3a h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft - \\u1ea2nh 1\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<p>\\u01af\\u1edbc t&iacute;nh giai \\u0111o\\u1ea1n 2016-2020, Vi\\u1ec7t Nam c\\u1ea7n t\\u1edbi 10 t\\u1ef7 USD \\u0111\\u1ec3 \\u0111\\u1ea7u t\\u01b0 v&agrave;o h\\u1ec7 th\\u1ed1ng \\u0111\\u01b0\\u1eddng s\\u1eaft, \\u0111&acirc;y th\\u1ef1c s\\u1ef1 l&agrave; th&aacute;ch th\\u1ee9c l\\u1edbn trong vi\\u1ec7c huy \\u0111\\u1ed9ng ngu\\u1ed3n l\\u1ef1c v&agrave;o c&ocirc;ng cu\\u1ed9c duy tu, b\\u1ea3o tr&igrave; v&agrave; ph&aacute;t tri\\u1ec3n.<\\/p>\\r\\n\\r\\n<p>Ph&aacute;t bi\\u1ec3u t\\u1ea1i h\\u1ed9i th\\u1ea3o, Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute; cho r\\u1eb1ng, trong nh\\u1eefng n\\u0103m qua, Nh&agrave; n\\u01b0\\u1edbc \\u0111&atilde; huy \\u0111\\u1ed9ng nhi\\u1ec1u ngu\\u1ed3n l\\u1ef1c \\u0111\\u1ec3 x&acirc;y d\\u1ef1ng k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng v\\u1edbi quy m&ocirc; r\\u1ea5t l\\u1edbn, g&oacute;p ph\\u1ea7n quan tr\\u1ecdng v&agrave;o ph&aacute;t tri\\u1ec3n kinh t\\u1ebf x&atilde; h\\u1ed9i, x&oacute;a \\u0111&oacute;i gi\\u1ea3m ngh&egrave;o tr&ecirc;n c&aacute;c v&ugrave;ng, mi\\u1ec1n c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc. Tuy nhi&ecirc;n, h\\u1ec7 th\\u1ed1ng c\\u01a1 s\\u1edf h\\u1ea1 t\\u1ea7ng c\\u1ee7a Vi\\u1ec7t Nam trong \\u0111&oacute; c&oacute; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng giao th&ocirc;ng v\\u1eabn c&ograve;n y\\u1ebfu k&eacute;m, l\\u1ea1c h\\u1eadu, ch\\u01b0a \\u0111\\u1ed3ng b\\u1ed9, kh\\u1ea3 n\\u0103ng k\\u1ebft n\\u1ed1i gi\\u1eefa c&aacute;c lo\\u1ea1i h&igrave;nh c&ograve;n h\\u1ea1n ch\\u1ebf.<\\/p>\\r\\n\\r\\n<p>M\\u1eb7c d&ugrave; l&agrave; ph\\u01b0\\u01a1ng th\\u1ee9c v\\u1eadn t\\u1ea3i c&oacute; nhi\\u1ec1u l\\u1ee3i th\\u1ebf do gi&aacute; th&agrave;nh th\\u1ea5p, v\\u1eadn chuy\\u1ec3n h&agrave;ng h&oacute;a kh\\u1ed1i l\\u01b0\\u1ee3ng l\\u1edbn, an to&agrave;n nh\\u01b0ng h\\u1ec7 th\\u1ed1ng h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam kh&ocirc;ng nh\\u1eefng kh&ocirc;ng \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 ph&aacute;t tri\\u1ec3n, m&agrave; c&ograve;n b\\u1ecb thu h\\u1eb9p, th\\u1eadm ch&iacute; c&oacute; nh\\u1eefng tuy\\u1ebfn \\u0111\\u01b0\\u1eddng \\u0111&atilde; \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng tr&ecirc;n 100 n\\u0103m.<\\/p>\\r\\n\\r\\n<p>Nguy&ecirc;n nh&acirc;n d\\u1eabn t\\u1edbi t&igrave;nh tr\\u1ea1ng tr&ecirc;n c&oacute; r\\u1ea5t nhi\\u1ec1u, trong \\u0111&oacute; ph\\u1ea3i k\\u1ec3 t\\u1edbi c&aacute;c c\\u01a1 ch\\u1ebf, ch&iacute;nh s&aacute;ch trong qu\\u1ea3n l&yacute;. Nh\\u1eefng n\\u0103m qua, h\\u1ec7 th\\u1ed1ng ph&aacute;p lu\\u1eadt li&ecirc;n quan \\u0111\\u1ebfn qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, khai th&aacute;c t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0111&atilde; t\\u1ea1o \\u0111i\\u1ec1u ki\\u1ec7n cho s\\u1ef1 ph&aacute;t tri\\u1ec3n, song v\\u1eabn mang t&iacute;nh ch\\u1ea5t qu\\u1ea3n l&yacute; chuy&ecirc;n ng&agrave;nh, ch\\u01b0a ph&acirc;n \\u0111\\u1ecbnh r&otilde; quy\\u1ec1n, ngh\\u0129a v\\u1ee5 c\\u1ee7a \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng v\\u1edbi \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c giao s\\u1eed d\\u1ee5ng; trong khi ch\\u01b0a c&oacute; quy \\u0111\\u1ecbnh c\\u1ee5 th\\u1ec3 v\\u1ec1 c\\u01a1 ch\\u1ebf t&agrave;i ch&iacute;nh t\\u1ea1o &ldquo;c\\u01a1 ch\\u1ebf m\\u1edf&rdquo; thu h&uacute;t \\u0111\\u1ea7u t\\u01b0, khai th&aacute;c. Th\\u1ef1c t\\u1ebf t\\u1ea1i T\\u1ed5ng c&ocirc;ng ty \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam cho th\\u1ea5y, do v\\u1eeba l&agrave; ch\\u1ee7 th\\u1ec3 \\u0111\\u01b0\\u1ee3c Nh&agrave; n\\u01b0\\u1edbc giao qu\\u1ea3n l&yacute; t&agrave;i s\\u1ea3n k\\u1ebft k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng, v\\u1eeba l&agrave; \\u0111\\u01a1n v\\u1ecb s\\u1eed d\\u1ee5ng, khai th&aacute;c, b\\u1ea3o tr&igrave; n&ecirc;n \\u0111&atilde; c&oacute; nhi\\u1ec1u h\\u1ea1n ch\\u1ebf trong c&ocirc;ng t&aacute;c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, gi&aacute;m s&aacute;t vi\\u1ec7c s\\u1eed d\\u1ee5ng v\\u1ed1n, t&agrave;i s\\u1ea3n nh&agrave; n\\u01b0\\u1edbc, d\\u1eabn t\\u1edbi ch\\u01b0a hi\\u1ec7u qu\\u1ea3.<\\/p>\\r\\n\\r\\n<p>Ch\\u1ec9 t&iacute;nh trong giai \\u0111o\\u1ea1n 2011-2014, h&agrave;ng n\\u0103m ng&acirc;n s&aacute;ch nh&agrave; n\\u01b0\\u1edbc ph\\u1ea3i c\\u1ea5p kinh ph&iacute; th\\u1ef1c hi\\u1ec7n c&ocirc;ng t&aacute;c duy tu, s\\u1eeda ch\\u1eefa t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng t\\u1eeb 1.400 - 1.900 t\\u1ef7 \\u0111\\u1ed3ng, nh\\u01b0 v\\u1eady, ngo&agrave;i ngu\\u1ed3n thu \\u0111\\u01b0\\u1ee3c t\\u1eeb khai th&aacute;c k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft (kho\\u1ea3ng 350 t\\u1ef7 \\u0111\\u1ed3ng), ng&acirc;n s&aacute;ch nh&agrave; n\\u01b0\\u1edbc c\\u1ea5p th&ecirc;m b&igrave;nh qu&acirc;n t\\u1eeb 1.100 t\\u1ef7 \\u0111\\u1ed3ng \\u0111\\u1ebfn tr&ecirc;n 1.600 t\\u1ef7 \\u0111\\u1ed3ng. Th\\u1ebf nh\\u01b0ng, n\\u0103ng l\\u1ef1c v\\u1eadn t\\u1ea3i l\\u1ea1i \\u0111\\u1ea1t r\\u1ea5t th\\u1ea5p, ch\\u1ec9 b\\u1eb1ng 4,5% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;nh kh&aacute;ch v&agrave; kho\\u1ea3ng 1,8% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;ng h&oacute;a.<\\/p>\\r\\n\\r\\n<p>Trong khi \\u0111&oacute;, c\\u01a1 ch\\u1ebf thu h&uacute;t ngu\\u1ed3n l\\u1ef1c t\\u1eeb khu v\\u1ef1c ngo&agrave;i nh&agrave; n\\u01b0\\u1edbc \\u0111\\u1ec3 chia s\\u1ebb g&aacute;nh n\\u1eb7ng v\\u1edbi Nh&agrave; n\\u01b0\\u1edbc ch\\u01b0a r&otilde; r&agrave;ng. Hi\\u1ec7n t\\u1ea1i, nhu c\\u1ea7u v\\u1ed1n ph\\u1ee5c v\\u1ee5 b\\u1ea3o tr&igrave; h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft t&iacute;nh \\u0111\\u1ebfn n\\u0103m 2020 kho\\u1ea3ng 10 t\\u1ef7 USD; nhu c\\u1ea7u v\\u1ed1n \\u0111\\u1ec3 \\u0111\\u1ea7u t\\u01b0 x&acirc;y d\\u1ef1ng ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft m\\u1edbi theo Chi\\u1ebfn l\\u01b0\\u1ee3c ph&aacute;t tri\\u1ec3n \\u0111\\u1ebfn n\\u0103m 2030 \\u0111&atilde; \\u0111\\u01b0\\u1ee3c ph&ecirc; duy\\u1ec7t c\\u1ea7n kho\\u1ea3ng 100 t\\u1ef7 USD. \\u0110&acirc;y l&agrave; nhi\\u1ec7m v\\u1ee5 h\\u1ebft s\\u1ee9c n\\u1eb7ng n\\u1ec1, c\\u1ea7n thi\\u1ebft ph\\u1ea3i c&oacute; gi\\u1ea3i ph&aacute;p \\u0111\\u1ee7 m\\u1ea1nh, nh\\u1eb1m thu h&uacute;t \\u0111\\u01b0\\u1ee3c ngu\\u1ed3n l\\u1ef1c \\u0111\\u1ee7 l\\u1edbn \\u0111\\u1ec3 \\u0111\\u1ea1t \\u0111\\u01b0\\u1ee3c m\\u1ee5c ti&ecirc;u ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft m&agrave; Nh&agrave; n\\u01b0\\u1edbc \\u0111&atilde; \\u0111\\u1eb7t ra.<\\/p>\\r\\n\\r\\n<p>M\\u1eb7t kh&aacute;c, vi\\u1ec7c t&iacute;nh ph&iacute; s\\u1eed d\\u1ee5ng h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft d\\u1ef1a tr&ecirc;n doanh thu v\\u1eadn t\\u1ea3i c\\u1ee7a doanh nghi\\u1ec7p kinh doanh \\u0111\\u01b0\\u1eddng s\\u1eaft (8% doanh thu) v&agrave; gi&aacute; cho thu&ecirc; (tr&iacute;ch 20% doanh thu sau khi tr\\u1eeb c&aacute;c chi ph&iacute; li&ecirc;n quan) n&ecirc;n ch\\u01b0a h\\u1ee3p l&yacute; theo c\\u01a1 ch\\u1ebf th\\u1ecb tr\\u01b0\\u1eddng, l&agrave;m tri\\u1ec7t ti&ecirc;u n\\u0103ng l\\u1ef1c c\\u1ea1nh tranh c\\u1ee7a doanh nghi\\u1ec7p v\\u1eadn t\\u1ea3i v&agrave; c&aacute;c \\u0111\\u01a1n v\\u1ecb thu&ecirc; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng; \\u0111\\u1ed3ng th\\u1eddi, d\\u1eabn \\u0111\\u1ebfn th\\u1ea5t thu kinh ph&iacute; \\u0111\\u1ec3 t&aacute;i \\u0111\\u1ea7u t\\u01b0 h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Vi\\u1ec7c ph&acirc;n lo\\u1ea1i t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft gi\\u1eefa c&aacute;c v\\u0103n b\\u1ea3n quy ph\\u1ea1m ph&aacute;p lu\\u1eadt c&ograve;n ch\\u01b0a c&oacute; s\\u1ef1 th\\u1ed1ng nh\\u1ea5t; kh&aacute;i ni\\u1ec7m t&ecirc;n g\\u1ecdi, ph&acirc;n lo\\u1ea1i t&agrave;i s\\u1ea3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft ch\\u1ec9 m\\u1edbi \\u0111\\u1ea3m b\\u1ea3o t&iacute;nh th\\u1ed1ng k&ecirc; \\u0111\\u1ea7y \\u0111\\u1ee7 v\\u1ec1 hi\\u1ec7n v\\u1eadt t&agrave;i s\\u1ea3n. S\\u1ef1 t&aacute;ch b\\u1ea1ch gi\\u1eefa vi\\u1ec7c s\\u1eed d\\u1ee5ng, kinh doanh t&agrave;i s\\u1ea3n thu\\u1ed9c s\\u1edf h\\u1eefu nh&agrave; n\\u01b0\\u1edbc v\\u1edbi t&agrave;i s\\u1ea3n thu\\u1ed9c s\\u1edf h\\u1eefu c\\u1ee7a doanh nghi\\u1ec7p thi\\u1ebfu r&otilde; r&agrave;ng, minh b\\u1ea1ch; vi\\u1ec7c chi ti&ecirc;u, h\\u1ea1ch to&aacute;n \\u0111\\u1ed1i v\\u1edbi t\\u1eebng ho\\u1ea1t \\u0111\\u1ed9ng ch\\u01b0a \\u0111\\u01b0\\u1ee3c ph&acirc;n t&aacute;ch c\\u1ee5 th\\u1ec3, tr&aacute;ch nhi\\u1ec7m qu\\u1ea3n l&yacute; ch\\u01b0a r&otilde; r&agrave;ng d\\u1eabn \\u0111\\u1ebfn k&eacute;m hi\\u1ec7u qu\\u1ea3, th\\u1ea5t tho&aacute;t.<\\/p>\\r\\n\\r\\n<p>Tr\\u01b0\\u1edbc th\\u1ef1c tr\\u1ea1ng tr&ecirc;n, c&aacute;c nghi&ecirc;n c\\u1ee9u v\\u1ec1 gi\\u1ea3i ph&aacute;p ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u1edf Vi\\u1ec7t Nam \\u0111&atilde; ch\\u1ec9 r&otilde; c\\u1ea7n ph\\u1ea3i th\\u1ef1c hi\\u1ec7n \\u0111\\u1ed3ng th\\u1eddi c&ugrave;ng l&uacute;c 2 nhi\\u1ec7m v\\u1ee5 mang t&iacute;nh chi\\u1ebfn l\\u01b0\\u1ee3c, \\u0111&oacute; l&agrave;: kh\\u1ea9n tr\\u01b0\\u01a1ng \\u0111\\u1ea7u t\\u01b0 x&acirc;y d\\u1ef1ng m\\u1edbi, n&acirc;ng c\\u1ea5p, hi\\u1ec7n \\u0111\\u1ea1i h&oacute;a c&aacute;c tuy\\u1ebfn giao th&ocirc;ng \\u0111\\u01b0\\u1eddng s\\u1eaft; \\u0111\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, b\\u1ea3o tr&igrave; v&agrave; khai th&aacute;c h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft hi\\u1ec7n c&oacute; nh\\u1eb1m duy tr&igrave; n\\u0103ng l\\u1ef1c ph\\u1ee5c v\\u1ee5 hi\\u1ec7n t\\u1ea1i v&agrave; k&eacute;o d&agrave;i tu\\u1ed5i th\\u1ecd c\\u1ee7a c&aacute;c c&ocirc;ng tr&igrave;nh.<\\/p>\\r\\n\\r\\n<p>C\\u1ee5c Qu\\u1ea3n l&yacute; c&ocirc;ng s\\u1ea3n (B\\u1ed9 T&agrave;i ch&iacute;nh) cho bi\\u1ebft, D\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng nh\\u1eb1m m\\u1ee5c ti&ecirc;u kh\\u1eafc ph\\u1ee5c nh\\u1eefng t\\u1ed3n t\\u1ea1i n&ecirc;u tr&ecirc;n, h\\u01b0\\u1edbng t\\u1edbi t&aacute;ch b\\u1ea1ch r&otilde; gi\\u1eefa qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc c\\u1ee7a c\\u01a1 quan nh&agrave; n\\u01b0\\u1edbc v\\u1edbi qu\\u1ea3n l&yacute; kinh doanh c\\u1ee7a doanh nghi\\u1ec7p \\u0111&atilde; \\u0111\\u01b0\\u1ee3c quy \\u0111\\u1ecbnh t\\u1ea1i Lu\\u1eadt \\u0110\\u01b0\\u1eddng s\\u1eaft n\\u0103m 2005; l&agrave;m r&otilde; nh\\u1eefng v\\u1ea5n \\u0111\\u1ec1 ch\\u01b0a ph&ugrave; h\\u1ee3p v\\u1edbi c&aacute;c quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt v\\u1ec1 doanh nghi\\u1ec7p v&agrave; ph&aacute;p lu\\u1eadt \\u0111\\u1ea5t \\u0111ai&hellip;<\\/p>\\r\\n\\r\\n<p>\\u0110i\\u1ec3m m\\u1edbi c\\u1ee7a d\\u1ef1 th\\u1ea3o l&agrave; t&aacute;ch b\\u1ea1ch quan h\\u1ec7 v\\u1ec1 t&agrave;i s\\u1ea3n gi\\u1eefa \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu l&agrave; nh&agrave; n\\u01b0\\u1edbc khi giao t&agrave;i s\\u1ea3n g\\u1eafn li\\u1ec1n v\\u1edbi giao v\\u1ed1n cho doanh nghi\\u1ec7p, theo quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt doanh nghi\\u1ec7p; giao t&agrave;i s\\u1ea3n c\\u1ee7a nh&agrave; n\\u01b0\\u1edbc kh&ocirc;ng g\\u1eafn v\\u1edbi giao v\\u1ed1n, \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu ph\\u1ea7n v\\u1ed1n v&agrave; t&agrave;i s\\u1ea3n c\\u1ee7a Nh&agrave; n\\u01b0\\u1edbc c&oacute; quy\\u1ec1n \\u0111\\u1ecbnh \\u0111o\\u1ea1t, qu\\u1ea3n l&yacute; \\u0111i\\u1ec1u h&agrave;nh t&agrave;i s\\u1ea3n, \\u0111\\u01b0\\u1ee3c quy\\u1ec1n giao cho doanh nghi\\u1ec7p s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Chi s\\u1ebb quan \\u0111i\\u1ec3m t\\u1ea1i H\\u1ed9i th\\u1ea3o, Gi&aacute;m \\u0111\\u1ed1c qu\\u1ed1c gia Ng&acirc;n h&agrave;ng ph&aacute;t tri\\u1ec3n ch&acirc;u &Aacute; t\\u1ea1i Vi\\u1ec7t Nam - &ocirc;ng Eric Sidgwick c\\u0169ng cho r\\u1eb1ng, m\\u1ea1ng l\\u01b0\\u1edbi \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam \\u0111&oacute;ng vai tr&ograve; quan tr\\u1ecdng trong s\\u1ef1 ph&aacute;t tri\\u1ec3n kinh t\\u1ebf x&atilde; h\\u1ed9i c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc. M\\u1eb7c d&ugrave; c&oacute; nhi\\u1ec1u ti\\u1ec1m n\\u0103ng \\u0111\\u1ec3 ph&aacute;t tri\\u1ec3n nh\\u01b0ng l\\u0129nh v\\u1ef1c n&agrave;y \\u0111ang g\\u1eb7p nhi\\u1ec1u h\\u1ea1n ch\\u1ebf do c\\u01a1 ch\\u1ebf, ch&iacute;nh s&aacute;ch, n\\u0103ng l\\u1ef1c v\\u1eadn t\\u1ea3i, h\\u1ea1 t\\u1ea7ng ch\\u01b0a h\\u1ee3p l&yacute; v&agrave; \\u0111&aacute;p \\u1ee9ng y&ecirc;u c\\u1ea7u c\\u1ee7a s\\u1ef1 ph&aacute;t tri\\u1ec3n.<\\/p>\\r\\n\\r\\n<p>&quot;\\u01af\\u1edbc t&iacute;nh giai \\u0111o\\u1ea1n 2016-2020, Vi\\u1ec7t Nam c\\u1ea7n t\\u1edbi 10 t\\u1ef7 USD \\u0111\\u1ec3 \\u0111\\u1ea7u t\\u01b0 v&agrave;o h\\u1ec7 th\\u1ed1ng \\u0111\\u01b0\\u1eddng s\\u1eaft, \\u0111&acirc;y th\\u1ef1c s\\u1ef1 l&agrave; th&aacute;ch th\\u1ee9c l\\u1edbn trong vi\\u1ec7c huy \\u0111\\u1ed9ng ngu\\u1ed3n l\\u1ef1c v&agrave;o c&ocirc;ng cu\\u1ed9c duy tu, b\\u1ea3o tr&igrave; v&agrave; ph&aacute;t tri\\u1ec3n, n\\u1ebfu Nh&agrave; n\\u01b0\\u1edbc kh&ocirc;ng c&oacute; \\u0111\\u1ee7 n\\u0103ng l\\u1ef1c c\\u1ea5p v\\u1ed1n cho ho\\u1ea1t \\u0111\\u1ed9ng n&agrave;y. Th\\u1eddi gian t\\u1edbi, Vi\\u1ec7t Nam c\\u1ea7n ph\\u1ea3i t\\u1eadp trung v&agrave;o ph&aacute;t tri\\u1ec3n \\u0111\\u1ec3 khai th&aacute;c ti\\u1ec1m n\\u0103ng, th\\u1ebf m\\u1ea1nh c\\u1ee7a ng&agrave;nh \\u0110\\u01b0\\u1eddng s\\u1eaft, trong \\u0111&oacute; c&aacute;c c\\u01a1 ch\\u1ebf qu\\u1ea3n l&yacute; c\\u1ea7n \\u0111\\u01b0\\u1ee3c thay \\u0111\\u1ed5i \\u0111\\u1ec3 thu h&uacute;t ngu\\u1ed3n l\\u1ef1c t\\u1eeb t\\u01b0 nh&acirc;n&rdquo;, &ocirc;ng Eric Sidgwick n&ecirc;u quan \\u0111i\\u1ec3m.<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ed3ng &yacute; v\\u1edbi xu h\\u01b0\\u1edbng l&agrave; c\\u1ea7n ph\\u1ea3i h\\u01b0\\u1edbng t\\u1edbi x&atilde; h\\u1ed9i h&oacute;a trong vi\\u1ec7c kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft nh\\u01b0ng Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 Giao th&ocirc;ng V\\u1eadn t\\u1ea3i &ndash; Nguy\\u1ec5n Ng\\u1ecdc \\u0110&ocirc;ng v\\u1eabn b\\u1ea3o l\\u01b0u quan \\u0111i\\u1ec3m: \\u0110\\u1ed1i v\\u1edbi nh\\u1eefng tuy\\u1ebfn \\u0111\\u01b0\\u1eddng khai th&aacute;c kh&ocirc;ng hi\\u1ec7u qu\\u1ea3 nh\\u01b0ng v\\u1eabn ph\\u1ea3i duy tr&igrave; th&igrave; Nh&agrave; n\\u01b0\\u1edbc c\\u1ea7n ph\\u1ea3i h\\u1ed7 tr\\u1ee3 t\\u1ed1i \\u0111a ngu\\u1ed3n l\\u1ef1c, k\\u1ec3 c\\u1ea3 h\\u1ed7 tr\\u1ee3 100% vi\\u1ec7c duy tu; \\u0111\\u1ed1i v\\u1edbi nh\\u1eefng tuy\\u1ebfn c&oacute; th\\u1ec3 kinh doanh t\\u1ed1t th&igrave; Nh&agrave; n\\u01b0\\u1edbc s\\u1ebd kh&ocirc;ng h\\u1ed7 tr\\u1ee3 100% m&agrave; \\u0111\\u01a1n v\\u1ecb kinh doanh c\\u1ea7n ph\\u1ea3i kinh doanh t\\u1ed1i \\u0111a h\\u1ea1 t\\u1ea7ng \\u0111\\u1ec3 b&ugrave; \\u0111\\u1eafp c&aacute;c chi ph&iacute; \\u0111\\u1ea7u t\\u01b0. &ldquo;\\u0110\\u1ed1i v\\u1edbi k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft, c&aacute;i g&igrave; Nh&agrave; n\\u01b0\\u1edbc \\u0111\\u1ea7u t\\u01b0 th&igrave; Nh&agrave; n\\u01b0\\u1edbc s\\u1ebd qu\\u1ea3n l&yacute; nh\\u01b0 ga, \\u0111\\u01b0\\u1eddng ray&hellip; c&ograve;n l\\u1ea1i s\\u1ebd ti\\u1ebfn h&agrave;nh thu h&uacute;t \\u0111\\u1ea7u t\\u01b0 t\\u1eeb t\\u01b0 nh&acirc;n&rdquo;, &ocirc;ng \\u0110&ocirc;ng \\u0111\\u1ec1 c\\u1eadp th&ecirc;m.<\\/p>\\r\\n\\r\\n<p>G&oacute;p &yacute; t\\u1ea1i H\\u1ed9i th\\u1ea3o, ph\\u1ea7n \\u0111a &yacute; ki\\u1ebfn tham gia \\u0111\\u1ec1u th\\u1ed1ng nh\\u1ea5t s\\u1ef1 c\\u1ea7n thi\\u1ebft ban h&agrave;nh Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft; t\\u0103ng c\\u01b0\\u1eddng vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; khai th&aacute;c t\\u1ed1t h\\u01a1n \\u0111\\u1ed1i v\\u1edbi t&agrave;i s\\u1ea3n l&agrave; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft; th\\u1ed1ng nh\\u1ea5t v\\u1ec1 ph\\u1ea1m vi v&agrave; \\u0111\\u1ed1i t\\u01b0\\u1ee3ng; th\\u1ed1ng nh\\u1ea5t v\\u1ec1 c&aacute;ch th\\u1ee9c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; m\\u1ed9t s\\u1ed1 ph\\u01b0\\u01a1ng th\\u1ee9c kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>PV.<\\/p>\\r\\n","content_jp":"<p><a class=\\"photo\\" href=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/16\\/06\\/08\\/215\\/19577212\\/1_122166.jpg\\" style=\\"box-sizing: border-box; color: rgb(56, 56, 56); text-decoration: none; text-align: center; display: inline-block; width: 444px;\\"><img alt=\\"Doi moi co che, huong toi xa hoi hoa ha tang duong sat - Anh 1\\" src=\\"http:\\/\\/2.i.baomoi.xdn.vn\\/w460x\\/16\\/06\\/08\\/215\\/19577212\\/1_122166.jpg\\" style=\\"border-style:initial; border-width:0px; box-sizing:border-box; max-width:100%; vertical-align:middle\\" title=\\"\\u0110\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf, h\\u01b0\\u1edbng t\\u1edbi x\\u00e3 h\\u1ed9i h\\u00f3a h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft - \\u1ea2nh 1\\" \\/><\\/a><\\/p>\\r\\n\\r\\n<p>\\u01af\\u1edbc t&iacute;nh giai \\u0111o\\u1ea1n 2016-2020, Vi\\u1ec7t Nam c\\u1ea7n t\\u1edbi 10 t\\u1ef7 USD \\u0111\\u1ec3 \\u0111\\u1ea7u t\\u01b0 v&agrave;o h\\u1ec7 th\\u1ed1ng \\u0111\\u01b0\\u1eddng s\\u1eaft, \\u0111&acirc;y th\\u1ef1c s\\u1ef1 l&agrave; th&aacute;ch th\\u1ee9c l\\u1edbn trong vi\\u1ec7c huy \\u0111\\u1ed9ng ngu\\u1ed3n l\\u1ef1c v&agrave;o c&ocirc;ng cu\\u1ed9c duy tu, b\\u1ea3o tr&igrave; v&agrave; ph&aacute;t tri\\u1ec3n.<\\/p>\\r\\n\\r\\n<p>Ph&aacute;t bi\\u1ec3u t\\u1ea1i h\\u1ed9i th\\u1ea3o, Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T&agrave;i ch&iacute;nh Nguy\\u1ec5n H\\u1eefu Ch&iacute; cho r\\u1eb1ng, trong nh\\u1eefng n\\u0103m qua, Nh&agrave; n\\u01b0\\u1edbc \\u0111&atilde; huy \\u0111\\u1ed9ng nhi\\u1ec1u ngu\\u1ed3n l\\u1ef1c \\u0111\\u1ec3 x&acirc;y d\\u1ef1ng k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng v\\u1edbi quy m&ocirc; r\\u1ea5t l\\u1edbn, g&oacute;p ph\\u1ea7n quan tr\\u1ecdng v&agrave;o ph&aacute;t tri\\u1ec3n kinh t\\u1ebf x&atilde; h\\u1ed9i, x&oacute;a \\u0111&oacute;i gi\\u1ea3m ngh&egrave;o tr&ecirc;n c&aacute;c v&ugrave;ng, mi\\u1ec1n c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc. Tuy nhi&ecirc;n, h\\u1ec7 th\\u1ed1ng c\\u01a1 s\\u1edf h\\u1ea1 t\\u1ea7ng c\\u1ee7a Vi\\u1ec7t Nam trong \\u0111&oacute; c&oacute; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng giao th&ocirc;ng v\\u1eabn c&ograve;n y\\u1ebfu k&eacute;m, l\\u1ea1c h\\u1eadu, ch\\u01b0a \\u0111\\u1ed3ng b\\u1ed9, kh\\u1ea3 n\\u0103ng k\\u1ebft n\\u1ed1i gi\\u1eefa c&aacute;c lo\\u1ea1i h&igrave;nh c&ograve;n h\\u1ea1n ch\\u1ebf.<\\/p>\\r\\n\\r\\n<p>M\\u1eb7c d&ugrave; l&agrave; ph\\u01b0\\u01a1ng th\\u1ee9c v\\u1eadn t\\u1ea3i c&oacute; nhi\\u1ec1u l\\u1ee3i th\\u1ebf do gi&aacute; th&agrave;nh th\\u1ea5p, v\\u1eadn chuy\\u1ec3n h&agrave;ng h&oacute;a kh\\u1ed1i l\\u01b0\\u1ee3ng l\\u1edbn, an to&agrave;n nh\\u01b0ng h\\u1ec7 th\\u1ed1ng h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam kh&ocirc;ng nh\\u1eefng kh&ocirc;ng \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 ph&aacute;t tri\\u1ec3n, m&agrave; c&ograve;n b\\u1ecb thu h\\u1eb9p, th\\u1eadm ch&iacute; c&oacute; nh\\u1eefng tuy\\u1ebfn \\u0111\\u01b0\\u1eddng \\u0111&atilde; \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng tr&ecirc;n 100 n\\u0103m.<\\/p>\\r\\n\\r\\n<p>Nguy&ecirc;n nh&acirc;n d\\u1eabn t\\u1edbi t&igrave;nh tr\\u1ea1ng tr&ecirc;n c&oacute; r\\u1ea5t nhi\\u1ec1u, trong \\u0111&oacute; ph\\u1ea3i k\\u1ec3 t\\u1edbi c&aacute;c c\\u01a1 ch\\u1ebf, ch&iacute;nh s&aacute;ch trong qu\\u1ea3n l&yacute;. Nh\\u1eefng n\\u0103m qua, h\\u1ec7 th\\u1ed1ng ph&aacute;p lu\\u1eadt li&ecirc;n quan \\u0111\\u1ebfn qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, khai th&aacute;c t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0111&atilde; t\\u1ea1o \\u0111i\\u1ec1u ki\\u1ec7n cho s\\u1ef1 ph&aacute;t tri\\u1ec3n, song v\\u1eabn mang t&iacute;nh ch\\u1ea5t qu\\u1ea3n l&yacute; chuy&ecirc;n ng&agrave;nh, ch\\u01b0a ph&acirc;n \\u0111\\u1ecbnh r&otilde; quy\\u1ec1n, ngh\\u0129a v\\u1ee5 c\\u1ee7a \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng v\\u1edbi \\u0111\\u1ed1i t\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c giao s\\u1eed d\\u1ee5ng; trong khi ch\\u01b0a c&oacute; quy \\u0111\\u1ecbnh c\\u1ee5 th\\u1ec3 v\\u1ec1 c\\u01a1 ch\\u1ebf t&agrave;i ch&iacute;nh t\\u1ea1o &ldquo;c\\u01a1 ch\\u1ebf m\\u1edf&rdquo; thu h&uacute;t \\u0111\\u1ea7u t\\u01b0, khai th&aacute;c. Th\\u1ef1c t\\u1ebf t\\u1ea1i T\\u1ed5ng c&ocirc;ng ty \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam cho th\\u1ea5y, do v\\u1eeba l&agrave; ch\\u1ee7 th\\u1ec3 \\u0111\\u01b0\\u1ee3c Nh&agrave; n\\u01b0\\u1edbc giao qu\\u1ea3n l&yacute; t&agrave;i s\\u1ea3n k\\u1ebft k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng, v\\u1eeba l&agrave; \\u0111\\u01a1n v\\u1ecb s\\u1eed d\\u1ee5ng, khai th&aacute;c, b\\u1ea3o tr&igrave; n&ecirc;n \\u0111&atilde; c&oacute; nhi\\u1ec1u h\\u1ea1n ch\\u1ebf trong c&ocirc;ng t&aacute;c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, gi&aacute;m s&aacute;t vi\\u1ec7c s\\u1eed d\\u1ee5ng v\\u1ed1n, t&agrave;i s\\u1ea3n nh&agrave; n\\u01b0\\u1edbc, d\\u1eabn t\\u1edbi ch\\u01b0a hi\\u1ec7u qu\\u1ea3.<\\/p>\\r\\n\\r\\n<p>Ch\\u1ec9 t&iacute;nh trong giai \\u0111o\\u1ea1n 2011-2014, h&agrave;ng n\\u0103m ng&acirc;n s&aacute;ch nh&agrave; n\\u01b0\\u1edbc ph\\u1ea3i c\\u1ea5p kinh ph&iacute; th\\u1ef1c hi\\u1ec7n c&ocirc;ng t&aacute;c duy tu, s\\u1eeda ch\\u1eefa t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng t\\u1eeb 1.400 - 1.900 t\\u1ef7 \\u0111\\u1ed3ng, nh\\u01b0 v\\u1eady, ngo&agrave;i ngu\\u1ed3n thu \\u0111\\u01b0\\u1ee3c t\\u1eeb khai th&aacute;c k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft (kho\\u1ea3ng 350 t\\u1ef7 \\u0111\\u1ed3ng), ng&acirc;n s&aacute;ch nh&agrave; n\\u01b0\\u1edbc c\\u1ea5p th&ecirc;m b&igrave;nh qu&acirc;n t\\u1eeb 1.100 t\\u1ef7 \\u0111\\u1ed3ng \\u0111\\u1ebfn tr&ecirc;n 1.600 t\\u1ef7 \\u0111\\u1ed3ng. Th\\u1ebf nh\\u01b0ng, n\\u0103ng l\\u1ef1c v\\u1eadn t\\u1ea3i l\\u1ea1i \\u0111\\u1ea1t r\\u1ea5t th\\u1ea5p, ch\\u1ec9 b\\u1eb1ng 4,5% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;nh kh&aacute;ch v&agrave; kho\\u1ea3ng 1,8% t\\u1ed5ng l\\u01b0\\u1ee3ng v\\u1eadn t\\u1ea3i h&agrave;ng h&oacute;a.<\\/p>\\r\\n\\r\\n<p>Trong khi \\u0111&oacute;, c\\u01a1 ch\\u1ebf thu h&uacute;t ngu\\u1ed3n l\\u1ef1c t\\u1eeb khu v\\u1ef1c ngo&agrave;i nh&agrave; n\\u01b0\\u1edbc \\u0111\\u1ec3 chia s\\u1ebb g&aacute;nh n\\u1eb7ng v\\u1edbi Nh&agrave; n\\u01b0\\u1edbc ch\\u01b0a r&otilde; r&agrave;ng. Hi\\u1ec7n t\\u1ea1i, nhu c\\u1ea7u v\\u1ed1n ph\\u1ee5c v\\u1ee5 b\\u1ea3o tr&igrave; h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft t&iacute;nh \\u0111\\u1ebfn n\\u0103m 2020 kho\\u1ea3ng 10 t\\u1ef7 USD; nhu c\\u1ea7u v\\u1ed1n \\u0111\\u1ec3 \\u0111\\u1ea7u t\\u01b0 x&acirc;y d\\u1ef1ng ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft m\\u1edbi theo Chi\\u1ebfn l\\u01b0\\u1ee3c ph&aacute;t tri\\u1ec3n \\u0111\\u1ebfn n\\u0103m 2030 \\u0111&atilde; \\u0111\\u01b0\\u1ee3c ph&ecirc; duy\\u1ec7t c\\u1ea7n kho\\u1ea3ng 100 t\\u1ef7 USD. \\u0110&acirc;y l&agrave; nhi\\u1ec7m v\\u1ee5 h\\u1ebft s\\u1ee9c n\\u1eb7ng n\\u1ec1, c\\u1ea7n thi\\u1ebft ph\\u1ea3i c&oacute; gi\\u1ea3i ph&aacute;p \\u0111\\u1ee7 m\\u1ea1nh, nh\\u1eb1m thu h&uacute;t \\u0111\\u01b0\\u1ee3c ngu\\u1ed3n l\\u1ef1c \\u0111\\u1ee7 l\\u1edbn \\u0111\\u1ec3 \\u0111\\u1ea1t \\u0111\\u01b0\\u1ee3c m\\u1ee5c ti&ecirc;u ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft m&agrave; Nh&agrave; n\\u01b0\\u1edbc \\u0111&atilde; \\u0111\\u1eb7t ra.<\\/p>\\r\\n\\r\\n<p>M\\u1eb7t kh&aacute;c, vi\\u1ec7c t&iacute;nh ph&iacute; s\\u1eed d\\u1ee5ng h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft d\\u1ef1a tr&ecirc;n doanh thu v\\u1eadn t\\u1ea3i c\\u1ee7a doanh nghi\\u1ec7p kinh doanh \\u0111\\u01b0\\u1eddng s\\u1eaft (8% doanh thu) v&agrave; gi&aacute; cho thu&ecirc; (tr&iacute;ch 20% doanh thu sau khi tr\\u1eeb c&aacute;c chi ph&iacute; li&ecirc;n quan) n&ecirc;n ch\\u01b0a h\\u1ee3p l&yacute; theo c\\u01a1 ch\\u1ebf th\\u1ecb tr\\u01b0\\u1eddng, l&agrave;m tri\\u1ec7t ti&ecirc;u n\\u0103ng l\\u1ef1c c\\u1ea1nh tranh c\\u1ee7a doanh nghi\\u1ec7p v\\u1eadn t\\u1ea3i v&agrave; c&aacute;c \\u0111\\u01a1n v\\u1ecb thu&ecirc; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng; \\u0111\\u1ed3ng th\\u1eddi, d\\u1eabn \\u0111\\u1ebfn th\\u1ea5t thu kinh ph&iacute; \\u0111\\u1ec3 t&aacute;i \\u0111\\u1ea7u t\\u01b0 h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Vi\\u1ec7c ph&acirc;n lo\\u1ea1i t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft gi\\u1eefa c&aacute;c v\\u0103n b\\u1ea3n quy ph\\u1ea1m ph&aacute;p lu\\u1eadt c&ograve;n ch\\u01b0a c&oacute; s\\u1ef1 th\\u1ed1ng nh\\u1ea5t; kh&aacute;i ni\\u1ec7m t&ecirc;n g\\u1ecdi, ph&acirc;n lo\\u1ea1i t&agrave;i s\\u1ea3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft ch\\u1ec9 m\\u1edbi \\u0111\\u1ea3m b\\u1ea3o t&iacute;nh th\\u1ed1ng k&ecirc; \\u0111\\u1ea7y \\u0111\\u1ee7 v\\u1ec1 hi\\u1ec7n v\\u1eadt t&agrave;i s\\u1ea3n. S\\u1ef1 t&aacute;ch b\\u1ea1ch gi\\u1eefa vi\\u1ec7c s\\u1eed d\\u1ee5ng, kinh doanh t&agrave;i s\\u1ea3n thu\\u1ed9c s\\u1edf h\\u1eefu nh&agrave; n\\u01b0\\u1edbc v\\u1edbi t&agrave;i s\\u1ea3n thu\\u1ed9c s\\u1edf h\\u1eefu c\\u1ee7a doanh nghi\\u1ec7p thi\\u1ebfu r&otilde; r&agrave;ng, minh b\\u1ea1ch; vi\\u1ec7c chi ti&ecirc;u, h\\u1ea1ch to&aacute;n \\u0111\\u1ed1i v\\u1edbi t\\u1eebng ho\\u1ea1t \\u0111\\u1ed9ng ch\\u01b0a \\u0111\\u01b0\\u1ee3c ph&acirc;n t&aacute;ch c\\u1ee5 th\\u1ec3, tr&aacute;ch nhi\\u1ec7m qu\\u1ea3n l&yacute; ch\\u01b0a r&otilde; r&agrave;ng d\\u1eabn \\u0111\\u1ebfn k&eacute;m hi\\u1ec7u qu\\u1ea3, th\\u1ea5t tho&aacute;t.<\\/p>\\r\\n\\r\\n<p>Tr\\u01b0\\u1edbc th\\u1ef1c tr\\u1ea1ng tr&ecirc;n, c&aacute;c nghi&ecirc;n c\\u1ee9u v\\u1ec1 gi\\u1ea3i ph&aacute;p ph&aacute;t tri\\u1ec3n h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u1edf Vi\\u1ec7t Nam \\u0111&atilde; ch\\u1ec9 r&otilde; c\\u1ea7n ph\\u1ea3i th\\u1ef1c hi\\u1ec7n \\u0111\\u1ed3ng th\\u1eddi c&ugrave;ng l&uacute;c 2 nhi\\u1ec7m v\\u1ee5 mang t&iacute;nh chi\\u1ebfn l\\u01b0\\u1ee3c, \\u0111&oacute; l&agrave;: kh\\u1ea9n tr\\u01b0\\u01a1ng \\u0111\\u1ea7u t\\u01b0 x&acirc;y d\\u1ef1ng m\\u1edbi, n&acirc;ng c\\u1ea5p, hi\\u1ec7n \\u0111\\u1ea1i h&oacute;a c&aacute;c tuy\\u1ebfn giao th&ocirc;ng \\u0111\\u01b0\\u1eddng s\\u1eaft; \\u0111\\u1ed5i m\\u1edbi c\\u01a1 ch\\u1ebf qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng, b\\u1ea3o tr&igrave; v&agrave; khai th&aacute;c h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft hi\\u1ec7n c&oacute; nh\\u1eb1m duy tr&igrave; n\\u0103ng l\\u1ef1c ph\\u1ee5c v\\u1ee5 hi\\u1ec7n t\\u1ea1i v&agrave; k&eacute;o d&agrave;i tu\\u1ed5i th\\u1ecd c\\u1ee7a c&aacute;c c&ocirc;ng tr&igrave;nh.<\\/p>\\r\\n\\r\\n<p>C\\u1ee5c Qu\\u1ea3n l&yacute; c&ocirc;ng s\\u1ea3n (B\\u1ed9 T&agrave;i ch&iacute;nh) cho bi\\u1ebft, D\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0111\\u01b0\\u1ee3c x&acirc;y d\\u1ef1ng nh\\u1eb1m m\\u1ee5c ti&ecirc;u kh\\u1eafc ph\\u1ee5c nh\\u1eefng t\\u1ed3n t\\u1ea1i n&ecirc;u tr&ecirc;n, h\\u01b0\\u1edbng t\\u1edbi t&aacute;ch b\\u1ea1ch r&otilde; gi\\u1eefa qu\\u1ea3n l&yacute; nh&agrave; n\\u01b0\\u1edbc c\\u1ee7a c\\u01a1 quan nh&agrave; n\\u01b0\\u1edbc v\\u1edbi qu\\u1ea3n l&yacute; kinh doanh c\\u1ee7a doanh nghi\\u1ec7p \\u0111&atilde; \\u0111\\u01b0\\u1ee3c quy \\u0111\\u1ecbnh t\\u1ea1i Lu\\u1eadt \\u0110\\u01b0\\u1eddng s\\u1eaft n\\u0103m 2005; l&agrave;m r&otilde; nh\\u1eefng v\\u1ea5n \\u0111\\u1ec1 ch\\u01b0a ph&ugrave; h\\u1ee3p v\\u1edbi c&aacute;c quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt v\\u1ec1 doanh nghi\\u1ec7p v&agrave; ph&aacute;p lu\\u1eadt \\u0111\\u1ea5t \\u0111ai&hellip;<\\/p>\\r\\n\\r\\n<p>\\u0110i\\u1ec3m m\\u1edbi c\\u1ee7a d\\u1ef1 th\\u1ea3o l&agrave; t&aacute;ch b\\u1ea1ch quan h\\u1ec7 v\\u1ec1 t&agrave;i s\\u1ea3n gi\\u1eefa \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu l&agrave; nh&agrave; n\\u01b0\\u1edbc khi giao t&agrave;i s\\u1ea3n g\\u1eafn li\\u1ec1n v\\u1edbi giao v\\u1ed1n cho doanh nghi\\u1ec7p, theo quy \\u0111\\u1ecbnh c\\u1ee7a ph&aacute;p lu\\u1eadt doanh nghi\\u1ec7p; giao t&agrave;i s\\u1ea3n c\\u1ee7a nh&agrave; n\\u01b0\\u1edbc kh&ocirc;ng g\\u1eafn v\\u1edbi giao v\\u1ed1n, \\u0111\\u1ea1i di\\u1ec7n ch\\u1ee7 s\\u1edf h\\u1eefu ph\\u1ea7n v\\u1ed1n v&agrave; t&agrave;i s\\u1ea3n c\\u1ee7a Nh&agrave; n\\u01b0\\u1edbc c&oacute; quy\\u1ec1n \\u0111\\u1ecbnh \\u0111o\\u1ea1t, qu\\u1ea3n l&yacute; \\u0111i\\u1ec1u h&agrave;nh t&agrave;i s\\u1ea3n, \\u0111\\u01b0\\u1ee3c quy\\u1ec1n giao cho doanh nghi\\u1ec7p s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>Chi s\\u1ebb quan \\u0111i\\u1ec3m t\\u1ea1i H\\u1ed9i th\\u1ea3o, Gi&aacute;m \\u0111\\u1ed1c qu\\u1ed1c gia Ng&acirc;n h&agrave;ng ph&aacute;t tri\\u1ec3n ch&acirc;u &Aacute; t\\u1ea1i Vi\\u1ec7t Nam - &ocirc;ng Eric Sidgwick c\\u0169ng cho r\\u1eb1ng, m\\u1ea1ng l\\u01b0\\u1edbi \\u0111\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam \\u0111&oacute;ng vai tr&ograve; quan tr\\u1ecdng trong s\\u1ef1 ph&aacute;t tri\\u1ec3n kinh t\\u1ebf x&atilde; h\\u1ed9i c\\u1ee7a \\u0111\\u1ea5t n\\u01b0\\u1edbc. M\\u1eb7c d&ugrave; c&oacute; nhi\\u1ec1u ti\\u1ec1m n\\u0103ng \\u0111\\u1ec3 ph&aacute;t tri\\u1ec3n nh\\u01b0ng l\\u0129nh v\\u1ef1c n&agrave;y \\u0111ang g\\u1eb7p nhi\\u1ec1u h\\u1ea1n ch\\u1ebf do c\\u01a1 ch\\u1ebf, ch&iacute;nh s&aacute;ch, n\\u0103ng l\\u1ef1c v\\u1eadn t\\u1ea3i, h\\u1ea1 t\\u1ea7ng ch\\u01b0a h\\u1ee3p l&yacute; v&agrave; \\u0111&aacute;p \\u1ee9ng y&ecirc;u c\\u1ea7u c\\u1ee7a s\\u1ef1 ph&aacute;t tri\\u1ec3n.<\\/p>\\r\\n\\r\\n<p>&quot;\\u01af\\u1edbc t&iacute;nh giai \\u0111o\\u1ea1n 2016-2020, Vi\\u1ec7t Nam c\\u1ea7n t\\u1edbi 10 t\\u1ef7 USD \\u0111\\u1ec3 \\u0111\\u1ea7u t\\u01b0 v&agrave;o h\\u1ec7 th\\u1ed1ng \\u0111\\u01b0\\u1eddng s\\u1eaft, \\u0111&acirc;y th\\u1ef1c s\\u1ef1 l&agrave; th&aacute;ch th\\u1ee9c l\\u1edbn trong vi\\u1ec7c huy \\u0111\\u1ed9ng ngu\\u1ed3n l\\u1ef1c v&agrave;o c&ocirc;ng cu\\u1ed9c duy tu, b\\u1ea3o tr&igrave; v&agrave; ph&aacute;t tri\\u1ec3n, n\\u1ebfu Nh&agrave; n\\u01b0\\u1edbc kh&ocirc;ng c&oacute; \\u0111\\u1ee7 n\\u0103ng l\\u1ef1c c\\u1ea5p v\\u1ed1n cho ho\\u1ea1t \\u0111\\u1ed9ng n&agrave;y. Th\\u1eddi gian t\\u1edbi, Vi\\u1ec7t Nam c\\u1ea7n ph\\u1ea3i t\\u1eadp trung v&agrave;o ph&aacute;t tri\\u1ec3n \\u0111\\u1ec3 khai th&aacute;c ti\\u1ec1m n\\u0103ng, th\\u1ebf m\\u1ea1nh c\\u1ee7a ng&agrave;nh \\u0110\\u01b0\\u1eddng s\\u1eaft, trong \\u0111&oacute; c&aacute;c c\\u01a1 ch\\u1ebf qu\\u1ea3n l&yacute; c\\u1ea7n \\u0111\\u01b0\\u1ee3c thay \\u0111\\u1ed5i \\u0111\\u1ec3 thu h&uacute;t ngu\\u1ed3n l\\u1ef1c t\\u1eeb t\\u01b0 nh&acirc;n&rdquo;, &ocirc;ng Eric Sidgwick n&ecirc;u quan \\u0111i\\u1ec3m.<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ed3ng &yacute; v\\u1edbi xu h\\u01b0\\u1edbng l&agrave; c\\u1ea7n ph\\u1ea3i h\\u01b0\\u1edbng t\\u1edbi x&atilde; h\\u1ed9i h&oacute;a trong vi\\u1ec7c kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft nh\\u01b0ng Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 Giao th&ocirc;ng V\\u1eadn t\\u1ea3i &ndash; Nguy\\u1ec5n Ng\\u1ecdc \\u0110&ocirc;ng v\\u1eabn b\\u1ea3o l\\u01b0u quan \\u0111i\\u1ec3m: \\u0110\\u1ed1i v\\u1edbi nh\\u1eefng tuy\\u1ebfn \\u0111\\u01b0\\u1eddng khai th&aacute;c kh&ocirc;ng hi\\u1ec7u qu\\u1ea3 nh\\u01b0ng v\\u1eabn ph\\u1ea3i duy tr&igrave; th&igrave; Nh&agrave; n\\u01b0\\u1edbc c\\u1ea7n ph\\u1ea3i h\\u1ed7 tr\\u1ee3 t\\u1ed1i \\u0111a ngu\\u1ed3n l\\u1ef1c, k\\u1ec3 c\\u1ea3 h\\u1ed7 tr\\u1ee3 100% vi\\u1ec7c duy tu; \\u0111\\u1ed1i v\\u1edbi nh\\u1eefng tuy\\u1ebfn c&oacute; th\\u1ec3 kinh doanh t\\u1ed1t th&igrave; Nh&agrave; n\\u01b0\\u1edbc s\\u1ebd kh&ocirc;ng h\\u1ed7 tr\\u1ee3 100% m&agrave; \\u0111\\u01a1n v\\u1ecb kinh doanh c\\u1ea7n ph\\u1ea3i kinh doanh t\\u1ed1i \\u0111a h\\u1ea1 t\\u1ea7ng \\u0111\\u1ec3 b&ugrave; \\u0111\\u1eafp c&aacute;c chi ph&iacute; \\u0111\\u1ea7u t\\u01b0. &ldquo;\\u0110\\u1ed1i v\\u1edbi k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft, c&aacute;i g&igrave; Nh&agrave; n\\u01b0\\u1edbc \\u0111\\u1ea7u t\\u01b0 th&igrave; Nh&agrave; n\\u01b0\\u1edbc s\\u1ebd qu\\u1ea3n l&yacute; nh\\u01b0 ga, \\u0111\\u01b0\\u1eddng ray&hellip; c&ograve;n l\\u1ea1i s\\u1ebd ti\\u1ebfn h&agrave;nh thu h&uacute;t \\u0111\\u1ea7u t\\u01b0 t\\u1eeb t\\u01b0 nh&acirc;n&rdquo;, &ocirc;ng \\u0110&ocirc;ng \\u0111\\u1ec1 c\\u1eadp th&ecirc;m.<\\/p>\\r\\n\\r\\n<p>G&oacute;p &yacute; t\\u1ea1i H\\u1ed9i th\\u1ea3o, ph\\u1ea7n \\u0111a &yacute; ki\\u1ebfn tham gia \\u0111\\u1ec1u th\\u1ed1ng nh\\u1ea5t s\\u1ef1 c\\u1ea7n thi\\u1ebft ban h&agrave;nh Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft; t\\u0103ng c\\u01b0\\u1eddng vi\\u1ec7c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; khai th&aacute;c t\\u1ed1t h\\u01a1n \\u0111\\u1ed1i v\\u1edbi t&agrave;i s\\u1ea3n l&agrave; k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft; th\\u1ed1ng nh\\u1ea5t v\\u1ec1 ph\\u1ea1m vi v&agrave; \\u0111\\u1ed1i t\\u01b0\\u1ee3ng; th\\u1ed1ng nh\\u1ea5t v\\u1ec1 c&aacute;ch th\\u1ee9c qu\\u1ea3n l&yacute;, s\\u1eed d\\u1ee5ng v&agrave; m\\u1ed9t s\\u1ed1 ph\\u01b0\\u01a1ng th\\u1ee9c kinh doanh t&agrave;i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft.<\\/p>\\r\\n\\r\\n<p>PV.<\\/p>\\r\\n"}', 'Tham vấn dự thảo Nghị định quy định việc quản lý, sử dụng và kinh doanh tài sản kết cấu hạ tầng đường sắt,Thứ trưởng Bộ Tài chính Nguyễn Hữu Chí,xây dựng kết cấu hạ tầng,', '{"keyword_en":"Tham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft,Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T\\u00e0i ch\\u00ednh Nguy\\u1ec5n H\\u1eefu Ch\\u00ed,x\\u00e2y d\\u1ef1ng k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng,","keyword_jp":"Tham v\\u1ea5n d\\u1ef1 th\\u1ea3o Ngh\\u1ecb \\u0111\\u1ecbnh quy \\u0111\\u1ecbnh vi\\u1ec7c qu\\u1ea3n l\\u00fd, s\\u1eed d\\u1ee5ng v\\u00e0 kinh doanh t\\u00e0i s\\u1ea3n k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng \\u0111\\u01b0\\u1eddng s\\u1eaft,Th\\u1ee9 tr\\u01b0\\u1edfng B\\u1ed9 T\\u00e0i ch\\u00ednh Nguy\\u1ec5n H\\u1eefu Ch\\u00ed,x\\u00e2y d\\u1ef1ng k\\u1ebft c\\u1ea5u h\\u1ea1 t\\u1ea7ng,"}', '/public/media/files/1_122166.jpg', '0000-00-00 00:00:00', '', 0, '', NULL);
