(1, 'TTTH ĐS Đà Nẵng', '{"title_en":"TTTH \\u0110S \\u0110\\u00e0 N\\u1eb5ng","title_jp":"TTTH \\u0110S \\u0110\\u00e0 N\\u1eb5ng"}', 'Công ty Cổ Phần Thông Tin Tín hiệu đường sắt Đà Nẵng', '{"description_en":"C\\u00f4ng ty C\\u1ed5 Ph\\u1ea7n Th\\u00f4ng Tin T\\u00edn hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110\\u00e0 N\\u1eb5ng","description_jp":"C\\u00f4ng ty C\\u1ed5 Ph\\u1ea7n Th\\u00f4ng Tin T\\u00edn hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110\\u00e0 N\\u1eb5ng"}', 'Công ty Cổ Phần Thông Tin Tín hiệu đường sắt Đà Nẵng', '{"keywords_en":"C\\u00f4ng ty C\\u1ed5 Ph\\u1ea7n Th\\u00f4ng Tin T\\u00edn hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110\\u00e0 N\\u1eb5ng","keywords_jp":"C\\u00f4ng ty C\\u1ed5 Ph\\u1ea7n Th\\u00f4ng Tin T\\u00edn hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110\\u00e0 N\\u1eb5ng"}', 'Công ty CP Thông Tin Tín hiệu đường sắt Đà Nẵng', '{"company_name_en":"C\\u00f4ng ty CP Th\\u00f4ng Tin T\\u00edn hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110\\u00e0 N\\u1eb5ng","company_name_jp":"C\\u00f4ng ty CP Th\\u00f4ng Tin T\\u00edn hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft \\u0110\\u00e0 N\\u1eb5ng"}', '<p>C&ocirc;ng ty Cổ phần TTTH ĐS H&agrave; Nội l&agrave; c&ocirc;ng ty th&agrave;nh vi&ecirc;n thuộc c&ocirc;ng ty mẹ Đường sắt Việt Nam (ĐSVN). C&ocirc;ng ty với đội ngũ tr&ecirc;n 120 lao động c&oacute; tr&igrave;nh độ đ&agrave;o tạo từ đại học trở l&ecirc;n v&agrave; gần 400 c&ocirc;ng nh&acirc;n kỹ thuật l&agrave;nh nghề. C&ocirc;ng ty l&agrave; một đơn vị đầu đ&agrave;n trong ng&agrave;nh đường sắt trong lĩnh vực quản l&yacute;, bảo tr&igrave; v&agrave; x&acirc;y lắp viễn th&ocirc;ng t&iacute;n hiệu, điều khiển, điện (doanh nghiệp loại một).</p>\r\n\r\n<p>C&ocirc;ng ty Cổ phần Th&ocirc;ng tin t&iacute;n hiệu ĐS H&agrave; Nội (H@sitec.Jsc), tiền th&acirc;n l&agrave; Đoạn Th&ocirc;ng tin t&iacute;n hiệu H&agrave; Nội (th&agrave;nh lập lại ng&agrave;y 22/05/1979) v&agrave; C&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hiệu đường sắt H&agrave; Nội; được chuyển đổi hoạt động sang m&ocirc; h&igrave;nh C&ocirc;ng ty cổ phần theo quyết định số 64/QĐ-BGTVT v&agrave; quyết định ph&ecirc; duyệt phương &aacute;n cổ phần ho&aacute; số 3907/QĐ-BGTVT.</p>\r\n', '{"company_description_en":"<p>C&ocirc;ng ty C\\u1ed5 ph\\u1ea7n TTTH \\u0110S H&agrave; N\\u1ed9i l&agrave; c&ocirc;ng ty th&agrave;nh vi&ecirc;n thu\\u1ed9c c&ocirc;ng ty m\\u1eb9 \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam (\\u0110SVN). C&ocirc;ng ty v\\u1edbi \\u0111\\u1ed9i ng\\u0169 tr&ecirc;n 120 lao \\u0111\\u1ed9ng c&oacute; tr&igrave;nh \\u0111\\u1ed9 \\u0111&agrave;o t\\u1ea1o t\\u1eeb \\u0111\\u1ea1i h\\u1ecdc tr\\u1edf l&ecirc;n v&agrave; g\\u1ea7n 400 c&ocirc;ng nh&acirc;n k\\u1ef9 thu\\u1eadt l&agrave;nh ngh\\u1ec1. C&ocirc;ng ty l&agrave; m\\u1ed9t \\u0111\\u01a1n v\\u1ecb \\u0111\\u1ea7u \\u0111&agrave;n trong ng&agrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft trong l\\u0129nh v\\u1ef1c qu\\u1ea3n l&yacute;, b\\u1ea3o tr&igrave; v&agrave; x&acirc;y l\\u1eafp vi\\u1ec5n th&ocirc;ng t&iacute;n hi\\u1ec7u, \\u0111i\\u1ec1u khi\\u1ec3n, \\u0111i\\u1ec7n (doanh nghi\\u1ec7p lo\\u1ea1i m\\u1ed9t).<\\/p>\\r\\n\\r\\n<p>C&ocirc;ng ty C\\u1ed5 ph\\u1ea7n Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0110S H&agrave; N\\u1ed9i (H@sitec.Jsc), ti\\u1ec1n th&acirc;n l&agrave; \\u0110o\\u1ea1n Th&ocirc;ng tin t&iacute;n hi\\u1ec7u H&agrave; N\\u1ed9i (th&agrave;nh l\\u1eadp l\\u1ea1i ng&agrave;y 22\\/05\\/1979) v&agrave; C&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft H&agrave; N\\u1ed9i; \\u0111\\u01b0\\u1ee3c chuy\\u1ec3n \\u0111\\u1ed5i ho\\u1ea1t \\u0111\\u1ed9ng sang m&ocirc; h&igrave;nh C&ocirc;ng ty c\\u1ed5 ph\\u1ea7n theo quy\\u1ebft \\u0111\\u1ecbnh s\\u1ed1 64\\/Q\\u0110-BGTVT v&agrave; quy\\u1ebft \\u0111\\u1ecbnh ph&ecirc; duy\\u1ec7t ph\\u01b0\\u01a1ng &aacute;n c\\u1ed5 ph\\u1ea7n ho&aacute; s\\u1ed1 3907\\/Q\\u0110-BGTVT.<\\/p>\\r\\n","company_description_jp":"<p>C&ocirc;ng ty C\\u1ed5 ph\\u1ea7n TTTH \\u0110S H&agrave; N\\u1ed9i l&agrave; c&ocirc;ng ty th&agrave;nh vi&ecirc;n thu\\u1ed9c c&ocirc;ng ty m\\u1eb9 \\u0110\\u01b0\\u1eddng s\\u1eaft Vi\\u1ec7t Nam (\\u0110SVN). C&ocirc;ng ty v\\u1edbi \\u0111\\u1ed9i ng\\u0169 tr&ecirc;n 120 lao \\u0111\\u1ed9ng c&oacute; tr&igrave;nh \\u0111\\u1ed9 \\u0111&agrave;o t\\u1ea1o t\\u1eeb \\u0111\\u1ea1i h\\u1ecdc tr\\u1edf l&ecirc;n v&agrave; g\\u1ea7n 400 c&ocirc;ng nh&acirc;n k\\u1ef9 thu\\u1eadt l&agrave;nh ngh\\u1ec1. C&ocirc;ng ty l&agrave; m\\u1ed9t \\u0111\\u01a1n v\\u1ecb \\u0111\\u1ea7u \\u0111&agrave;n trong ng&agrave;nh \\u0111\\u01b0\\u1eddng s\\u1eaft trong l\\u0129nh v\\u1ef1c qu\\u1ea3n l&yacute;, b\\u1ea3o tr&igrave; v&agrave; x&acirc;y l\\u1eafp vi\\u1ec5n th&ocirc;ng t&iacute;n hi\\u1ec7u, \\u0111i\\u1ec1u khi\\u1ec3n, \\u0111i\\u1ec7n (doanh nghi\\u1ec7p lo\\u1ea1i m\\u1ed9t).<\\/p>\\r\\n\\r\\n<p>C&ocirc;ng ty C\\u1ed5 ph\\u1ea7n Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0110S H&agrave; N\\u1ed9i (H@sitec.Jsc), ti\\u1ec1n th&acirc;n l&agrave; \\u0110o\\u1ea1n Th&ocirc;ng tin t&iacute;n hi\\u1ec7u H&agrave; N\\u1ed9i (th&agrave;nh l\\u1eadp l\\u1ea1i ng&agrave;y 22\\/05\\/1979) v&agrave; C&ocirc;ng ty TNHH MTV Th&ocirc;ng tin t&iacute;n hi\\u1ec7u \\u0111\\u01b0\\u1eddng s\\u1eaft H&agrave; N\\u1ed9i; \\u0111\\u01b0\\u1ee3c chuy\\u1ec3n \\u0111\\u1ed5i ho\\u1ea1t \\u0111\\u1ed9ng sang m&ocirc; h&igrave;nh C&ocirc;ng ty c\\u1ed5 ph\\u1ea7n theo quy\\u1ebft \\u0111\\u1ecbnh s\\u1ed1 64\\/Q\\u0110-BGTVT v&agrave; quy\\u1ebft \\u0111\\u1ecbnh ph&ecirc; duy\\u1ec7t ph\\u01b0\\u01a1ng &aacute;n c\\u1ed5 ph\\u1ea7n ho&aacute; s\\u1ed1 3907\\/Q\\u0110-BGTVT.<\\/p>\\r\\n"}', '/public/media/images/logo-2.png', '{"logo_en":"\\/public\\/media\\/images\\/logo-2.png","logo_jp":"\\/public\\/media\\/images\\/logo-2.png"}', '', '{"intro_image_en":"","intro_image_jp":""}', '<div style="font-weight: bold;">C&Ocirc;NG TY TNHH&nbsp;PH&Uacute; AN PH&Aacute;T</div>\r\n\r\n<div style="margin-top: 10px;"><strong>Địa chỉ</strong>: Số 916, Ấp 4, Quốc Lộ 51, X&atilde; An H&ograve;a ,Th&agrave;nh Phố Bi&ecirc;n H&ograve;a ,Tỉnh Đồng Nai</div>\r\n\r\n<div style="margin-top: 10px;"><strong>Tel</strong>: 0613 937964 - 0613 937974</div>\r\n\r\n<div><strong>Fax</strong>: 0613 937984</div>\r\n\r\n<div style="margin-top: 10px;"><strong>Hotline</strong>:&nbsp;<strong>0907 353 348 - 0909 926 618</strong></div>\r\n\r\n<div><strong>Email</strong>: sales.phuanphat@gmail.com<br />\r\n<br />\r\n<span style="font-family:arial; font-size:10pt"><span style="font-size:10pt"><strong>Hỗ trợ trực tuyến</strong></span></span>\r\n\r\n<div class="icosp">\r\n<p>&nbsp;</p>\r\n\r\n<div style="padding: 0px; margin: -43px 0px 0px 50px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;"><span style="font-size:11px"><span style="font-family:arial,helvetica,sans-serif"><strong><span style="color:rgb(0, 51, 51)">Hỗ Trợ Kỹ Thuật &amp; Tư Vấn</span></strong><br />\r\nTRẦN BẢO TO&Agrave;N<br />\r\nDD: 0907 353 348</span></span></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="padding: 0px; margin: -43px 0px 0px 50px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;"><span style="font-size:11px"><span style="font-family:arial,helvetica,sans-serif"><strong><span style="color:rgb(0, 51, 102)">Hỗ Trợ Kỹ Thuật &amp; Tư Vấn</span></strong><br />\r\nL&Ecirc; LONG<br />\r\nDD: 0938 108 113</span></span></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="padding: 0px; margin: -43px 0px 0px 50px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;"><span style="font-size:11px"><span style="font-family:arial,helvetica,sans-serif"><span style="color:rgb(0, 51, 102)"><strong>Nh&acirc;n Vi&ecirc;n Kinh Doanh 1</strong></span><br />\r\nĐỖ MẠNH H&Ugrave;NG<br />\r\nDD: 0908 369 448</span></span></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="padding: 0px; margin: -43px 0px 0px 50px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;"><span style="font-size:11px"><span style="font-family:arial,helvetica,sans-serif"><strong><span style="color:rgb(0, 51, 102)">Nh&acirc;n Vi&ecirc;n Kinh Doanh 2</span></strong><br />\r\nBỘI TI&Ecirc;N<br />\r\nDD: 0975 610 345</span></span></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="padding: 0px; margin: -43px 0px 0px 50px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;"><span style="font-size:11px"><span style="font-family:arial,helvetica,sans-serif"><strong><span style="color:rgb(0, 51, 102)">Nh&acirc;n Vi&ecirc;n Kinh Doanh 3</span></strong><br />\r\nTHANH TAM<br />\r\nDD : 0988 612 417</span></span></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="padding: 0px; margin: -43px 0px 0px 50px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal;"><span style="font-size:11px"><span style="font-family:arial,helvetica,sans-serif"><span style="color:rgb(0, 51, 102)"><strong>Nh&acirc;n Vi&ecirc;n Kinh Doanh 4</strong></span><br />\r\nTRẦN L&Acirc;N<br />\r\nDD: 0902 115 918</span></span></div>\r\n</div>\r\n</div>\r\n', '218 Hải Phòng, P.Tân Chính, Q.Thanh Khê, TP.Đà Nẵng', '<p>Giai đoạn đầu đầy kh&oacute; khăn, gian khổ từ năm 1979 đến 1985, trong điều kiện cả nước c&ograve;n ngập ch&igrave;m trong cơ chế bao cấp, với biết bao kh&oacute; khăn chồng chất sau cuộc chiến tranh d&agrave;i của d&acirc;n tộc, những kh&oacute; khăn n&agrave;y c&oacute; những l&uacute;c tưởng chừng như kh&ocirc;ng thể vượt qua được; nhưng bằng &yacute; ch&iacute;, nghị lực v&agrave; tinh thần tr&aacute;ch nhiệm cao với sự ph&aacute;t triển của ng&agrave;nh, của đất nước bằng mồ h&ocirc;i, xương m&aacute;u của hơn 1500 c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n tr&ecirc;n 120 tổ sản xuất, thuộc 15 đơn vị TTTH trực thuộc, 1 xưởng TTTH, 1 trường c&ocirc;ng nh&acirc;n kỹ thuậtTTTH v&agrave; cơ quan đoạn đ&atilde; vượt qua c&aacute;c kh&oacute; khăn, thử th&aacute;ch để x&acirc;y dựng v&agrave; trưởng th&agrave;nh.</p>\r\n\r\n<p>Lần lượt qua c&aacute;c giai đoạn ph&aacute;t triển, c&ocirc;ng ty đ&atilde; tự khẳng định được vị tr&iacute;, uy t&iacute;n của m&igrave;nh v&agrave; cho đến nay C&ocirc;ng ty l&agrave; doanh nghiệp c&ocirc;ng &iacute;ch, hạch to&aacute;n độc lập v&agrave; cũng l&agrave; doanh nghiệp c&oacute; quy m&ocirc;, phạm vi quản l&yacute; lớn nhất về TTTHĐ của đường sắt Việt Nam với tr&ecirc;n 700 CBCNV, được bố tr&iacute; tại 8 x&iacute; nghiệp trực thuộc. C&ocirc;ng ty c&oacute; nhiệm vụ ch&iacute;nh l&agrave; quản l&yacute;, bảo tr&igrave; kết cấu hạ tầng về TTTHĐ ĐS thuộc địa b&agrave;n 11 tỉnh v&agrave; th&agrave;nh phố ph&iacute;a bắc của Việt Nam, ngo&agrave;i ra bằng khả năng, vị thế của m&igrave;nh c&ocirc;ng ty đ&atilde; mở rộng, ph&aacute;t triển th&ecirc;m nhiều ng&agrave;nh nghề kinh doanh kh&aacute;c như: tư vấn, lập b&aacute;o c&aacute;o đầu tư x&acirc;y dựng; trực tiếp thực hiện x&acirc;y lắp, triển khai h&agrave;ng trăm c&aacute;c c&ocirc;ng tr&igrave;nh, dự &aacute;n về viễn th&ocirc;ng, t&iacute;n hiệu, điều khiển, cung cấp điện trong giao th&ocirc;ng vận tải; Sản xuất, kinh doanh vật tư, thiết bị kỹ thuật; b&aacute;n đấu gi&aacute; t&agrave;i sản; kinh doanh bất động sản v&agrave; nhiều ng&agrave;nh nghề kh&aacute;c... với th&acirc;m ni&ecirc;n tr&ecirc;n 30 năm thuộc c&aacute;c lĩnh vực kinh doanh ch&iacute;nh, trong suốt qu&aacute; tr&igrave;nh x&acirc;y dựng, ph&aacute;t triển v&agrave; trưởng th&agrave;nh của m&igrave;nh c&ocirc;ng ty lu&ocirc;n được c&aacute;c cơ quan quản l&yacute; ng&agrave;nh v&agrave; bạn h&agrave;ng đ&aacute;nh gi&aacute; cao về năng lực, uy t&iacute;n thực hiện c&aacute;c cam kết của m&igrave;nh.</p>\r\n', '<p>1. Sản xuất v&agrave; cung ứng sản phẩm, dịch vụ c&ocirc;ng &iacute;ch quản l&yacute;, bảo tr&igrave; KCHT ĐSQG về th&ocirc;ng tin, t&iacute;n hiệu, điện, viễn th&ocirc;ng v&agrave; điều khiển).</p>\r\n\r\n<p>2. Tổ chức ứng ph&oacute; sự cố thi&ecirc;n tai, cứu nạn v&agrave; tai nạn giao th&ocirc;ng đường sắt.</p>\r\n\r\n<p>3. Tư vấn lập dự &aacute;n đầu tư, thẩm định b&aacute;o c&aacute;o đầu tư, khảo s&aacute;t thiết kế, thẩm định gi&aacute;, gi&aacute;m s&aacute;t c&aacute;c c&ocirc;ng tr&igrave;nh chuy&ecirc;n ng&agrave;nh th&ocirc;ng tin, t&iacute;n hiệu, điều khiển, điện; Tư vấn gi&aacute;m s&aacute;t c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y dựng.</p>\r\n\r\n<p>4. X&acirc;y dựng, lắp đặt thiết bị KCHT giao th&ocirc;ng đường sắt, đường bộ, d&acirc;n dụng v&agrave; c&ocirc;ng nghiệp; hệ thống cung cấp điện, tiếp đất chống s&eacute;t, đường d&acirc;y v&agrave; trạm biến &aacute;p, c&ocirc;ng tr&igrave;nh điện hạ thế, điện chiếu s&aacute;ng; c&ocirc;ng tr&igrave;nh th&ocirc;ng tin, viễn th&ocirc;ng, t&iacute;n hiệu điều khiển giao th&ocirc;ng, điều khiển tự động, tin học&hellip;</p>\r\n\r\n<p>5. Đầu tư, x&acirc;y dựng v&agrave; tổ chức kinh doanh, cung cấp dịch vụ cơ sở hạ tầng mạng viễn th&ocirc;ng; c&aacute;c dịch vụ viễn th&ocirc;ng c&ocirc;ng &iacute;ch v&agrave; c&ocirc;ng cộng, dịch vụ c&ocirc;ng nghệ th&ocirc;ng tin, t&iacute;n hiệu v&agrave; truyền th&ocirc;ng.</p>\r\n\r\n<p>6. Chế tạo, sửa chữa thiết bị, phụ t&ugrave;ng, sản xuất, xuất nhập khẩu, bu&ocirc;n b&aacute;n vật tư, thiết bị, phụ kiện v&agrave; kết cấu th&eacute;p, thiết bị cấu kiện điện tử chuy&ecirc;n ng&agrave;nh viễn th&ocirc;ng, t&iacute;n hiệu, điều khiển giao th&ocirc;ng, CNTT truyền th&ocirc;ng v&agrave; cung cấp điện.</p>\r\n\r\n<p>7. Tổ chức th&iacute; nghiệm vật liệu x&acirc;y dựng, c&ocirc;ng tr&igrave;nh giao th&ocirc;ng v&agrave; chuy&ecirc;n ng&agrave;nh viễn th&ocirc;ng, t&iacute;n hiệu, điều khiển v&agrave; điện.</p>\r\n\r\n<p>8. Hợp t&aacute;c li&ecirc;n doanh, li&ecirc;n kết với c&aacute;c tổ chức trong v&agrave; ngo&agrave;i nước theo quy định của ph&aacute;p luật để thực hiện mục đ&iacute;ch kinh doanh t&igrave;m kiếm lợi nhuận; v&agrave;</p>\r\n\r\n<p>9. C&aacute;c ng&agrave;nh nghề sản xuất kinh doanh kh&aacute;c theo quy định của ph&aacute;p luật</p>\r\n', '(0511) 382 5472', '(0511) 382 5472', 'Gadanang@diachimail.com', '{"contact_info_en":null,"contact_info_jp":null}', 'https://www.youtube.com/embed/ahLjVibR6oY', 'doc,docx,pdf,img,png,gif');
